(12, 'DO NOT FEAR TO FAIL', 'Emmanuel Ojelade', 'hide', '<p><em><img alt=\"\" src=\"https://www.pexels.com/photo/man-person-jumping-desert-6496/\" />&quot;Father, can we not construct that kind of villa?</em></p>\r\n\r\n<p><em>The other day, I saw something of such magnitude this in our area and also have spotted this kinda design at some nearby areas, so to me it seems as though only the strong teams make such,&nbsp;</em></p>\r\n\r\n<p><em>I thought you claimed the company to be one of the best constructors in the nation, of course that should be easy for you to do&quot;</em> said the 16-year old son of the CEO, Optimal Builders</p>\r\n\r\n<p><em>&quot;Hmmm&quot;</em> murmured the father <em>&quot;we can not, my son, the last time we tried it, we failed whole fully, lost lots of capital inputs and materials only to be brought down by thorough failure and ever since then; decided never to try it anymore&quot;</em></p>\r\n\r\n<p><em>&quot;When was this Daddy?&quot;</em>, inquired the son</p>\r\n\r\n<p><em>&quot;Some twenty years ago, my boy, while I was still working under your grandfather, my father&quot;, </em>the father replied his inquisitive son</p>\r\n\r\n<p>So you mean ever since then, you&#39;ve not for once tried to build such?, the son backfired</p>\r\n\r\n<p>No son, we have not, though we have gotten offers to do so, we never did it.</p>\r\n\r\n<p>&quot;Why?&quot; asked the little one</p>\r\n\r\n<p>&quot;Enough with the questions son, now go and play with your mates&quot; and he, noticing some sort of disgust on his father&#39;s face left.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Some 5 years to come,&nbsp;</p>\r\n\r\n<p>Optimal builders got this same project 4 different times for outrageous rates &nbsp;yet the administrative officers refused all the offers for no main reason, but for the fear of past failures</p>\r\n\r\n<p>During this hiatus in time, the grandson of the founder became head of operations and without informing his Father accepted a bid on building the forbidden construction (for the fear of past failures)</p>\r\n\r\n<p>After studying all he needed to know on how best to build the structure, he set to start work on the next project of such that would come; constructing, &nbsp;and after a whole two months, the work was completed, the fastest in the record of building history.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>After the completion of the work, this man, the grandson showed his father what the success in what he did and who in turn showed it to his own father (the founder)</p>\r\n\r\n<p>The man was astounded to know that what he couldn&#39;t make happen, a younger and less experienced offspring of his made it possible.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let&#39;s cogitate then, what would have occurred to the company if the son had decided never to do that which all his predecessors as well didn&#39;t do for fear of failure?</p>\r\n\r\n<p>Do you not think the company would have crashed?</p>\r\n\r\n<p>For its being incompetent, not being a able to perform a simple task, you think the customers would care?</p>\r\n\r\n<p>No, they will not!</p>\r\n\r\n<p>and this relates to you and I as well.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The Founder of the company in this story</strong> refers to your parents, guardian and everyone who looked after you while you were young (and still are), they will be the ones who will have tried it (or their predecessors) and would have failed or never succeeded at making it happen</p>\r\n\r\n<p><strong>The Father in this story</strong> refers to those around you, the ones who will tell you the tale that this has been tried and wasn&#39;t successful, they as well would have given up on whether or not it can be done because they&#39;ve been forced into believing that what was once unsuccessful by the old ones, can not be done by the new, they fail to realise that they were made to be more than they ever thought of, they fail to realise that there is greatness embedded in them, but already bow to the dictates of those ruling them, the government, boss at work and every other domineering power upon them.</p>\r\n\r\n<p>It&#39;s certain that the Father would have dissuaded the work from getting done, not to talk less, get accepted and this is why the smart little one accomplished in this case decided to steer safely by not informing him</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The son </strong>however, is you</p>\r\n\r\n<p>We have all that it takes to build that in-constructible building our old men tried, failed and forbade due to their failures.</p>\r\n\r\n<p>We have that fighting spirit in us, ready for challenges that has faced and defeated the old set.</p>\r\n\r\n<p>Now, are you ready to face the fears of old?</p>\r\n\r\n<p>If the grandson had taken his father&#39;s words of impossibility for it, he as we&#39;ll will be&nbsp;</p>\r\n\r\n<p>Are you ready to open that forbidden book of greatness in your locale?</p>\r\n\r\n<p>Are you?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>From a friend that cares,</p>\r\n\r\n<p>Emmiasky Ojex</p>', 'uploads/15376976942267952received_972239259626137.jpeg', '36au8m1elEn53m8538', '10:06:25', '2018-09-17', '1537186944ric5ltd5a5e9696o9101', 5, 'uploads/15376976945349765received_972239259626137.jpeg', 7, 52, 3.7, 3.8, 2.2, 3.5, 3.3, 17.9),
(14, 'Passion; Your key to success', 'Solomon Ademiju', 'hide', 'If you look around you today, you will see that some people are doing\r\nthings in an extra ordinary way you can ever imagine because of their\r\npassion for doing it. Many people have discovered their God given\r\ntalent by making use of the gift of passion deposited in them. If you\r\nderive pleasure in sketching other peoples face on a drawing board at\r\na tender age ,you might end up making a living out of it in the future\r\nif you keep the fire of passion for sketching burning continuously in\r\nyou. Your own gift might me mimicking your fellow friends just as a\r\nway of creating fun for yourself but if the spirit never dies or you\r\ndidn\'t give it up because of some pressure from other people you might\r\nend up being a successful comedian.\r\n  Most people never believe their passion for a particular habit or\r\nhobby might make them to be successful in life ,just take for example,\r\na friend of mine back then during our secondary school days was fond\r\nof drumming and this drumming of a thing comes to her naturally and\r\neasily, most time she drums unconsciously even in class when the\r\nlecture is going on and today she is a renowned drummer and she\r\ndoesn\'t stick to drumming alone,she is also a proficient banker but\r\ndrumming has brought her to limelight because of her gender and most\r\npeople believe if you are doing what the opposite sex is doing then\r\nyou are indeed a genius. Developing passion for writing might be a\r\nlittle difficult because writing takes a lot of reasoning and skills\r\nbut when its a thing you do often you might become a pro over night\r\nand might soon start publishing your own book.\r\n  If talking and speaking in public comes to you naturally and you\r\ndon\'t see a big deal in addressing a myriad of people and motivating\r\nthem to pursue their ambition or dream then your passion for being a\r\nmotivational speaker is indeed a great gift. Never give up your\r\npassion for a particular hobby or action because of human criticism or\r\nyour gender, sometimes it helps to make you stronger and develop your\r\npassion the more.\r\nFor your passion to make you successful in life, there are three\r\nthings you must consider;\r\n\r\nFirstly, never misinterpret your interest for a something for passion.\r\nYou might have interest in learning a particular instrument and not\r\nhave passion for using that instrument. If you develop your interest\r\nvery well you might be a master at it but if you have a passion for it\r\nyou will be a pro and stand out in your field.\r\n\r\nSecondly, develop your talent by making use of your passion, you can\r\nmake it big in life if you develop a strong passion for your talent.\r\nThe use of your talent with a great sense of passion will surely make\r\nyour success story a better one.\r\n\r\nThirdly, never give up your passion for anything. To get to the top in\r\nlife you will surely climb some obstacles like criticism and other\r\nembarrassment, but never give up and always believe In yourself.', 'uploads/15372250639729242IMG-20180822-WA0011.jpg', 'oo651n61l7m725so1', '22:55:17', '2018-09-17', '153722506383sti3iarl9pcea63s1o7n181', 5, 'thumb/15372250639378251IMG-20180822-WA0011.jpg', 0, 0, 2.5, 3.2, 3.2, 3.3, 3.0, 0.0),
(15, 'The tears', 'Olawunmi Faidat Odunayo', 'hide', '<p>Tears in the eyes<br />\r\nThat wants to fall<br />\r\nWhat now?<br />\r\nWe are both crying<br />\r\nYour tear drops on the pages<br />\r\nSmudging my ink<br />\r\nAnd breaking my heart<br />\r\nSlowly, the blue turns red<br />\r\nThat&#39;s blood seeping from my chest<br />\r\nWhat now?<br />\r\nIs it the specious arguments?<br />\r\nThat we end up not completing<br />\r\nThe faults we seem to find in ourselves?<br />\r\nWhich are not really there<br />\r\nThe mistakes we keep making?<br />\r\nThat keeps breaking us<br />\r\nThis mistakes that brings tears to our eyes<br />\r\nAnd confusion to our souls<br />\r\nI&#39;m writing with emotion<br />\r\nYour tears giving me inspiration<br />\r\nI take a deep breath<br />\r\nI can&#39;t walk away now<br />\r\nThe fire is not going out<br />\r\nEven though we are trying to quench it<br />\r\nThis strong blazing fire<br />\r\nWhich intensifies our tears<br />\r\nAnd pulls us closer.&nbsp;<br />\r\nAnd now, I fade in and out<br />\r\nI&#39;m sorry, I can&#39;t help it<br />\r\nIt&#39;s too hot in here<br />\r\nYou pull me closer<br />\r\nIt hurts<br />\r\nI run far from you again<br />\r\nI&#39;m running in circles<br />\r\nBecause I come back to you<br />\r\nNow my heart is beating in flips<br />\r\nCausing pain to course through our bodies<br />\r\nAnd I&#39;m still writing in red<br />\r\nBecause I can&#39;t stop<br />\r\nYour tears from flowing<br />\r\nThe muse I&#39;m stuck with<br />\r\nWe seem crazy<br />\r\nWhen we hurt ourselves with love<br />\r\nBut that&#39;s what love is<br />\r\nIt comes with pain<br />\r\nWhat now?<br />\r\nDo we fall apart<br />\r\nLest we lose ourselves?<br />\r\nYou want to smile through it<br />\r\nBut I want to run far away<br />\r\nI&#39;m losing my breath<br />\r\nI want to lie down<br />\r\nI don&#39;t want to smile for any other<br />\r\nBut I don&#39;t want to smile through this pain<br />\r\nThe red has stopped flowing<br />\r\nAll dried up now<br />\r\nAnd I&#39;ve stopped writing<br />\r\nLying down now, my eyes closed peacefully<br />\r\nI left this for you<br />\r\nTill we meet again.</p>', 'uploads/1537438518336994IMG-20180919-WA0000.jpg', '1535272791lai0827814m5u8o6w', '10:12:51', '2018-09-20', '1537438519t45ta9e89lhc8644r2ie1', 5, 'thumb/15374385185539398IMG-20180919-WA0000.jpg', 9, 5, 1.8, 2.6, 1.8, 2.2, 2.1, 6.7),
(18, '2019 - The Year to Verify Nigerian\'s Madness ', 'Peter Oyebanji', 'hide', '<p>From Pleateau&#39;s killings to the incessant disastrous tanker incident then to being knocked out of world cup in a painful way coupled with the report that tickets that were meant for Super Eagles&#39; Supporters were sold out to the Argentine and Icelandish fans by our own football federation, it&#39;s been a hellish couple of weeks for Nigerians. Commiserations to everyone that has been affected by these perils.&nbsp;<br />\r\n2019 is one year I&#39;m exceedingly anticipating, because of so many fantasized events. From Game of Thrones to the upcoming elections as well as how I want to see Mancheter United win the treble that I&#39;m already seeing at &quot;the theatre of dreams.&quot; One other thing I&#39;m overly anticipating is to test the veracity of the word &quot;we are mad in this country.&quot;&nbsp;<br />\r\nThe humorous word &quot;we are mad in this country&quot; is one that we&#39;ve shown the reality. The word is an overused word on social medias, one-on-one communications, group chats, et al. Those unimaginable clapbacks, needless rudeness, crazy replies, the list is unending. Those are some of the ways we liss ourselves, you can&#39;t be having a suicidal thought and take a walk on a street in Lagos, you&#39;ve just crescendoed the thought.&nbsp;<br />\r\nWhat brings about the liss at first is the mad state of the country. From individuals both learned and unlearned to people at the helm of affairs, there is a level of proness to anomalies in this country. It is here that we have proletariat putting their lives at risk for the apathetic bourgeois, masses are killing masses. A video about a man using a cloth to stop fuel from dripping from a fuel tanker surfaced online recently, you wanna know who the owner is? Never mind.&nbsp;<br />\r\nWe have a president that doesn&#39;t react to disturbing issues, he does sometimes, after much censuring. A president that released a speech in his dialect, in a country that is suffering from ethno-religious crisis. A president that disregards the constitution and doesn&#39;t see anything wrong with it. His finance minister has been confirmed of forging a certificate, there has been no reaction from the president and it&#39;s past three days. If someone that contested for presidency four times before winning can&#39;t do very basic things, is that not madness?<br />\r\nThere were massacres going on in the country but the police force preferred to go for a politicised mission. SARS (Special Anti Robbbery Squad) prioritizes harrasing and killing of youths inconsequentially over doing their job, in a sane country! It is in this country that almost everyone knows the solutions to some problems yet they are unsolved. The issue of fuel tanker is an incessant one, the ojuelegba incident is an incessant one yet nothing has been done. When a preventable incident keeps killing people overtime, is that still sane?&nbsp;<br />\r\nSenators receive millions of naira monthly but the minimum wage is eighteen thousand naira (18,000), that is really sane, isn&#39;t it? The legislative arm didn&#39;t know the Nigeria police needs to be checked, until they rough-handled a law maker. They didn&#39;t know the president needs to be impeached, until he started coming for them. We know all these, we know they don&#39;t care yet we will still vote for them, argh. Who isn&#39;t mad here? tell me.&nbsp;<br />\r\nPDP has formed a coalition with other parties, one of which includes politicians that were in both the PDP&#39;s 16 disastrous years and this current administration. What I&#39;m saying is they served in PDP, when they saw PDP was losing it and about to get ousted, they moved to APC. Some have gone back to PDP, expecting us to either vote for APC or PDP. It&#39;s like eating same meal from different plate, it will still taste the same.&nbsp;<br />\r\nDo you know the worst of these madness? A lot of Nigerians are segmented with the thoughts that either they revote this current administration or they vote in the party that just got voted out, they already have a ready-made excuse of &quot;they are the only realistic option.&quot; The excuse itself is a topic for another article on its own, because it&#39;s a very silly excuse. Emmanuel Macron when he came to Nigeria said&nbsp; &quot;democracy can not be written in advance as he is a living witness.&quot; That statement doesn&#39;t relate to this kind of situation we&#39;re creating, a surprise is no more a surprise if it has been revealed. We are the writer of democracy, anything that will be scripted will be written by us.&nbsp;<br />\r\nA yoruba adage says &quot;a foretold war doesn&#39;t kill a wise cripple.&quot; Are we actually mad in this country? We shall know in 2019.</p>\r\n\r\n<p>Peter Oyebanji is a student-campus journalist and can be reached through&nbsp;<br />\r\nTwitter: Anderpeter2&nbsp;<br />\r\nGmail: adewuyipeter50@gmail.com&nbsp;</p>', 'uploads/15375981472212557IMG-20180922-WA0000.jpg', '8e1t86er265564P', '15:03:38', '2018-09-20', '1537455894493f6e7la223ct8h8rgih1', 5, 'uploads/15375981478093038IMG-20180922-WA0000.jpg', 4, 21, 1.5, 2.0, 1.2, 1.5, 1.5, 16.7);
