(483, 'uploads/169831654349059base_image.jpg', '9004704245_1698063867', '55.50000000000001', '23.5', '38.625', '38.6015', '100%', 'Verdana', '#ffffff', '13px', '28.125', '66.94525', '90', '7.5', '2023-10-23', '12:24:27', '1698063563_6842416', NULL, 'Africa Retail Congress', '<p>Africa Retail Congress annual congress, is the largest gathering of Africa\'s retail leaders, bringing together industry experts, stakeholders, academics, and public sector representatives. Its primary focus is to provide a platform for learning, networking, collaboration, and celebration within the African retail sector. The Congress aims to address critical issues and opportunities facing the industry to foster growth, innovation, and sustainability.&nbsp;</p><p>At the Africa Retail Congress 2023, we would provoke conversations on 3 Strategic Pillars&nbsp;</p><p>Regulation and Policy Development: Unlocking the potential for growth by shaping the regulatory landscape.</p><p>Data and Technology (E-commerce): Embracing the digital revolution to revolutionise retail.</p><p>People, Planet, and Partnerships: Nurturing sustainable practices and forging alliances, to build a brighter future.&nbsp;</p>', NULL, 'ARC2023', 148, NULL, '#Retail #Africaretailcongress #ARC2023', '231rcfre2', NULL, NULL, NULL, NULL, NULL, NULL, 'I will be attending Africa Retail Congress, the largest gathering of retail leaders in Africa. Register here: https://events.lbs.edu.ng/arc2023'),
