(71, 'Frenzy', '<p>L.G.A: Ado-Ekiti Ado J Okesa PU 002 Time: 7:55 <a href=\"https://twitter.com/inecnigeria/\">@inecnigeria</a> have arrive. Security personnel are on ground. Set up has started. Lots of people waiting. There are 5 voting points here. <a href=\"https://twitter.com/search?q=%23EkitiDecides2018\">#EkitiDecides2018</a> <a href=\"https://twitter.com/search?q=%23EkitiSR2018\">#EkitiSR2018</a></p><p>https://twitter.com/SituationRoomNg/status/1018036416788430850</p>', '07:41:55', '82nti134n4i677rg8a', '@Frenzykul'),
