(100, 'Femi', '<p>In PU 007, Aba Egin, Oke Emure II, Emure LGA, voting has been disrupted by suspected thugs accompanied by military officers who forcibly took polling officials and election materials away <a href=\"https://twitter.com/search?q=%23WatchingTheVote\">#WatchingTheVote</a> <a href=\"https://twitter.com/search?q=%23EkitiDecides2018\">#EkitiDecides2018</a> <a href=\"https://twitter.com/inecnigeria/\">@inecnigeria</a> https://twitter.com/YIAGA/status/1018111814658412545</p>', '12:43:36', '321tnna39irg5i8806', NULL),
