(104, 'ElecctionSurvey', '<p>Are you participating in the Ekiti Election, Do you have anything to say, incidents, videos &nbsp;or images about the election process held in a locality in Ekiti state?</p><p>A platform has been created for you to air your views and opinions on the election process, to bring a positive change in the election process in our states and nation.</p><p>Complete the following simple steps for your voice to be heard and bring a positive change to &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;our society. ïƒ˜ Step 1: &nbsp;Open the link &nbsp;https://ekitielections.ushahidi.io &nbsp; ïƒ˜ Step 2: &nbsp;Click on the yellow plus (+) button to add your opinion. ïƒ˜ Step 3: Click on the submit button to submit your opinion. ïƒ˜ Step 4: You can also send your views to the email address: electionsurveynig@gmail.com You can also view other peoples comment and view on the election process by following these simple steps. ïƒ˜ Click on the â€œmoreâ€ button located at the bottom of the screen. ïƒ˜ Click on the sign up button to sign up . ïƒ˜ Fill in the required simple details to sign up. ïƒ˜ Once signup has been successful, click on the â€œdataâ€ button to access all comments views and opinions on the election process. ïƒ˜ NB: User &nbsp;can be kept anonymous</p><p>Your voice can bring a change to our nation.</p>', '05:50:07', '8g3ii7115r7n9nt81a', NULL);
