(25, 'Picture Perfect', '15374989361uprete77v5cn86t4067ei', '<p>&nbsp;Picture Perfect. Ladies Event</p><p>Banquet Hall, Jogor Centre 22nd December, 2018</p>', '2018-12-22', '2018-12-22', 'uploads/15374989369339911IMG-20180920-WA0003.jpg', 'e238t723ts7106', '03:02:16', '2018-09-21', 'thumb/15374989366782003IMG-20180920-WA0003.jpg', 0, '12pm', 'No.1, Harvester Drive, Liberty Rd, New Gra, Ibadan', 'Picture Perfect', '<p>&nbsp;</p>', NULL, NULL, NULL, '3.947039600000039', '7.3775355', 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'PP', NULL, '231rcfre2', 215, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(26, 'Showmie University Show-Off [S.U.S.O]', '1537863510ontm0ws7ihev926868ee2', '<p>S.U.S.O is a fashion weekend for Undergraduates, Post-graduates and recent graduates from tertiary institutions, making host to prominent icons. This is to showcase, award and give prizes to the most creatives, innovative emerging fashion professionals in 8 fashion categories listed on the Showmie platform which are Outfit design, Makeup artist, hair stylist, Models, Jewelry design, Accessory design, Fashion photography, Fashion blogging/columnist.</p>', '2019-11-30', '2019-12-01', 'uploads/15378635105702325Showmie_One-01.jpg', '1537862688oka34a4l9e4l48n689', '00:00:00', '2018-09-25', 'thumb/15378635106083687Showmie_One-01.jpg', 0, '2pm', 'Cucrid, Covenant University', 'Showmie', '<p>Showmie is a fashion hub that provides a unique platform for fashion professionals to showcase their creativity while promoting interaction between them and fashion enthusiast.</p>', NULL, NULL, 'show', '3.16245500354853', '6.677759690328947', 'Nigeria [NG]', 'Ogun', 'Sango Ota', 31026, 2674, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'showmie', 1, '231rcfre2', 1796, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
