(31, 'BROKENBUTGOLD', '1538743672vk79benrbl4god29t280eu3eton3', '<p>I humbly invite you to join a conversation on issues about broken home and how we have being blessed by it. &nbsp;</p>', '2018-10-08', '2018-10-12', 'uploads/15387436728547810IMG_20181003_045251_397.jpg', '1538667359ed4072988io4my8e4', '00:00:00', '2018-10-05', 'thumb/15387436723890768IMG_20181003_045251_397.jpg', 0, '7.30', 'bit.1y/2zCNeAI', 'ODEYEMI FOLASHADE', '<p>I am passionate about individual from broken homes,I am a testimony,lets share and let burden,hurt and unforgiveness go.</p>', 'Odeyemii Folashade', NULL, 'show', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2018-10-12', NULL, 100, NULL, NULL, NULL, NULL, '231rcfre2', 2306, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(32, 'Rendy Meetup  (Event Listing Sample)', '1539548032e54drs2p8e1k9o6b51vca8ten', '<p>This is not a real event. It is a demo that users can use to test out event registration, event listing, and other functions. Feel free to click and surf around on this event.</p>', '2018-12-31', '2019-12-31', 'uploads/15395480323686732IMG_20181009_213530_391.jpg', 'e238t723ts7106', '00:00:00', '2018-10-14', 'thumb/15395480323057652IMG_20181009_213530_391.jpg', 0, '12:00am', 'Baale Close, Oregun Lagos', 'Boardspeck', '<p>An Online Article, event and Training Promotion tool. On Boardspeck, you can post your articles, events and training and manage your content easily for publicity.</p>', 'boardspeck', 'boardspeck', 'show', '5.2236252770508145', '7.617038767121636', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, 1, '2019-12-31', NULL, 132, NULL, '1', 'demoevent', 1, '231rcfre2', 3071, NULL, 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(33, 'Entrepreneurs Hangout November 2018 Edition', '1539974445uesv57n3t31neet7reepe4r8nr79', '<p>&nbsp;</p><p>Theme: Positioning your Business</p><p>Date: Thursday, Ist November 2018.&nbsp;</p><p>Venue: De-Link Hotel, Iworoko Road, Ado Ekiti.</p><p>&nbsp;</p><p><strong>Highlights:&nbsp;</strong></p><p>Getting your noticed in the market&nbsp;</p><p>The challenge of funding</p><p>Business Exhibition&nbsp;</p><p>Business Networking.</p><p><strong>Convener: Tope Popoola</strong></p>', '2018-11-01', '2018-11-01', 'uploads/15399744451112361IMG-20181019-WA0006.jpg', 'e238t723ts7106', '00:00:00', '2018-10-19', 'thumb/15399744452152514IMG-20181019-WA0006.jpg', 0, '11:00am', 'De-Link Hotel, Iworoko Road, Ado EKITI', 'The Lead Initiative', '<p>Business Success is not by happenstance. In a world where CHANGE and INNOVATION are the only CONSTANTS in Enterprise, \"only the paranoid survive\" (in the words of Andy Grove, Former CEO of Intel).</p><p>If you live in Ekiti, join other entrepreneurs at the Entrepreneurs\' Hangout.</p><p>&nbsp;</p><p>&nbsp;</p>', 'lifempower', 'topheritage', 'show', '5.237108700000022', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, NULL, 'https://docs.google.com/forms/d/e/1FAIpQLSeVM7egNNZUHRkfkCIfN7Lgq3iHnVL6dtgvqGX6uysXE4NeFA/viewform?usp=pp_url', NULL, NULL, NULL, 'EHONOV18', NULL, '231rcfre2', 1656, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(34, 'SIFT-THINK CONFERENCE 2018 (EKSU)', '15400463045k54hne8fst6ivt86ie5t7n5', '<p>Sift-think Conference is an annual conference held in Nigerian campuses to sensitize Undergraduates, Graduates and Corps members on the need to be creative and proactive, maximize the opportunities around them as they think outside the box.</p><p>Sift-think conference will take place on the 2nd of November at the University lecture theatre in Oduduwa auditorium EKSU . The theme would be \"Thinking out of the box?\", and our Vision is to raise 100 businesses in Nigeria before 2050 and therefore empowering the minds of Nigerian youths from mediocrity to creativity.</p>', '2018-11-03', '2018-11-03', 'uploads/15400463045644112IMG-20181020-WA0025.jpg', 'e238t723ts71062', '00:00:00', '2018-10-20', 'thumb/15400463042026888IMG-20181020-WA0025.jpg', 0, '10:00am', 'O\'dua Hall Ekiti State University, Ado- Ekiti.', 'DLight Initiative', '<p>&nbsp;</p>', NULL, NULL, 'hide', '5.252118957193375', '7.713798576382494', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2018-11-03', NULL, 674, NULL, '1', 'siftthink2018', 1, '231rcfre2', 854, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
