(57, 'War of Words', 'EVT_15802241065708', '<p>War of Words is a spoken words competition that is targeted at inspiring youths to take their poetry talent to the next phase.</p>', '2020-03-06', '2020-03-06', 'uploads/1583054886mailIMG_20200222_WA0013.jpg', 'admin5823923153', '03:08:26', '2020-01-28', 'thumbs/1583054886mailIMG_20200222_WA0013.jpg', 0, '8AM', 'Odua Hall, Ekiti state university', 'Zephyr Media (a subsidiar', '<p>Zephyr media is a subsidiary of Zephyr conglomerate whose major goal is to increase the GDP of Nigeria which is done by creating product line that suits the need of the people. The media arm goes beyond broadcasting and trainings, it is also created to help Nigerians develop themselves as far as media and publicity is concerned. This is just one of our many projects designed to have this kind of impact.</p>', NULL, NULL, 'show', '5.252075426303118', '7.7137908627842755', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2020-03-07', NULL, 498, NULL, '1', 'wow2020', 1, '231r23100', 3271, NULL, 'paid', 'categorized', '500', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(59, 'Hike Ekiti Mountain Safari 2.0', 'EVT_15843230958966', '<p><strong>ABOUT HIKE EKITI MOUNTAIN SAFARI 2.0:&nbsp;</strong></p><p><strong>What You Need To Know Before You Register</strong></p><p>Hike Ekiti Mountain Safari event is a Destination Branding Mountain Tourism Adventure that is committed towards projecting, promoting and Marketing Tourism Potentials in Ekiti Communities to the world as one of the choice destination for Mountain Tourism Adventure.</p><p><strong>LOCATION FOR HIKE EKITI MOUNTAIN SAFARI 2.0</strong></p><p>The location for <strong>Hike Ekiti Mountain Safari 2.0 </strong>the historical and astonishing <strong>OLOSUNTA MOUNTAIN </strong>in Ikere Ekiti</p><p><strong>WILL THERE BE TRANSPORTATION &nbsp;FACILITIES FOR TOURISTS &amp; PARTICIPANTS?</strong></p><p>Yes there will be provision of Transportation facilities for Tourists that have registered for the event.</p><p><strong>WHERE</strong> <strong>ARE</strong> <strong>THE</strong> <strong>DESIGNATED PICK UP LOCATIONS?</strong></p><p>Proposed Designed Pick up location are:<br>- Ado Ekiti<br>- Oye Ekiti<br>- Ikole Ekiti&nbsp;<br>- Ijero Ekiti</p><p><strong>WHAT ARE</strong> <strong>THE</strong> <strong>STRATEGIC</strong> <strong>PLANS, FOR FOR SAFETY/ EMERGENCIES &nbsp;CASUALTIES &amp;</strong> <strong>SECURITY?</strong></p><p>To ensure an Adventure &nbsp;Event free of &nbsp;Casualties we are partnering with the Following Safety, Security and Paramedics Team<br>- Red Cross Ekiti State Chapter<br>- Ekiti State Public &nbsp;Health&nbsp;<br>- Ekiti State Emergency Manage Agency (SEMA)<br>- Man O War Nigeria<br>- Peace Corps<br>- Nigeria Medical Association<br>- &nbsp;Nigeria Security and Civil Defense Corps<br>- DSS</p><p><strong>HOW DO REGISTER &amp; &nbsp;BOOK MY TICKET?</strong></p><p>In our principle of promoting &amp; projecting Ekiti local contents to the world, this Year <strong>Discover</strong> <strong>Ekiti</strong> will be partnering with <strong>Attendout.Com</strong> an indigenous <strong>Event Registration</strong> <strong>Company</strong> that will be handing <strong>Bookings &amp; Registration</strong> of Participants for <strong>Hike Ekiti Mountain</strong> <strong>Safari</strong> <strong>2.0</strong></p><p><strong>TICKET LEVELS FOR HIKE EKITI MOUNTAIN SAFARI 2.0</strong></p><p><strong>Regular</strong> : <strong>N3,500</strong><br>- Hike Ekiti 2.0 Event Ticket&nbsp;<br>- Transportation to and Fro From Designated Pick up Locations<br>- Water<br>- Glucose<br>- Refreshment<br>- After Hiking Rock Buffet Party</p><p><strong>Premium: N5,500</strong><br>- Hike Ekiti 2.0 Event Ticket&nbsp;<br>- Transportation to and Fro From Designated Pick up Locations<br>- Water<br>- Glucose<br>- Refreshment<br>- After Hiking Rock Buffet Party<br>- Hike Ekiti 2.0 Event Face Cap</p><p><strong>VIP</strong>: <strong>N8,500</strong><br>- Hike Ekiti 2.0 Event Ticket&nbsp;<br>- Transportation to and Fro From Designated Pick up Locations<br>- Water<br>- Glucose<br>- Refreshment<br>- After Hiking Rock Buffet Party<br>- Hike Ekiti 2.0 Event Face Cap<br>- Hike Ekiti 2.0 Event T-Shirt</p><p><strong>EVENT GUIDELINES</strong> <strong>FOR HIKE EKITI MOUNTAIN SAFARI</strong> <strong>2.0</strong></p><p>As get prepared to attend Hike Ekiti Mountain Safari Event, Below are rules That\'ll Guide You, Before, During And After The Hiking Outdoor Adventure</p><p><strong>WHAT TO EAT</strong> <strong>BEFORE THE</strong> <strong>HIKING EVENT</strong><br>1. Do not eat heavy breakfast, if you must eat before hike</p><p><br>2.<strong> WHAT NOT TO DO AFTER TAKING YOUR BIRTH BEFORE THE HIKING EVENT</strong><br>Do not doff yourself with perfume, if you must &nbsp;take your bath before hike</p><p><br>3. - CLOTHINGS TO WEAR BEFORE COMING FOR THE HIKING EVENT<br>Ensure not to wear tight clothes. Preferably joggers and T-shirt<br>3.- HIKING SHOES TO WEAR<br>For Shoes Get a long shocks and trainers that has a strong grip<br>4. CAPS AND SUNGLASSES<br>Get a cap and sunglasses to help protect you from direct sunlight</p><p>5. CHOICE OF ANKLE SOCKS TO WEAR<br>If you must wear shorts, wear ankle socks6 COME WITH A SMALL BACK PACK BAG (If You Can) If will enable you not to carry too much load. Preferably get a small back pack that\'ll contain your water, handkerchief and glucose.<br>OTHER GUIDELINES YOU NEED TO FOLLOW DURING THE EVENT<br>Make good use of your hiking sticks, it helps you from falling.<br>2. &nbsp;Be prepared to walk hours without rest.<br>3. Strictly follow the instructions of the instructors.<br>3. Do not disengage yourself from the group.<br>3. &nbsp;Do not touch anything on the mountain unless you are guaranteed to.3. Get different clothings packed particularly for this hike, the weather may change rapidly. It may rain, so you will need a rain coat<br>4. It may get extremely hot while hiking so you need light cloth. It may get cold on top so you need to take jacket with you<br>5. &nbsp;Things like this can make so much difference on one\'s experience<br>6. - Places where we have steep rocks, grip the rocks with the tips of your toes<br>7. - Do not stress yourself on the mountain<br>8. - If you have phobia for height, do not look down from the mountain without being held or in the midst of people</p>', '2020-04-13', '2020-04-13', 'uploads/1584323094962561820200316_024346_0000.png', '1584298276_3896622', '01:44:55', '2020-03-16', 'thumb/1584323094289605720200316_024346_0000.png', 0, '6:00am - 3:00pm', 'Olosunta Mountain, Ikere Ekiti', 'Discover Ekiti', '<p>Discover Ekiti is a Destination Marketing organization that is committed towards projecting, Promoting and Showcasing Ekiti Tourism Potentials to the world</p>', 'DiscoverEkiti', 'Discover_Ekiti', 'show', '5.231887899999999', '7.499125500000001', 'Nigeria [NG]', 'Ekiti', 'Ikere', 30805, 2660, 160, 1, '2020-04-06', NULL, NULL, NULL, '1', 'HikeEkiti2.0', NULL, '231r23100234', 4358, '#HikeEkiti, #DiscoverEkiti', 'paid', 'categorized', NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
