(62, 'Face of Phil\'s Picture Contest', 'EVT_15920362441197', '<p>About Phil\'s Event</p><p>Phil\'s Event is a fast growing event agency that prioritize anchoring events without flaws but rare perfection. Having gone through strategic planning considering hindsight disappointments of events, this agency comes with a whole new suave approach to make any event glamorous and totally splendid.</p><p>Event Details</p><p>Face of Phil\'s Event is an open contest centred on bringing out beauty from anywhere across the world. As a way of brightening up the brand, this contest is about endearing beautiful countenance to an amazing online jury to pick the best without bias and doubt.</p><p>Aim Of The Contest<br>*Promoting the brand name&nbsp;<br>*Having a brand ambassador with the media appeal that befits the agency.<br>*Increasing our online awareness and social media presence and at the same time wetting the appetite of interested ones about lined up events to come.</p><p>Criteria For The Contest<br>*All you need is a Portrait Studio picture<br>*There is no embargo on age, height or skin colour.<br>Venue For The Contest</p><p>The Face of Phil\'s Picture Contest will take place on Instagram only.</p><p>How To Register For The Contest</p><p>Standing on our mantra of transparency, contestants can register on Attendout.com<br>Follow the instructions carefully and click on &nbsp;submit when you complete your registration</p><p>After registration contestants are to send their picture as a document to this number on WhatsApp 08142188379</p><p>Modalities for the contest:&nbsp;<br>The contest will be in three(3) stages. All stages will be communicated on the Instagram page @philsevent9ja</p><p>Pictures of all contestants will be uploaded and contestants will create awareness to get likes and comments on their private social media platforms</p><p>A QR code will be sent to you, &nbsp;you are to send the code alongside with your picture</p><p>Cash prize&nbsp;<br>A cash prize of 50,000 will be won at the end of the contest.<br>ðŸ‘‰ðŸ¾ 1st prize 25k<br>ðŸ‘‰ðŸ¾ 2nd prize 15k<br>ðŸ‘‰ðŸ¾ 3rd prize 10k</p><p>We wish all the contestants best of luck</p>', '2020-07-19', '2020-07-19', 'uploads/1593898890mailIMG_20200704_WA0034.jpg', '1579803799_5347256', '08:17:24', '2020-06-13', 'thumbs/1593898890mailIMG_20200704_WA0034.jpg', 0, '12AM', NULL, 'Phils Events', '<p>Phils Events</p>', NULL, NULL, 'show', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-07-31', NULL, 85, NULL, '1', 'faceofphils', NULL, '231r23100', 5090, NULL, 'paid', 'single', '1000', '1', 'Instagram', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
