(76, 'SHEY YOU SABIâ€™ PHYSICAL MEETING', 'EVT_16021887167047', '<p>â€˜SHEY YOU SABIâ€™ is a change project created by our team as part of our participation in at Leap Africa â€˜s Youth Leadership Program 2020. This projectâ€™s aim is to increase young peopleâ€™s knowledge of existing digital platforms that provide sexual and reproductive health services .</p><p>The inability of young people to access this life saving services lead to increased numbers of teenage pregnancies, unsafe abortion, exposure to sexually transmitted infections and others.</p><p>We hope to create awareness that would broaden the minds of every youth out there about their sexual health and make our world a better place at large.<br>&nbsp;</p>', '2020-10-28', '2020-10-28', 'uploads/1603565166mailIMG_20201024_WA0040.jpg', '1537374982obusn6a8u39t94101n5ol', '08:25:16', '2020-10-08', 'thumbs/1603565166mailIMG_20201024_WA0040.jpg', 0, '11am', 'Old SSS office Basiri road, Ado-Ekiti. ', 'THE HEALTH CITY', '<p>&nbsp;</p>', 'The Health City', '@thehealthcity', 'show', '5.208365835266586', '7.6430889176331585', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2020-12-28', NULL, 20, NULL, NULL, 'SHEYYOUSABI', 1, '231rcfre2', 3633, NULL, 'free', 'single', '50', NULL, NULL, 'a:5:{s:148:\"RG8geW91IGhhdmUgYW55IGtub3dsZWRnZSBhYm91dCBhbnkgZGlnaXRhbCBwbGF0Zm9ybSB0aGF0IHByb3ZpZGVzIHNleHVhbCBhbmQgcmVwcm9kdWN0aXZlIGhlYWx0aCBpbmZvcm1hdGlvbg==\";a:5:{s:2:\"id\";s:148:\"RG8geW91IGhhdmUgYW55IGtub3dsZWRnZSBhYm91dCBhbnkgZGlnaXRhbCBwbGF0Zm9ybSB0aGF0IHByb3ZpZGVzIHNleHVhbCBhbmQgcmVwcm9kdWN0aXZlIGhlYWx0aCBpbmZvcm1hdGlvbg==\";s:8:\"question\";s:109:\"Do you have any knowledge about any digital platform that provides sexual and reproductive health information\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:3:\"YES\";i:1;s:2:\"NO\";}s:8:\"required\";b:1;}s:76:\"V291bGQgeW91IHdhbnQgdG8gYmUgYSBwYXJ0IG9mIG91ciBwZWVyIHRvIHBlZXIgY2hhbXBpb24g\";a:5:{s:2:\"id\";s:76:\"V291bGQgeW91IHdhbnQgdG8gYmUgYSBwYXJ0IG9mIG91ciBwZW