(83, 'The ArtHut Assemblage 1.0', 'EVT_16051698676671', '<p>The conference is a virtual gathering of writers, poets, literary enthusiasts and artists across the globe to discuss literature, its appendages and impact on the world of today.</p><p>&nbsp;</p><p>The first edition shall be a WhatsApp conference with over 1000 hutters and the theme shall be <strong>WRITING THE SOCIETY.</strong></p><p>&nbsp;</p><p>It is slated to hold for three (3) days from Friday, 27th of November till Sunday, 29th of the same month.</p>', '2020-11-27', '2020-11-29', 'uploads/16051698671932990ArtHut_logo.jpg', '36au8m1elEn53m8538', '08:31:07', '2020-11-12', 'thumb/16051698677558212ArtHut_logo.jpg', 0, '6-8 pm', NULL, 'ArtHut', '<p>ArtHut is an art organization dedicated to the growth of art and its use for social impact across communities and societies around the globe.</p>', '@arthutnig', '@arthutng', 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-11-29', NULL, 1000, NULL, NULL, 'arthutassemblage', NULL, '231rcfr32', NULL, 'ArtHut Assemblage,ArtHut,ArtHut Nigeria,ArtHut Africa', 'free', NULL, NULL, NULL, 'https://bit.ly/TAA1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(84, 'HIKE Against GBV in Ekiti', 'EVT_16061392035698', '<p>HIKE AGAINST GBV is a joint event that seizes to use the Ecstasy Of fun to drive the message against Sexual and Gender Based Violence (SGBV) in our society.</p><p>You decision to join this Hike and pay the Hike Fee will go along way in spreading the message against SGBV and support our work in this regard.</p><p>Congratulations ladies and gentlemen for showing interest to hike with us against GBV.</p>', '2020-12-05', '2020-12-05', 'uploads/16061392037287601WhatsApp_Image_2020_11_23_at_2.21.54_PM.jpeg', '1606984367_8444198', '01:46:43', '2020-11-23', 'thumb/16061392039877511WhatsApp_Image_2020_11_23_at_2.21.54_PM.jpeg', 0, 'Details Later', 'Ofin Hills', 'AY Nigeria Goes To School', '<p>Hike Against GBV in Ekiti is a joint Collaboration between AY Nigeria Goes To School &amp; Discover Ekiti.</p><p>AY Nigeria Goes To School<br>Itâ€™s an Advocacy visit to Senior Secondary Schools in Nigeria, starting from Ekiti State to enlighten them about gender equity towards reducing the cases of RAPE AND ATTACK ON GIRLS &amp; VULNERABLE BOYS in the society.</p><p>Discover Ekiti is a destination marketing organization focused in projecting, showcasing, &nbsp;promoting &amp; marketing Ekiti Tourism Potentials to the &nbsp;world through mountain tourism adventures.</p>', NULL, NULL, 'show', '5.237108699999999', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2020-12-04', NULL, 994, NULL, '1', 'gbvhike', NULL, '231r23100234', 3792, 'hike,tourism,gbv,ekiti', 'paid', 'single', '1500', '1', NULL, NULL, '9803771344_1606150643', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(85, 'The Launch Party', 'EVT_16062833015088', '<p>Spur Nation Media will be launching her Business Magazine\'s 4th edition&nbsp;</p>', '2020-12-23', '2020-12-23', 'uploads/1606684126mailSNM_TLP._dsg_03.jpg', '1599234365sni7p8i5te6c1819rtau3na8rlo', '05:48:21', '2020-11-25', 'thumbs/1606684126mailSNM_TLP._dsg_03.jpg', 0, '12pm-5pm', 'Oke-Ado(IB) NUT CICS Multipurpose hall, Molete, Idadan', 'Spur Nation Media ', '<p>Spur Nation Media is a growing media brand that comprises of two individual brands; Spur Nation Magazine and Spur Nation PR and Communication.&nbsp;</p><p>SLOGAN- Made For More</p><p><strong>SPUR NATION PR AND COMMUNICATIONS</strong></p><p><strong>SERVICES</strong></p><p><strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; COMMUNICATIONS STRATEGY</strong></p><p>A strong communications strategy is an essential tool to help you organize effective and proactive PR, marketing and digital activity. We can help you to outline a purposeful plan linked to your communicationâ€™s goals and objectives.</p><p><strong>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PUBLIC RELATIONS</strong></p><p>Our approach to PR is rooted in your business aims and objectives, enabling us to help you deliver the right messages in clear and interesting ways. Media management, communication, recruitment, audits, events, awards lobbying, social, PR strategy &amp; reputation handling are just some elements of our offer.</p><p><strong>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; COPY WRITING &amp; EDITING</strong></p><p>Strong products and services deserve equally high quality writing. Our team will help you hit the mark with crisp and concise words that make people want to know more. We can write or edit your material or build your in-house capacity through plain language and a tone of voice training.</p><p><strong>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MEDIA RELATIONS</strong></p><p>Running a business or providing a service puts you right in the public eye, so you need to develop and maintain a positive profile in the relevant local, national and trade media. We use our strong relationships with journalists, editors and bloggers to make sure you get fair and accurate coverage.</p><p><strong>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; SOCIAL MEDIA</strong></p><p>Social media generates sales, build your brand online and should be at the forefront of Customer Service Excellence. We can help you to create a strategy, pick your platforms and manage your content and profile in ways that suits your customers (and you) best.</p><p><strong>ABOUT Spur Nation Magazine (BRIEF)</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>Spur Nation Magazine is a youth inspired magazine that encourages Nigerian youths to talk about themselves and share their story with the rest of the world. Not just that!! We envisage a future where mistakes are not repeated. We have 3 published editions with people cut across different social class share their personal story. With close to two years of experience up our sleeves with team members and advisory board guided by our core values which are consistency, integrity and passion.</p><p>We are up for the following</p><p>Â·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To share personal stories</p><p>Â·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PR services</p><p>Â·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Interview features</p><p>Â·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Advert placement</p><p>Â·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Event coverage</p><p>Â·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Event feature</p><p>Â·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Exclusive interviews.</p><p>&nbsp;</p><p><strong>GUIDING AIMS</strong></p><p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To be a world class magazine known for planting seeds of excellence in youths worldwide</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To ensure that every youths have a voice that will be heard.</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To ensure that mistakes are not repeated</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To motivate youths all around the world to be the best that they can be and share their story.</p>', NULL, NULL, 'show', '', '', 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, 1, '2020-12-23', NULL, 180, NULL, '1', 'TheLaunchParty', NULL, '231rcf34re2', 3648, NULL, 'paid', 'single', '1500', '1', NULL, 'a:1:{s:28:\"U29jaWFsIG1lZGlhIGhhbmRsZXMg\";a:5:{s:2:\"id\";s:28:\"U29jaWFsIG1lZGlhIGhhbmRsZXMg\";s:8:\"question\";s:21:\"Social media handles \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}}', '4677566755_1606843021', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(86, 'Ekiti Children Funfair', 'EVT_16069398964957', '<p>VISIT FATHER CHRISTMAS SECRET CHAMBERS IN ADO EKITI ON DECEMBER 11</p><p>Come and meet Father Christmas at his secret chambers on Friday, 11 December 2020 from 2 pm-6 pm, at the playground, Kiibati Hotels, and Resort, Ado Ekiti.</p><p>Children will get 4 hour-long Christmas experience with music, games, cartoons, a castle playground, and of course, gifts from the real Father Christmas.</p><p>All children must be accompanied by an adult at all times. Ekiti Children\'s funfair can be enjoyed by all ages and is most suitable for children ages 3-12.</p><p>The momentous experience begins Friday, 11 December 2020 by 2 pm and ends at 6 pm.</p><p>Tickets are on sale now for N1,000 per child. To get tickets, please contact @oneekiti or @debiwumi (oneekitiofficial@gmail.com and +2349037228640).</p>', '2020-12-11', '2020-12-11', 'uploads/16069398961838402WhatsApp_Image_2020_12_02_at_9.05.39_PM.jpeg', '1576161374_5710325', '08:11:36', '2020-12-02', 'thumb/16069398968684034WhatsApp_Image_2020_12_02_at_9.05.39_PM.jpeg', 0, '2pm - 6pm', 'Playground Kiibati Hotels, and Resort, Ado Ekiti.', 'One Ekiti', '<p>Details Later</p>', NULL, NULL, 'show', '5.237108699999999', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2020-12-11', NULL, 969, NULL, '1', 'ekitichildrenfunfair', NULL, '231r23cfre2', 3088, 'Ekiti,Children,Funfair,OneEkiti', 'paid', 'single', '1000', '1', NULL, 'a:6:{s:28:\"Q2hpbGQncyBEYXRlIE9mIEJpcnRo\";a:5:{s:2:\"id\";s:28:\"Q2hpbGQncyBEYXRlIE9mIEJpcnRo\";s:8:\"question\";s:21:\"Child\'s Date Of Birth\";s:4:\"type\";s:4:\"date\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:32:\"Q2hpbGQncyBMb2NhbCBHb3Zlcm5tZW50\";a:5:{s:2:\"id\";s:32:\"Q2hpbGQncyBMb2NhbCBHb3Zlcm5tZW50\";s:8:\"question\";s:24:\"Child\'s Local Government\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:16:\"SG9tZSBBZGRyZXNz\";a:5:{s:2:\"id\";s:16:\"SG9tZSBBZGRyZXNz\";s:8:\"question\";s:12:\"Home Address\";s:4:\