(105, 'Entrepreneur Weekend', 'EVT_16198746549415', '<p>Details Later</p>', '2021-05-28', '2021-05-29', 'uploads/16198746548772939WhatsApp_Image_2021_05_01_at_7.09.31_AM.jpeg', '1618229572inurb83aae4tckl6311i2ni36', '01:10:54', '2021-05-01', 'thumb/16198746549095844WhatsApp_Image_2021_05_01_at_7.09.31_AM.jpeg', 0, 'Details Later', 'RCF AAUA', 'GLIDEX CAPITAL', '<p>Glidex ventures is an organization set up with different sectors which focuses on different aspect of the economy. An established subset, glidex forex academy trains interested persons in the art of financial market analysis, other subset of the organization focuses on real estate, farming, transportation, telecommunications, energy and education. We are also passionate in training individuals to be financially free.</p>', NULL, NULL, 'hide', '5.7378808', '7.4739807', 'Nigeria [NG]', 'Ondo', 'Akungba', 48364, 2675, 160, 1, '2021-05-28', NULL, 300, NULL, '1', 'AAUAEW', NULL, NULL, 812, NULL, 'paid', 'single', '15000', NULL, NULL, 'a:1:{s:36:\"UGh5c2ljYWwgb3IgVmlydHVhbCBDbGFzcw==\";a:5:{s:2:\"id\";s:36:\"UGh5c2ljYWwgb3IgVmlydHVhbCBDbGFzcw==\";s:8:\"question\";s:25:\"Physical or Virtual Class\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:8:\"Physical\";i:1;s:7:\"Virtual\";}s:8:\"required\";b:0;}}', NULL, NULL, NULL, NULL, NULL, '30', '2021-05-10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(106, 'Daycation Trip to ABUAD Planetarium', 'EVT_16200721885249', '<p>What is Your Daycation Plan for 2021 Democracy Day Holiday? ðŸ˜‰ðŸ˜‰ðŸ˜‰ðŸ˜‰</p><p>Why not consider joining us for a Daycation Trip to ABUAD Planetarium ... The Largest in Africa &amp; The Only in Nigeria</p><p>ReallyðŸ¤”ðŸ¤”ðŸ¤”ðŸ¤” is there a Planetarium in Nigeria not to talk of Ekiti State?</p><p>Yes &nbsp;Ekiti is Full of Wonders &amp; Ekiti is a home of astonishing Tourism&amp; &nbsp; Adventures &nbsp;Attractions that the world may not know about. ðŸ˜ðŸ˜ðŸ˜</p><p>Do I hear you asking What Exactly is a PLANETARIUM?</p><p>What is a PlanetariumðŸ”­ðŸ”­ðŸ”­<br>A Planetarium is a domed building in which images of stars, planets, and constellations are projected for public entertainment or education via Virtual Reality &amp; 3D Cinema views.</p><p>Why You Have To Join Our Daycation Trip To ABUAD Planetarium ðŸ˜‰ðŸ˜‰ðŸ˜‰</p><p>During our Daycreation Trip, You will Experience Special Feature on Virtual Reality &amp; 3D Cinema Viewing of the Planet &amp; Stars in our Universe without the use of VR Glasses or Headgear as you explore virtual intriguing celestial navigation with breathtaking visuals via:<br>- Voyage through Space<br>- Journey to the center of the Milkyway Galaxy<br>- Moon Landing<br>- Mars Landing<br>- Fulldome Planetarium Movies</p><p>Our Daycation Trip to ABUAD Planetarium will be full of *Adventure + Pleasant Experiences + Fun + Networking</p><p>If you &nbsp;missed Hike Ekiti Mountain Safari 3.0 you can\'t afford to miss thisðŸ˜‰ðŸ˜‰ðŸ˜‰ðŸ˜‰</p><p>#ThingsToDoInEkiti<br>#VisitABUADPlanetarium<br>#DayCation2021<br>#DiscoverEkiti</p>', '2021-07-17', '2021-07-17', 'uploads/1620134941mailIMG_20210504_WA0023.jpg', '1584298276_3896622', '08:03:08', '2021-05-03', 'thumbs/1620134941mailIMG_20210504_WA0023.jpg', 0, '8am', 'Convergence Point: Fajuyi Park Ado Ekiti', 'Discover Ekiti', '<p>Discover Ekiti is a Destination Marketing &amp; &nbsp;Management &nbsp;Organization&nbsp;<br>focused towards projecting Ekiti to the world as an attractive destination for Tourism, Tours &nbsp;&amp; Adventures</p>', NULL, '@discoverekiti', 'show', '5.237108699999999', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2021-07-17', NULL, 300, NULL, '1', 'daycation', NULL, '231r23100234', 7316, 'ThingsToDoInEkiti,VisitABUADPlanetarium,DayCation2021,DiscoverEkiti', 'paid', 'categorized', '3000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(107, 'TEDxEkitiStateUniversity', 'EVT_16202298892541', '<p>TEDxEKSU is an independent TEDx event first of it kind to be held in Ekiti State University, Ado-Ekiti, Ekiti State, Nigeria. Like other TEDx events, the event obtained a free license from TED to hold the conference, with organizers agreeing to follow certain principles.</p><p>Theme: THE DRIVE</p><p><br>THE DRIVE is a word of perspective, opportunity and leverage. With challenges being inevitable like rain and tax, it is up to us as a Community to actively look out for the drive in situations like this and at such create solutions to drive us to the future.&nbsp;</p>', '2021-07-08', '2021-07-09', 'uploads/1620411202mailE3F5C564_8C7C_48EA_A009_3CE48F1665EF.jpeg', '1620121652ee65cta7r26dl358t58i', '03:51:29', '2021-05-05', 'thumbs/1620411202mailE3F5C564_8C7C_48EA_A009_3CE48F1665EF.jpeg', 0, '8:00am-8:00pm', 'SSANU building, Ekiti State University', 'Abraham Isaac', '<p>&nbsp;</p>', NULL, NULL, 'show', '5.2489550203571245', '7.716291792616396', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2021-07-07', NULL, 184, NULL, '1', 'tedxeksu', 1, '231rcfre2', 3991, NULL, 'paid', 'single', '2000', '1', NULL, NULL, '5756525298_1623364702', NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
