(130, 'Daycation Trip to ABUAD Planetarium', 'EVT_1620072188555249', '<p>What is Your <strong>Daycation</strong> <strong>Plan</strong> <strong>for</strong> <strong>August</strong> <strong>2021</strong>? ðŸ˜‰ðŸ˜‰ðŸ˜‰ðŸ˜‰</p><p>Why not consider joining us for a <strong>Daycation</strong> <strong>Trip</strong> <strong>to</strong> <strong>ABUAD</strong> <strong>Planetarium</strong> ... The Largest in Africa &amp; The Only in Nigeria</p><p>ReallyðŸ¤”ðŸ¤”ðŸ¤”ðŸ¤” is there a Planetarium in Nigeria not to talk of Ekiti State?</p><p>Yes &nbsp;Ekiti is Full of Wonders &amp; Ekiti is a home of astonishing Tourism&amp; &nbsp; Adventures &nbsp;Attractions that the world may not know about. ðŸ˜ðŸ˜ðŸ˜</p><p>Do I hear you asking What Exactly is a PLANETARIUM?</p><p>What is a PlanetariumðŸ”­ðŸ”­ðŸ”­<br>A Planetarium is a domed building in which images of stars, planets, and constellations are projected for public entertainment or education via Virtual Reality &amp; 3D Cinema views.</p><p>Why You Have To Join Our <strong>Daycation</strong> <strong>Trip</strong> <strong>To</strong> <strong>ABUAD</strong> <strong>Planetarium</strong> ðŸ˜‰ðŸ˜‰ðŸ˜‰</p><p>During our Daycreation Trip, You will Experience Special Feature on Virtual Reality &amp; 3D Cinema Viewing of the Planet &amp; Stars in our Universe without the use of VR Glasses or Headgear as you explore virtual intriguing celestial navigation with breathtaking visuals via:<br>- Voyage through Space<br>- Journey to the center of the Milkyway Galaxy<br>- Moon Landing<br>- Mars Landing<br>- Fulldome Planetarium Movies</p><p>Our Daycation Trip to ABUAD Planetarium will be full of *Adventure + Pleasant Experiences + Fun + Networking</p><p>If you &nbsp;missed <strong>Daycation</strong> <strong>Trip</strong> <strong>To</strong> <strong>ABUAD</strong> &nbsp;<strong>1.0</strong> you can\'t afford to miss thisðŸ˜‰ðŸ˜‰ðŸ˜‰ðŸ˜‰</p><p>#ThingsToDoInEkiti<br>#VisitABUADPlanetarium<br>#DayCation2021<br>#DiscoverEkiti</p>', '2021-08-21', '2021-08-