(137, 'Parte After Parte Independence Day Special', 'EVT_16305558591102', '<p><strong>MXD 500 AFRICA ENTERTAINMENT</strong><br>PRESENTS<br><strong>Parte &nbsp;After &nbsp; Parte</strong><br><strong>Independence &nbsp;Day Special</strong><br>&nbsp;</p><p>Saturday October 2nd &nbsp;2021<br>Red Carpet &nbsp;2pm<br>Main Event &nbsp; 4pm<br>&nbsp;</p><p>Featuring: Music Comedy Dance<br>Venue:NAN-IBIMS HOTEL KUJE-ABUJA<br>&nbsp;</p><p>*<strong>HOST</strong>* MOE VIBEZ<br>*<strong>HOST DJ</strong>* DJ NIFFY<br>&nbsp;</p><p><strong>COMEDIANS</strong>:MC 1KIND, MC SMILEY, MC OCHE TALK, MC LAFIOLOGY, TEAM BBC WORLDWIDE,MC KING2, MC WIDEMOUTH, CHUKS DELIGHT,MC AP,MC 001, MC AZOR,NO P,HOLY P</p><p><strong>PERFORMING ACTS</strong>: MULTI P, CVRTER, YUNG KING OGAJI, T-JACKS, CHEZZ, SAZZY NAIRA,J FRESH<br>&nbsp;</p><p><strong>GUEST MUSICIANS</strong>:<br>ETITI, DEEDAT IFR<br>&nbsp;</p><p><strong>RED CARPET HOST</strong><br>JORDAN MARSHAL (BEAT FM ABUJA) &nbsp;CERA JAY (MOXIE TV)<br>&nbsp;</p><p><strong>DANCE PERFORMANCE BY</strong><br>CREED NATION,THE CRUISE FAMILY, CULTURE, SARAH DANCE<br>&nbsp;</p><p><strong>HYPEMEN</strong><br>AWESOME, SHOLEXX<br>&nbsp;</p><p><strong>SPECIAL GUEST APPEARANCE BY</strong><br>Kaliceasar, MC 007, KEENY WESTHOOD, BEAT WEEZY<br>&nbsp;</p><p><strong>MUSIC POLICY</strong><br>DJ TEE, DJ MAYOR REAL , DJ SWIXZ, &nbsp;DJ SPINJOE, DJ CNS<br>&nbsp;</p><p><strong>TICKET OUTLETS</strong><br>November Cubes Kuje<br>EMERALD STUDIOS<br>NAN IBIMS HOTEL KUJE ABUJA<br>REIGN WORLD OPP FIRST BANK KUJE ABUJA<br>&nbsp;</p><p>Tickets are available online &nbsp;on our website<br>Moxietv.com.ng<br>&nbsp;</p><p><i><strong>PLATINUM TABLE OF 6 =30K</strong></i><br><i><strong>GOLD TABLE OF 4 &nbsp; =10K</strong></i><br><i><strong>VIP TABLE OF 2=5K</strong></i><br><i><strong>REGULAR=1K &nbsp;</strong></i><br>&nbsp;</p><p>INStagram, Facebook and Twitter @Mxd500africaent<br>Email:dmxd500africa@gmail.com<br>Phone number:08037247417,0701120365<br>&nbsp;</p><p><i><strong>Maximum Secu