(138, 'Mission Trybe Annual Publication Project ', 'EVT_16306906229034', '<p>Mission Trybe Annual Publication Project is an annual qualitative profiling of phenomenal young people Ekiti Who has contributed to the development and growth of Ekiti State and Nigeria at large on the upon year of selection.&nbsp;</p>', '2021-09-17', '2021-09-17', 'uploads/1630690622712892839495C74_7231_4F99_9D8A_5D05B6A4164E.jpeg', '16306878382m34ir9tle8co7in4s99ai6s', '05:37:02', '2021-09-03', 'thumb/1630690622115789639495C74_7231_4F99_9D8A_5D05B6A4164E.jpeg', 0, '12PM', 'AB HOTEL ', 'Mission Trybe', '<p>The Mission Trybe is committed in raising standards and building a network of young indigenous working together in Ekiti state to solve our most strategic issues. By investing in human capital, our shapers community has made it a sole commitment to identify young people within the state who have been doing the hard work of change upon the year of selection.</p>', NULL, NULL, 'show', '3.369154565856922', '6.541383710574972', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2021-09-15', NULL, 0, NULL, '1', 'Missiontrybe15', 1, '231rcf34re2', 2673, NULL, 'free', NULL, NULL, '1', NULL, 'a:2:{s:24:\"UHJlc2VudCBsb2NhdGlvbiA=\";a:5:{s:2:\"id\";s:24:\"UHJlc2VudCBsb2NhdGlvbiA=\";s:8:\"question\";s:17:\"Present location \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:16:\"T2NjdXBhdGlvbiA=\";a:5:{s:2:\"id\";s:16:\"T2NjdXBhdGlvbiA=\";s:8:\"question\";s:11:\"Occupation \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}}', '7160225786_1630692075', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(139, 'Mission Trybe Annual Publication Project ', 'EVT_16307532936799', '<p><strong>The Mission Trybe Annual Publication Project is an annual qualitative profiling of phenomenal young people in Ekiti state who have contributed to the development of Ekiti State and Nigeria at large in the year upon selection.&nbsp;</strong></p>', '2021-09-17', '2021-09-17', 'uploads/1630753293971961220210903_194131.jpg', 'd51313768088b65d70fa1c9b8b902717', '11:01:33', '2021-09-04', 'thumb/1630753293324913120210903_194131.jpg', 0, '12pm', 'AB EMPORIUM HOTEL AND EVENT CENTRE. ', 'Mission Trybe ', '<p>We are a Publication Relations and consulting firm using the power of storytelling to invest in information and human capital.&nbsp;</p>', NULL, 'missiontrybe ', 'hide', '', '', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'missiontrybe', NULL, 'BGRT64GF', 4, '#15MostInfluential2021 ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
