(153, '6TH Gear Revolution', 'EVT_16375902832932', '<p>Forget money! Go for Knowledge. Knowledge is the new currency. &nbsp;The value of knowledge is simply how you apply it.</p><p>You are now paid based on the value you can drive globally...</p><p>Entrepreneurs and venturing entrepreneurs have things to consider<br>1. Risk factor<br>2. Profit scalability</p><p>With minimal risk factors and higher profit, businesses can easily optimize and scale globally. Come and learn how to position yourself, forget what you have but come for the Knowledge you will acquire and how to apply it!</p>', '2021-10-31', '2021-10-31', 'uploads/163759028393068966gr_launch.jpeg', '16375842922d0t1icir07a6rr5hc1e6a6l', '02:11:23', '2021-11-22', 'thumb/163759028319871216gr_launch.jpeg', 0, '2:00pm - 4:00pm', 'Odilin Event Center, Behind National Library, along Joseph Gomwak Road, Jos, Plateau State', 'SFLD Hub', '<p>Strategic Financial Leadership Development (SFLD) Hub is business development agency in consultative status with the Century 21 Freedom Group. SFLD Hub works with individuals to raise capital to startup or expand their businesses by providing personal development and mentorship programs to develop individuals into financially sound leaders who are capable of controlling their own economy.</p><p><strong>Major Partners</strong></p><ul><li>Empowered Consumerism</li><li>Ego Blocks</li><li>Century 21 Freedom Group and more</li></ul>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Plateau', 'Jos', 31081, 2678, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'sfld', NULL, 'BGRT64GF', 15, 'Knowledge,Currency,Financial,Leadership,Development', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
