(163, 'Social Media For Business ', 'EVT_16415391515962', '<p>Social Media for business is designed by Thinking School Ng to help SME, business owner to grow their business using various social media tools.&nbsp;</p>', '2022-01-23', '2022-03-31', 'uploads/1641596596mailBD121E02_027B_44BC_8DBB_6FCEE100B4D0.jpeg', '1537374982obusn6a8u39t94101n5ol', '07:05:51', '2022-01-07', 'thumbs/1641596596mailBD121E02_027B_44BC_8DBB_6FCEE100B4D0.jpeg', 0, '3 PM ', 'The Acumen Place ', 'ThinkingSchoolNigeira ', '<p>Thinking School is a social enterprise focused on creating novel solutions to problems, particularly with regards to unemployment and entrepreneurship</p><p><br>We believe that the same level of thinking that led us to the problem we have cannot take us out of the problem. So, we seek to ask questions, challenge paradigms to understand why traditions exist and sift through what works and what is mere sentiment.</p><p><br>At Thinking School, we want people, especially the youth, to take responsibility for their reality, education, environment and society.<br>Our overall aim is to have a critical mass of WHOLE and BALANCED youth population.</p>', NULL, NULL, 'show', '', '', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 2, '2023-12-31', NULL, 200, NULL, NULL, 'SMBusiness', NULL, 'BGRT64GF', 2443, '', 'paid', 'categorized', NULL, NULL, NULL, 'a:1:{s:16:\"T2NjdXBhdGlvbiA=\";a:5:{s:2:\"id\";s:16:\"T2NjdXBhdGlvbiA=\";s:8:\"question\";s:11:\"Occupation \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:0;}}', NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, 'Zoom', 'a:3:{s:7:\"zoom_dc\";s:0:\"\";s:14:\"meeting_number\";s:0:\"\";s:16:\"meeting_password\";s:0:\"\";}', 'Training', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#7f2191', 'Get Ticket', '<p>&nbsp;</p>', NULL, NULL),
