(188, 'SOCIAL MEDIA FOR BUSINESS  MASTERCLASS (META PRODUCTS) ', 'EVT_16459799717266', '<p>Meta Product class for business is designed by Thinking School Ng to help learn a new skills build your brand or business using various Meta Product tools</p>', '2022-03-19', '2022-03-20', 'uploads/1647069085mail361C85E6_A1CE_4E42_A786_7D72B71E6342.jpeg', '1537374982obusn6a8u39t94101n5ol', '04:39:31', '2022-02-27', 'thumbs/1647069085mail361C85E6_A1CE_4E42_A786_7D72B71E6342.jpeg', 0, '3:00- 5:00', NULL, 'Thinking School Nigeria ', '<p>Thinking School is a social enterprise focused on creating novel solutions to problems, particularly with regards to unemployment and entrepreneurship</p><p><br>We believe that the same level of thinking that led us to the problem we have cannot take us out of the problem. So, we seek to ask questions, challenge paradigms to understand why traditions exist and sift through what works and what is mere sentiment.</p><p><br>At Thinking School, we want people, especially the youth, to take responsibility for their reality, education, environment and society.<br>Our overall aim is to have a critical mass of WHOLE and BALANCED youth population.</p>', NULL, NULL, 'show', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2022-03-19', NULL, 94, NULL, '1', 'MetaProduct', NULL, '231rcfr32', 2222, '', 'paid', 'single', '5000', NULL, 'Zoom', NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, 'a:3:{s:7:\"zoom_dc\";s:0:\"\";s:14:\"meeting_number\";s:11:\"88090723789\";s:16:\"meeting_password\";s:4:\"2022\";}', 'Training', NULL, NULL, '+2348168844683', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
