(194, 'Hike Ekiti Mountain Safari 4.0', 'EVT_16470685534417', '<p><strong>ABOUT HIKE EKITI MOUNTAIN SAFARI 4.0</strong></p><p><strong>Hike Ekiti Mountain Safari&nbsp;</strong>organized by&nbsp;<strong>Discover Ekiti&nbsp;</strong>is a destination branding and community place marketing&nbsp;outdoor mountain tourism adventure event that is&nbsp;strategically positioned to project, promote and market&nbsp;Ekiti to the World as one of the best choice destination for mountain tourism adventures.&nbsp;</p><p>The first edition of Hike Ekiti Mountain Safari held In April 2019 was a huge success, leveraging on the power of traditional and&nbsp;digital media, our compelling brand promotion strategies, integrated marketing communication channels and support for donors and sponsors, the event&nbsp;attracted the patronage of Mountain Hikers and Tourist Adventurers within and outside the country.&nbsp;</p><p>It is also worthy to note that the maiden edition of the event attracted International Hikers, Tourists and Enthusiast from the following countries; South Africa, Dubai, Jamaica and Germany. We also had bookings from tourists in New York and London. Local Tourists in attendance were from Lagos, Abuja, Port Harcourt, Oyo, Kwara, Ondo, Ogun, Osun, Kogi, and Delta State respectively.</p><p>The 3rd Edition held on Easter Monday April 5th, 2021 at the newly discovered Abanijorin Mountain &amp; Cave Safari attracted 350 Tourists across Nigeria with an International Guest from United States of America.</p><p>Since 2019, the HIKE EKITI MOUNTAIN SAFARI event organized by Discover Ekiti has strategically enhance the destination branding and the public image of Ekiti as choice Destination for tourism &amp; adventures this have helped increase tourist visitation to Ekiti State and also helped contributed towards the assessment In making Ekiti State to win The Naija 7 Wonders Award as best State in Nigeria with Destination Promotion in 2020</p><p><strong>LOCATION FOR HIKE EKITI MOUNTAIN SAFARI 4.0</strong></p><p><strong>Come take a trip &amp; LETâ€™s HIKE ARINTA WATERFALLS</strong></p><p>Do You Know that Ekiti State offers one of Nigeriaâ€™s finest landscapes and best location for Mountain Tourism Adventures with striking rock formations and landforms, ridges and inselbergs, beautiful hills, astonishing caves&nbsp; and mountains,&nbsp; exceptional geological features and water falls?</p><p>The destination for&nbsp;<strong>Hike Ekiti Mountain Safari 4.0&nbsp;is</strong> the foremost tourist destination in Ekiti State Nigeria, Arinta Waterfalls a natural wonder to behold located in the ancient city of Ipole Iloro Ekiti an astonishing settlement surrounded by undulating mountains, thick evergreen forest and flowing rivers.</p><p>If you are a tourist and you are yet to visit Arinta Waterfalls, then you are missing a great deal. Arinta Waterfalls is located at Ipole Iloro, Ekiti State it is a few minutes to Ikogosi Warm Spring. Arinta Water Falls comes with a beautiful landscape, lush green vegetation, rugged hills, a flowing stream and a gigantic rock. This is nature at its finest. Arinta Waterfalls consist of seven different cascades. Each cascades has unique features. Arinta waterfalls have seven different layers, however, tourist activities usually end at the second layer but during Hike Ekiti 4.0 we are taking tourist activities beyond the second level, we will be leading Participants during Hike Ekiti 4.0 to Hike, Trail &amp; Explore The Seven Astonishing Layers of Arinta Water Falls..</p><p>Arinta waterfalls are a wonder spectacle to behold, cascading down rocky hills from a great height to form a flowing pool of spring water amidst natural forest vegetation. You need to Visit Arinta Water Fall and Marvell at the work of nature, 10 Meters away from the water fall Tourists would have been feeling the chilly effect of this astonishing water fall. One other thing to experience is the sound that erupts from the ever bubbling and bursting water that flows down the fall. The sound from the fall of water dominates the surrounding of the waterfall as if it is raining heavily. Visitors can swim in the natural swimming pool arena at the base of the waterfall. If you are looking for somewhere that is quiet and a great spot for hiking, Arinta Waterfalls is a great destination.</p><p>Join us on Easter MondaY April 18th 2022 as We Hike, Trail &amp; Explore Arinta Water Falls From First Cascading Level to the Seventh Level</p><p>TICKET CATEGORIES FOR HIKE EKITI &nbsp;MOUNTAIN SAFARI 4.0</p><p>STUDENTS (Only Available on Campuses)<br>- Tickets<br>- Glucose<br>- Water<br>- Light Refreshments</p><p>N3500</p><p>REGULAR&nbsp;<br>â€¢ Tickets&nbsp;<br>â€¢ Glucose&nbsp;<br>â€¢ Energy Drink&nbsp;<br>â€¢ Water&nbsp;<br>â€¢ Games&nbsp;<br>â€¢ Refreshments&nbsp;<br>N5,500</p><p>&nbsp;</p><p>PREMIUM &nbsp;&nbsp;<br>â€¢ Tickets&nbsp;<br>â€¢ Glucose&nbsp;<br>â€¢ Energy Drink&nbsp;<br>â€¢ Water&nbsp;<br>â€¢ Games&nbsp;<br>â€¢ Refreshments&nbsp;<br>â€¢ Branded Event Face cap&nbsp;<br>â€¢ Branded Drawstring Bag</p><p>N8,500</p><p>&nbsp;</p><p>GOLD</p><p>â€¢Tickets&nbsp;<br>â€¢ Glucose&nbsp;<br>â€¢ Energy Drink&nbsp;<br>â€¢ Water&nbsp;<br>â€¢ Games&nbsp;<br>â€¢ Refreshments&nbsp;<br>â€¢ Branded Event Face cap&nbsp;<br>â€¢ Branded Drawstring Bag&nbsp;<br>â€¢ Branded Event T-Shirts&nbsp;<br>â€¢ Branded Event Water &nbsp;<br>Bottle</p><p>N12,000</p><p>For further Enquiry, collaboration &amp; Partnership contact: 08145502813, 07061924727, 08168900183, 07033942819</p><p>To know more about our social impact activities so far, kindly download a copy of our social impact report via http://bit.ly/HikeEkitiMountainSafariSocialImpactReport</p><p>You can\'t afford to miss this, Be Part of Hike Ekiti 4.0</p><p>Ekiti Mountains Are Calling...And You Must Go</p>', '2022-04-18', '2022-04-18', 'uploads/1647071119mailHIKE_Ekiti_4_dsg_NW.jpg', '1584298276_3896622', '07:02:33', '2022-03-12', 'thumbs/1647071119mailHIKE_Ekiti_4_dsg_NW.jpg', 0, 'Time Later', 'Arinta Water Falls, Ipole-Iloro Ekiti (Hike, Trail & Exploration of Arinta Water Falls From 1st  Water Fall Level To  7th Water Fall Level', 'Discover Ekiti', '<p>Discover Ekiti</p>', NULL, NULL, 'show', '', '', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2022-04-20', NULL, NULL, NULL, '1', 'HikeEkiti4.0', NULL, '231r23100234', 5844, 'HikeEkiti 4.0,EasterGateaway,VisitEkiti,ExploreEkiti,DiscoverEkiti', 'paid', 'categorized', NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2348145502813', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
