(214, 'THE ED PLAN 3.0 PROJECT ', 'EVT_16528743972335', '<p>The ED PLAN 3.0 &nbsp;is a global Project powered by C21FG INTERNATIONAL/MILLIONAIRES ACADEMY, an independent business initiative. The group is currently conducting a cash-flow survey designed to ascertain if Nigerians prefer to have a paid employment, working for someone or to own a business of their own, be their own boss.</p><p>Participate in our survey today to be among the few selected individuals.</p>', '2022-05-18', '2022-06-30', 'uploads/16528743977830497images.jpeg', '1652872823_4937193', '11:46:37', '2022-05-18', 'thumb/16528743975385581images.jpeg', 0, '07:00pm', NULL, 'Powered by: C21FG Int\'l', '<p>Century 21 freedom group international, show individuals alternative ways to access capital to start a business, fund an existing business of fund projects without dropping collaterals, without taking loans and without paying back the funds generated.</p>', NULL, NULL, 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2022-12-31', NULL, 998, NULL, '1', 'ED-PLAN3.0-PROJECT-FORM', NULL, '231rcfr32', 11, NULL, 'free', NULL, NULL, NULL, '--Select Virtual Platform--', 'a:17:{s:48:\"MS4gSG93IGxvbmcgaGF2ZSB5b3UgYmVlbiB3b3JraW5nLiA=\";a:5:{s:2:\"id\";s:48:\"MS4gSG93IGxvbmcgaGF2ZSB5b3UgYmVlbiB3b3JraW5nLiA=\";s:8:\"question\";s:35:\"1. How long have you been working. \";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:4:{i:0;s:10:\"1-3 years \";i:1;s:9:\"4-7 years\";i:2;s:18:\"More than 7 years \";i:3;s:12:\"Never worked\";}s:8:\"required\";b:1;}s:124:\"Mi4gRG8geW91ciBtb250aGx5IGluY29tZSB0YWtlIGNhcmUgb2YgeW91ciByZXNwb25zaWJpbGl0aWVzPyBObywgWWVzLCBJIGJvcnJvdyB0byBtZWV0IHVwIA==\";a:5:{s:2:\"id\";s:124:\"Mi4gRG8geW91ciBtb250aGx5IGluY29tZSB0YWtlIGNhcmUgb2YgeW91ciByZXNwb25zaWJpbGl0aWVzPyBObywgWWVzLCBJIGJvcnJvdyB0byBtZWV0IHVwIA==\";s:8:\"question\";s:91:\"2. Do your monthly income take care of your responsibilities? No, Yes, I borrow to meet up \";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:3:{i:0;s:2:\"No\";