(221, 'ArtMesh: Open Mic & MeetUp for Creatives', 'EVT_16585038171258', '<p>ArtMesh is a program dedicated to amplifying creativity in Lagos, Nigeria and Africa - one step at a time.&nbsp;<br><br>We harness the power of youthful and social interactions to promote contents shared and discussed during our programs.&nbsp;<br><br>Performances can be from any and everyone.&nbsp;<br><br>We are giving you the mic because we want to hear your story.&nbsp;<br><br><strong>OUR DISCUSSION&nbsp;</strong><br>Perhaps one of our most important REFINEMENT is that of our DISCUSSIONS, usually themed around social issues/concerns affecting creatives/youths of contemporary age.&nbsp;<br><br><strong>VENUE&nbsp;</strong><br>American Corner, Ikeja has been home for ARTMESH and continues to house numerous creatives monthtly. All coming for a piece of art from the community.&nbsp;<br><br>ArtMesh is gradually growing into a well-recognized and respected creative program with links to many other creative events in and out of Lagos State.&nbsp;<br><br><br><i><strong>Time: 2.00pm - 5.00pm&nbsp;</strong></i><br>&nbsp;</p>', '2022-08-05', '2022-08-05', 'uploads/16585038167716684ARTMESH_landscape.jpg', '36au8m1elEn53m8538', '03:30:17', '2022-07-22', 'thumb/16585038164934668ARTMESH_landscape.jpg', 0, '02:00pm - 05:00pm', '42, Local Airport Road (Concord Busstop), Ikeja, Lagos', 'ArtHut', '<p>ARTHUT is an organization dedicated to amplifying creativity from Africa to the world.</p>', '@arthutng', 'arthutng', 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'artmeshaug22', NULL, '231r231002345433rrrr23', 431, 'open mic,conference,american corner ikeja,poetry,arthut,arthut events,lagos events,art event,art event Lagos,storytelling,karaoke,singing', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(222, '3 DAYS SUMMER ROBOTICS WORKSHOP ', 'EVT_16594718729550', '<p>This entail a 3 days workshop for students in the knowledge of junior robotics and artificial intelligence.</p><p>Organized by National Association of Computer Engineering Students and Robotics Africa.</p>', '2022-10-17', '2022-10-19', 'uploads/16645317428908035png_20220925_170129_0000.png', '1633506721_8497927', '08:24:32', '2022-08-02', 'uploads/16645317428908035png_20220925_170129_0000.png', 0, '1pm - 3pm', 'Lagos University of Science and Technology (formerly Laspotech) ', 'NACOMES EXCO\'S 21/22', '<p>National Association of Computer Engineering Students (Laspotech Chapter)</p>', NULL, NULL, 'show', '3.522713714168537', '6.637545144158024', 'Nigeria [NG]', 'Lagos', 'Ikorodu', 30984, 2671, 160, 1, '2022-08-31', NULL, 99, NULL, '1', '-Robotics4all', 1, 'BGRT64GF', 1361, '', 'free', NULL, NULL, NULL, NULL, 'a:1:{s:8:\"TGV2ZWwg\";a:5:{s:2:\"id\";s:8:\"TGV2ZWwg\";s:8:\"question\";s:6:\"Level \";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:4:{i:0;s:4:\"ND 1\";i:1;s:5:\"ND 2 \";i:2;s:6:\"HND 1 \";i:3;s:5:\"HND 2\";}s:8:\"required\";b:1;}}', NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Training', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#5fad47', NULL, NULL, NULL, NULL),
(223, 'DEMO CONFERENCE', 'EVT_16605789981915', '<p>This year\'s summit is focused on the sub-Sahara African agricultural vegetable value chain ecosystem.</p><p>The event is designed to ignite discussions around value addition in the vegetable value chain and it\'s primary potentials to promote, foreign exchange earnings, international trade and Agro-tourism.</p><p>The theme for SAFE SUMMIT 3.0 is DEMO</p><p>This year will play host to policy makers, thought leaders in the vegetable value and supply chains, and insightful panel sessions.</p>', '2022-08-21', '2023-12-23', 'uploads/1660604033mailBlue_And_Purple_Modern_Business_Conference_Instagram_Post.png', '1537374982obusn6a8u39t94101n5ol', '03:56:38', '2022-08-15', 'thumbs/1660604033mailBlue_And_Purple_Modern_Business_Conference_Instagram_Post.png', 0, '9AM TO 5PM ', 'DEMO,', 'DEMO', '<p>We are global focused&nbsp;</p>', NULL, NULL, 'hide', '', '', '160/Nigeria [NG]', '2671/Lagos', '30987/Surulere', NULL, NULL, NULL, 1, '2022-09-11', NULL, 98, NULL, '1', 'demo', NULL, '231rcfre2', 172, '', 'paid', 'categorized', '5', '1', 'Zoom', NULL, NULL, NULL, '8506114572_1660604904', NULL, 'NGN', NULL, NULL, 'a:3:{s:16:\"Sm9obiBEb2UvYWxs\";a:5:{s:2:\"id\";s:16:\"Sm9obiBEb2UvYWxs\";s:4:\"name\";s:8:\"John Doe\";s:11:\"designation\";s:8:\"Speaker \";s:5:\"about\";s:17:\"Digital Marketer \";s:5:\"image\";s:37:\"uploads/166057930563622base_image.jpg\";}s:16:\"SmFuZSBEb2UvYWxs\";a:5:{s:2:\"id\";s:16:\"SmFuZSBEb2UvYWxs\";s:4:\"name\";s:8:\"Jane Doe\";s:11:\"designation\";s:8:\"Speaker \";s:5:\"about\";s:17:\"Digital Marketer \";s:5:\"image\";s:37:\"uploads/166057932693682base_image.jpg\";}s:12:\"SmFuZSAvYWxs\";a:5:{s:2:\"id\";s:12:\"SmFuZSAvYWxs\";s:4:\"name\";s:5:\"Jane \";s:11:\"designation\";s:8:\"Speaker \";s:5:\"about\";s:17:\"Digital Marketer \";s:5:\"image\";s:37:\"uploads/166057936331495base_image.jpg\";}}', NULL, 'a:3:{s:7:\"zoom_dc\";s:0:\"\";s:14:\"meeting_number\";s:0:\"\";s:16:\"meeting_password\";s:0:\"\";}', 'Event', N