(230, 'AFRICA UNITE 2022', 'EVT_16619438402434', '<p><i><strong>IMAGINE 1000 CHANGE MAKERS IN A ROOM. IMAGINE THE GREATNESS ABOUT TO BE BIRTHED.</strong>&nbsp;</i><br><br>Africa Unite is a convention where change makers in Africa get to interact, contribute and provide solutions to issues surrounding grassroots development in Africa.<br><br>We believe that a room with brilliant and passionate changemakers and idealists in Africa will accelerate the fulfillment of the 2030 agenda. To accomplish the objectives of sustainable development in Africa, we are banking on \'Africa Unite\'</p><p>&nbsp;</p><p><strong>Things to take note of:&nbsp;</strong><br><br>- Register for the event (Registration is compulsory)<br><br>- You will recieve an Email to Confirm your registration<br><br>- Attach your picture to the DP event by clicking on the \"Get your DP image\" button in your mail<br><br>- Add the event to your calendar from the site&nbsp;<br><br><br><strong>Welcome to the African Convention for Young Africans</strong></p>', '2022-10-15', '2022-10-15', 'uploads/1662044859mailunnamed__6_.png', '1537374982obusn6a8u39t94101n5ol', '11:04:00', '2022-08-31', 'thumbs/1662044859mailunnamed__6_.png', 0, '9AM- 5PM', NULL, 'Lead Foot Prints Africa', '<p>Lead Footprints Africa is a non governmental organization that focuses on Human Right advocacy and Sensitization.&nbsp;</p>', NULL, NULL, 'show', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2022-10-08', NULL, 309, NULL, '1', 'AFRICAUNITE', NULL, '231rcfr32', 5715, '', 'free', NULL, NULL, NULL, 'Google Meet', 'a:6:{s:20:\"T3JnYW5pemF0aW9uIA==\";a:5:{s:2:\"id\";s:20:\"T3JnYW5pemF0aW9uIA==\";s:8:\"question\";s:13:\"Organization \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:12:\"Q291bnRyeSA=\";a:5:{s:2:\"id\";s:12:\"Q291bnRyeSA=\";s:8:\"question\";s:8:\"Country \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:8:\"Q2l0eSA=\";a:5:{s:2:\"id\";s:8:\"Q2l0eSA=\";s:8:\"question\";s:5:\"City