(240, 'ArtMesh: Open Mic & MeetUp for Storytellers', 'EVT_16638475839617', '<p>ArtMesh: Open Mic + MeetUp for Creatives</p><p><i><strong>ArtMesh is a fun and open environment for writers storytellers spoken word artists poets and everyone else involved in the creative space.</strong></i></p><p>&nbsp;</p><p>Whether you are a performer a lover of art/literature or a friend to one we\'d love you to join us!</p><p><br>If you are interested in performing kindly contact the host upon arrival or send a message via WhatsApp (+2348117230203)</p><p>We look forward to hosting new and experienced writers and performers.</p><p><br><strong>VENUE</strong></p><p>American Corner Ikeja has been home for ARTMESH and continues to house numerous creatives monthtly.&nbsp;</p><p><strong>TIME</strong></p><p>2.00pm - 5.00pm [MeetUp Commences after the program]</p><p><strong>DATE:</strong></p><p>7th, October 2022<br>&nbsp;</p><p>https://youtu.be/ImeFHWNwsjw</p>', '2022-10-07', '2022-10-07', 'uploads/16638479083567144ArtMeshCD.jpg', '1608781742ar872utth2l2ta8iec335r', '11:53:03', '2022-09-22', 'uploads/16638479083567144ArtMeshCD.jpg', 0, '2:00pm - 5:00pm', 'American Corner, Ikeja, 42, Local Airport Road (Concord Bus Stop), Ikeja, Lagos State, Ikeja', 'ArtHut', '<p><strong>ArtHut </strong>is a community-led organization dedicated to uplifting new voices in the creative space of Africa.&nbsp;<br>We encourage voices in all spaces; poetry, storytelling, dance, music et all other creative mediums of expression.</p>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Epe', 30980, 2671, 160, 1, '2022-10-07', NULL, 50, NULL, NULL, 'artmeshoct22', NULL, '231r231002345433rrrr23', 9, 'open mic,poetry,ArtHut,ArtMesh,Ojex,poetry lagos,poetry Nigeria,Poets In Nigeria,Poets In Lagos,Writers,Storytelling', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Get Ticket', '<p>&nbsp;</p>', NULL, NUL