(244, 'Youth Conference\'22', 'EVT_16658759306251', '<p>We are willing to reach out to thousands of youths in our environment who have a large capacity but are not able to use it or are intimidated, depressed and more. We come in the name of our Lord Jesus Christ to set them free and help them do the most, connect with people and learn from people also.</p>', '2022-10-28', '2022-10-30', 'uploads/16658759304644871youth_conference_new.jpg', '1665873674_1271305', '11:18:50', '2022-10-15', 'uploads/16658759304644871youth_conference_new.jpg', 0, '4PM - 8PM; 9AM - 4PM; 8AM - 12AM', '28 Opeloyeru Street, Mascara, Ketu, Lagos', 'TOCC youth', '<p>We are willing to reach out to thousands of youths in our environment who have a large capacity but are not able to use it or are intimidated, depressed and more. We come in the name of our Lord Jesus Christ to set them free and help them do the most, connect with people and learn from people also.</p>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Ikorodu', 30984, 2671, 160, 1, '2022-10-30', NULL, 980, NULL, '1', 'TOCC', NULL, '231rcfre2', 33, 'CONFERENCE,YOUTH,BUILDING CAPACITY,LAGOS,NIGERIA', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#4a120d', 'Register', '<p>Building Capacity as a Successful Youth.</p>', NULL, NULL),
