(248, 'IGNITION 3.0', 'EVT_16698449735743', '<figure class=\"media\"><oembed url=\"https://youtu.be/HLBwqRko2dE\"></oembed></figure><p>IGNITION is an inter-state/city to city special hangout for young minds and it poses to establish a connection between purpose, love and relationship as key ingredient to a successful life. It spurs young minds to greatness through exposure to hidden facts about life\'s purpose as well as relationships.<br>Ignition is a program whose aim is to instigate youths to a successful life through the teachings of the kingdom.<br>Her vision is to raise a generation of purpose-driven minds that will understand and build a godly and successful relationships which in turns affects the society positively through the teachings of the kingdom.<br>Her mission is to raise a generation into a life of positive impact by inspiring, empowering and mentoring young minds to finding and fulfilling their purpose, reconciling souls back to God, solving relationship issues, laying a solid foundation of purpose, love and relationship through the principles and teachings of the kingdom.</p>', '2022-12-28', '2022-12-28', 'uploads/16720114806581312IMG_20221226_003732.jpg', '1609528740i5nm3eaclle988tr2m39eau31', '09:49:33', '2022-11-30', 'uploads/16720114806581312IMG_20221226_003732.jpg', 0, '09:00am - 3:00pm', 'Agbowo Ibadan', 'Comelymhe Impact Network ', '<p>CIN is a multi-network organization that deals majorly on general life development,love and relationship with sexual purity, marriage and family life as well as an enterprise.CIN enlighten youths on the need to develop a purposeful life alongside teaches about love and relationship (the God way)and helps bring back those who have missed the right way through the teachings of the kingdom - kingdom principles. &nbsp; &nbsp;&nbsp;<br>CIN creates true love and life values.</p>', 'Comelymhe Impact Network ', 'Comelymhe', 'hide', '', '', 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, 1, '2022-12-28', NULL, 370, NULL, '1', 'ignition3', NULL, '231rcfre2', 1474, '', 'free', NULL, NULL, NULL, NULL, 'a:3:{s:72:\"QXJlIHlvdSBhdHRlbmRpbmcgdGhlIGV2ZW50IHBoeXNpY2FsbHkgb3IgdmlydHVhbGx5PyA=\";a:5:{s:2:\"id\";s:72:\"QXJlIHlvdSBhdHRlbmRpbmcgdGhlIGV2ZW50IHBoeXNpY2FsbHkgb3IgdmlydHVhbGx5PyA=\";s:8:\"question\";s:53:\"Are you attending the event physically or virtually? \";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:20:\"Physical Attendance \";i:1;s:18:\"Virual Attendance \";}s:8:\"required\";b:0;}s:80:\"V2hlcmUgYXJlIHlvdSBqb2luaW5nIHVzIGZyb20/IChMb2NhdGlvbi9TdGF0ZS9DaXR5L1NjaG9vbCkg\";a:5:{s:2:\"id\";s:80:\"V2hlcmUgYXJlIHlvdSBqb2luaW5nIHVzIGZyb20/IChMb2NhdGlvbi9TdGF0ZS9DaXR5L1NjaG9vbCkg\";s:8:\"question\";s:60:\"Where are you joining us from? (Location/State/City/School) \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:60:\"V2hhdCBhcmUgeW91ciBleHBlY3RhdGlvbnMgZnJvbSBJR05JVElPTiAzLjA/\";a:5:{s:2:\"id\";s:60:\"V2hhdCBhcmUgeW91ciBleHBlY3RhdGlvbnMgZnJvbSBJR05JVElPTiAzLjA/\";s:8:\"question\";s:45:\"What are your expectations from IGNITION 3.0?\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:0;}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '--Select Virtual Platform--', NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#d81818', 'Register', '<p>Thank you for registering... Looking forward to see you join IGNITION 3.0</p>', NULL, NULL),
