(251, 'Hultprize EKSU Entrepreneurs Fest', 'EVT_16705129471304', '<p>The &nbsp;Hult Prize EKSU Entrepreneurâ€™s Fest will be the first ever EKSUâ€™s Trade fair to&nbsp;<br>hold On Campus in Ekiti State University. This event is not only limited to Entrepreneurs in&nbsp;<br>Eksu, but also open to all Entrepreneurs in Ado Ekiti, and beyond.&nbsp;<br>It will bring together all Entrepreneurs ranging from Tech, Education, Fashion, Health, and&nbsp;<br>all to come and showcase their products and services to students of Eksu.<br>It will help to;&nbsp;<br>1. &nbsp;Create more awareness for Hultprize Eksu, and this year\'s On-campus event in&nbsp;<br>general.&nbsp;<br>2. Foster a long lasting relationship between Eksu (Ado-Ekiti) Entrepreneurs, and&nbsp;<br>Hultprize Eksu.&nbsp;<br>3. Showcase the talent, products, and services of the Entrepreneurs to possible&nbsp;<br>customers.&nbsp;</p>', '2023-02-10', '2023-02-10', 'uploads/16705129461408520B03E82A8_1497_4AA3_910F_1BD3783AAC21.jpeg', '1645114013ie4ti741c7s154teaulrnoj60', '03:22:27', '2022-12-08', 'uploads/16705129461408520B03E82A8_1497_4AA3_910F_1BD3783AAC21.jpeg', 0, '9am', 'Open Space beside Adetutu Hall(TMA), EKSU.', 'Hultprize EKSU', '<p>Hult Prize Ekiti State University is chapter of Hult Prize Foundation, Hult Prize Business school, United Nations in partnership with The United Nations Development Programme (UNDP).</p><p>The Hult Prize Foundation transforms the perspective from which young people see their own possibilities in the world around them as leaders of change. With a global startup prize of US$ 1,000,000 as of its anchor activity, the Hult Prize challenge 2023 from its stables organize impactful programs, events, and training for more than a million students worldwide.</p><p>Entrepreneurs Fest is an initiative of Hult Prize EKSU that aims at supporting all students entrepreneurs on campus and bringing them closer to their customers/consumers.</p>', NULL, 'Hp_ekitistateuni', 'show', '', '', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2023-03-01', NULL, 196, NULL, '1', 'HultprizeEksuEntrepreneurfest', NULL, '231rcfre2', 1817, '#Hultprize,#entrepreneurs,#EKSU', 'paid', 'categorized', '2000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2348136969993\n', NULL, NULL, NULL, NULL, NULL, '#fe0094', 'Register', '<p>Hultprize EKSU Entrepreneurs Fest Booth Space</p>', NULL, NULL);
