(259, 'Rave Party', 'EVT_1672943453347900', '<p>\"Are you ready for the party of the year? Look no further, because our Rave Party at the Landmark Beach on Victoria Island is sure to be the highlight of your summer. With a lineup of top Nigerian artists and non-stop music, this is a night you won\'t want to miss. And the best part? Admission is completely free! That\'s right, you can party with us without breaking the bank.</p><p>But that\'s not all - we have even more exciting surprises in store. With a vibrant atmosphere and a beautiful beach setting, our Rave Party is the perfect place to dance the night away with friends. And with a wide range of refreshments and food options available, you can keep the party going all night long.</p><p>So don\'t wait any longer - mark your calendars and join us for the ultimate beach party experience. We can\'t wait to see you there!\"</p>', '2023-01-28', '2023-01-28', 'uploads/16729433342339033png_20230105_192507_0000.png', 'j90819542aBn72i', '06:28:54', '2023-01-05', 'uploads/16729433342339033png_20230105_192507_0000.png', 0, '8pm', 'Island, Lagos ', 'De Elegance Fashion House', '<p>.</p>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Lagos', 30985, 2671, 160, 1, '2024-03-08', NULL, 29997, NULL, '1', 'Ravefree3.0', NULL, '231r231002345433rrrr23', 72, '', 'free', NULL, NULL, '1', NULL, NULL, '4412736268_1672959652', NULL, NULL, NULL, 'NGN', NULL, NULL, 'a:4:{s:16:\"V2l6a2lkL2FsbA==\";a:5:{s:2:\"id\";s:16:\"V2l6a2lkL2FsbA==\";s:4:\"name\";s:6:\"Wizkid\";s:11:\"designation\";s:6:\"Artist\";s:5:\"about\";s:18:\"Wizkid performance\";s:5:\"image\";s:37:\"uploads/167294718946822base_image.png\";}s:16:\"T2xhbWlkZS9hbGw=\";a:5:{s:2:\"id\";s:16:\"T2xhbWlkZS9hbGw=\";s:4:\"name\";s:7:\"Olamide\";s:11:\"designation\";s:6:\"Artist\";s:5:\"about\";s:7:\"Olamide\";s:5:\"image\";s:37:\"uploads/167294720961164base_image.png\";}s:12:\"UmVtYS9hbGw=\";a:5:{s:2:\"id\";s:12:\"UmVtYS9hbGw=\";s:4:\"name\";s:4:\"Rema\";s:11:\"designation\";s: