(260, 'Virtual Session on Moot and Mock by Equity Chancery', 'EVT_16735966796689', '<p>A virtual session on the basics of Moot and Mock trials for Law students. There is a need for students to get involved and practice advocacy while in school and moot and mock is one of the ways to practice lawyering skills. However, some don\'t even know what it is or how it\'s done.</p><p>Equity Chancery has taken responsibility as an organ of the Law Students\' Society, Ekiti State University, to enlighten law students across various faculties/colleges of Law on the \"what\" and \"how\" of Moot and Mock Trials.</p>', '2023-01-17', '2023-01-17', 'uploads/16737738318736337Moot_and_Mock2.png', '1537374982obusn6a8u39t94101n5ol', '07:57:59', '2023-01-13', 'uploads/16737738318736337Moot_and_Mock2.png', 0, '5:30pm - 6:30pm', NULL, 'EQUITY CHANCERY, LSS EKSU', '<p>Equity Chancery is an organ of the Law Students\' Society that helps students improve their practical lawyering skills.</p>', NULL, NULL, 'show', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-01-17', NULL, 194, NULL, '1', 'rudimentsofmootandmock', NULL, '231rcfr32', 1299, '', 'free', NULL, NULL, NULL, 'Google Meet', 'a:3:{s:8:\"U2Nob29s\";a:5:{s:2:\"id\";s:8:\"U2Nob29s\";s:8:\"question\";s:6:\"School\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:8:\"TGV2ZWw=\";a:5:{s:2:\"id\";s:8:\"TGV2ZWw=\";s:8:\"question\";s:5:\"Level\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:5:{i:0;s:3:\"100\";i:1;s:3:\"200\";i:2;s:3:\"300\";i:3;s:3:\"400\";i:4;s:3:\"500\";}s:8:\"required\";b:1;}s:36:\"V2hhdCBhcmUgeW91ciBleHBlY3RhdGlvbnM/\";a:5:{s:2:\"id\";s:36:\"V2hhdCBhcmUgeW91ciBleHBlY3RhdGlvbnM/\";s:8:\"question\";s:27:\"What are your expectations?\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:0;}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Training', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#5f7292', 'Register', '<p>Thank you for registering! We hope to see yo