(268, 'Virtual Skill up by JCIN EKSU', 'EVT_16780163797147', '<p>Virtual Skill Up is an initiative of JCIN EKSU aimed at helping young people achieve personal and career development by upscaling their knowledge of navigating the Digital space.&nbsp;</p><p>&nbsp;</p><p>A 3 days Virtual event entailing 6 insightful sessions and 6 well-versed Facilitators.</p>', '2023-03-10', '2023-03-12', 'uploads/16780178429455718IMG_20230303_WA0121.jpg', '1678015772a2el2leas752crui86mt485', '11:39:39', '2023-03-05', 'uploads/16780178429455718IMG_20230303_WA0121.jpg', 0, '5:00pm - 7:00pm daily', NULL, 'JCIN EKSU', '<p>JCIN EKSU is a local organisation of Junior Chambers International, an organisation aimed at developing global young leaders for positive change.</p><p>We are a group of young active citizens in our collegiate community, Ekiti State University, Ado-Ekiti, Nigeria.</p>', NULL, 'jcineksu', 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-03-10', NULL, 499, NULL, NULL, 'VirtualSkillUp_JCINEKSU', NULL, '231rcfr32', 16, NULL, 'free', NULL, NULL, NULL, 'Google Meet', 'a:1:{s:20:\"RXhwZWN0YXRpb24ocyk=\";a:5:{s:2:\"id\";s:20:\"RXhwZWN0YXRpb24ocyk=\";s:8:\"question\";s:14:\"Expectation(s)\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:0;}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:2:{s:2:\"dc\";s:0:\"\";s:4:\"link\";s:36:\"https://meet.google.com/xha-dzug-rfn\";}', 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#0095d6', 'Register', '<p>Register for Virtual Skill Up by JCIN EKSU</p>', NULL, NULL),
