(275, 'Launchpad Creative and Entrepreneurial Masterclass', 'EVT_16829653206040', '<p>Launchpad is a monthly conference aimed at empowering African entrepreneurs, creatives, and businesses by fostering essential conversations for business success. This conference will bring together top thought leaders from the tech, business, and creative sectors to share valuable insights on a range of topics, including finance and marketing, designed to help our audience unlock their business potential.&nbsp;</p>', '2023-05-27', '2023-05-27', 'uploads/16829653202560423Blue_Modern_Company_Slogan_LinkedIn_Banner.jpg', '1682962976770m4t8ilr4e8c8ola9iat2ol', '06:22:00', '2023-05-01', 'uploads/16829653202560423Blue_Modern_Company_Slogan_LinkedIn_Banner.jpg', 0, '10am-12pm', NULL, 'Mckodev Tech Lab', '<p>Mckodev is a tech company dedicated to helping African entrepreneurs, creatives and businesses unlock their potential by providing smart and secure solutions for website development.</p>', NULL, 'mckodev', 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-05-26', NULL, 20000, NULL, NULL, 'Launchpad_May23', NULL, '231rcfr32', 7, 'launchpad, business, entrepreneur, creative,', 'free', NULL, NULL, NULL, 'Zoom', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:3:{s:7:\"zoom_dc\";s:0:\"\";s:14:\"meeting_number\";s:0:\"\";s:16:\"meeting_password\";s:0:\"\";}', 'Training', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#e22828', 'Register', '<p>&nbsp;</p>', NULL, NULL),
