(277, 'Party with Pivotal - Be the Party', 'EVT_16829689973146', '<p>Get ready to embrace your inner party animal at \"Be the Party: The Biggest Party with Pivotal\" on the 27th of March, 2023, at the exquisite Eden event center in Bodija, Ibadan. This unforgettable night will feature the hottest beats, dazzling lights, and an atmosphere that\'ll make you feel alive like never before.</p><p>Join us as we celebrate life, love, and everything in between with Pivotal, the sensational DJ and music producer who\'s been taking the electronic dance music scene by storm. With a captivating blend of house, techno, and trance, Pivotal\'s unique sound will keep you moving all night long.</p><p>What to expect:</p><ol><li>Non-stop music from Pivotal and a lineup of talented local DJs</li><li>State-of-the-art sound and lighting systems to elevate your senses</li><li>A mesmerizing light show that will transport you to a world of colors and energy</li><li>Themed bars and lounges to quench your thirst and satisfy your cravings</li><li>Interactive art installations and captivating visuals throughout the venue</li><li>A vibrant, energetic crowd ready to dance the night away</li><li>A safe and inclusive environment for everyone to let loose and be themselves</li></ol><p>Dress code: Be the party! Come dressed in your most creative, colorful, and outrageous outfits to become a part of the living celebration. Neon, glitter, and all things that sparkle are highly encouraged.</p><p>Doors open at 8 PM, and the party will go on until the break of dawn. Get your tickets now and be a part of the most incredible party experience Ibadan has ever seen. You don\'t want to miss out on this epic night that\'ll leave you with memories to last a lifetime!</p><p>Follow us on social media for updates, giveaways, and sneak peeks of what\'s to come. See you at Be the Party: The Biggest Party with Pivotal! #BeThePartyIbadan #PartyWithPivotal</p>', '2023-05-27', '2023-05-27', '2024/03/29/uploads/17117014113772313WhatsApp_Image_2024_03_28_at_4.47.47_PM.jpeg', 'j90819542aBn72i', '07:23:17', '2023-05-01', '2024/03/29/uploads/17117014113772313WhatsApp_Image_2024_03_28_at_4.47.47_PM.jpeg', 0, '6pm till Dawn', 'Eden Garden, Osuntokun Avenue, Bodija , Ibadan', 'Pivotal', '<p>Pivtal</p>', ' ', ' ', 'show', '', '', 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, 1, '2023-05-29', NULL, 998, NULL, '1', 'rave', NULL, '231r23cfre2', 2117, 'partywithpivotal,thebiggestrave,betheparty', 'paid', 'categorized', '3000', '1', NULL, NULL, '4103589691_1682970714', NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '2348054991839', 'a:9:{s:60:\"V2hhdCBpcyB0aGUgZGF0ZSBhbmQgdGltZSBvZiB0aGUgZXZlbnQ/L2FsbA==\";a:3:{s:2:\"id\";s:60:\"V2hhdCBpcyB0aGUgZGF0ZSBhbmQgdGltZSBvZiB0aGUgZXZlbnQ/L2FsbA==\";s:8:\"question\";s:39:\"What is the date and time of the event?\";s:6:\"answer\";s:37:\"Event starts by 6pm on 27th May, 2023\";}s:48:\"V2hlcmUgaXMgdGhlIGV2ZW50IGJlaW5nIGhlbGQ/L2FsbA==\";a:3:{s:2:\"id\";s:48:\"V2hlcmUgaXMgdGhlIGV2ZW50IGJlaW5nIGhlbGQ/L2FsbA==\";s:8:\"question\";s:30:\"Where is the event being held?\";s:6:\"answer\";s:75:\"The event will be held at the Eden event center, located in Bodija, Ibadan.\";}s:56:\"V2hhdCBpcyB0aGUgYWdlIGxpbWl0IGZvciB0aGUgZXZlbnQ/L2FsbA==\";a:3:{s:2:\"id\";s:56:\"V2hhdCBpcyB0aGUgYWdlIGxpbWl0IGZvciB0aGUgZXZlbnQ/L2FsbA==\";s:8:\"question\";s:36:\"What is the age limit for the event?\";s:6:\"answer\";s:95:\"The event is strictly 18+ only. Please bring a valid government-issued ID for age verification.\";}s:44:\"SG93IGNhbiBJIHB1cmNoYXNlIHRpY2tldHM/L2FsbA==\";a:3:{s:2:\"id\";s:44:\"SG93IGNhbiBJIHB1cmNoYXNlIHRpY2tldHM/L2FsbA==\";s:8:\"question\";s:27:\"How can I purchase tickets?\";s:6:\"answer\";s:146:\"Tickets can be purchased online through attendout or authorized ticket outlets. Follow our social media for updates and ticket sale announcements.\";}s:56:\"V2hhdCBpcyB0aGUgZHJlc3MgY29kZSBmb3IgdGhlIGV2ZW50Py9hbGw=\";a:3:{s:2:\"id\";s:56:\"V2hhd