cing our community and the\nworld at large.\";}s:48:\"V2hhdCBkbyBhdHRlbmRlZXMgc3RhbmQgdG8gZ2Fpbj8vYWxs\";a:3:{s:2:\"id\";s:48:\"V2hhdCBkbyBhdHRlbmRlZXMgc3RhbmQgdG8gZ2Fpbj8vYWxs\";s:8:\"question\";s:32:\"What do attendees stand to gain?\";s:6:\"answer\";s:565:\"As an attendee you can expect to be challenged and inspired by vast knowledge that would be\nshared from various speakers.\n\nâ— Engaging Talk\nâ— Diverse topics discussion (tech, fashion, innovation,etc).\nâ— Networking opportunities: you get to meet people of likeminds, well-connected and\ninformed people.\nâ— Interactive Sessions : Q&A, workshops, breakout sessions, etc.\nâ— Inspirational atmosphere: you get more motivated, energized and inspired.\n\nBeing an attendee gives you a great opportunity to connect, learn and engage with\nthought-provoking discussions.\";}s:28:\"V2hhdCBpcyBhIFRFRHg/L2FsbA==\";a:3:{s:2:\"id\";s:28:\"V2hhdCBpcyBhIFRFRHg/L2FsbA==\";s:8:\"question\";s:15:\"What is a TEDx?\";s:6:\"answer\";s:210:\" A TEDx event is an independently organized event that follows the same format as the\nTED conferences. \n\nTEDx events are organized by individuals or groups who want to bring the\nspirit of TED to their community\";}s:24:\"V2hhdCBpcyBURUQ/L2FsbA==\";a:3:{s:2:\"id\";s:24:\"V2hhdCBpcyBURUQ/L2FsbA==\";s:8:\"question\";s:12:\"What is TED?\";s:6:\"answer\";s:206:\"TED stands for Technology, Entertainment, and Design.\nIt is a global nonprofit organization that was founded in 1984, with a mission to spread ideas\nand knowledge from the world\'s most innovative thinkers.\n\";}s:56:\"V2hhdCBpcyB0aGUgaWRlYSBiZWhpbmQgVGVkeEFkb0VraXRpPy9hbGw=\";a:3:{s:2:\"id\";s:56:\"V2hhdCBpcyB0aGUgaWRlYSBiZWhpbmQgVGVkeEFkb0VraXRpPy9hbGw=\";s:8:\"question\";s:37:\"What is the idea behind TedxAdoEkiti?\";s:6:\"answer\";s:159:\"TedxAdoEkiti is a locally organized event in Ado-Ekiti that is licensed by TED to bring\ntogether speakers and attendees to share ideas and inspire each other.\n\";}s:36:\"V2hlbiBpcyBUZWR4QWRvRWtpdGk/L2FsbA==\";a:3:{s:2:\"id\";s:36:\"V2hlbiBpcyBUZWR4QWRvRWtpdGk/L2FsbA==\";s:8:\"question\";s:21:\"When is TedxAdoEkiti?\";s:6:\"answer\";s:53:\"TedxAdoEkiti will be held on the 24th of June, 2023.\n\";}s:68:\"SXMgaXQgZ29pbmcgdG8gYmUgYSBwaHlzaWNhbCBvciB2aXJ0dWFsIGV2ZW50Py9hbGw=\";a:3:{s:2:\"id\";s:68:\"SXMgaXQgZ29pbmcgdG8gYmUgYSBwaHlzaWNhbCBvciB2aXJ0dWFsIGV2ZW50Py9hbGw=\";s:8:\"question\";s:46:\"Is it going to be a physical or virtual event?\";s:6:\"answer\";s:155:\"TEDx events are physical. TedxAdoEkiti won\'t be an exception. However, there will be\nprovisions for intending attendees who will be outside town on D-Day.\n\";}s:96:\"V2hhdCBhcmUgdGhlIGNvbnZlcnNhdGlvbnMgYXQgVGVkeEFkb0VraXRpIGdvaW5nIHRvIGJlIGNlbnRlcmVkIG9uPy9hbGw=\";a:3:{s:2:\"id\";s:96:\"V2hhdCBhcmUgdGhlIGNvbnZlcnNhdGlvbnMgYXQgVGVkeEFkb0VraXRpIGdvaW5nIHRvIGJlIGNlbnRlcmVkIG9uPy9hbGw=\";s:8:\"question\";s:67:\"What are the conversations at TedxAdoEkiti going to be centered on?\";s:6:\"answer\";s:110:\"The theme of TedxAdoEkiti is The Bigger Picture. The conversations at the event will\nbe centered around that.\n\";}}', NULL, NULL, NULL, NULL, '#f21a03', 'Register', '<p>&nbsp;</p>', NULL, NULL),
