(286, 'Sunshine mountain safari  1.0', 'EVT_16872197028585', '<p>Ondo mountain safari is an annual program that seeks to bring together all mountain lovers from all around the world to explore the beauty of ONDO state intriguing landscape, this will also serve as an avenue to promote ondo state as the most preferred destination to witness the&nbsp; most enchanting hills and mountains adventure in&nbsp; Nigeria.</p><p><br>&nbsp;</p><p>Our aim is to showcase and get people familiar with all the beautiful mountain in Ondo state, Ondo state mountain safari will subsequently change venue of the program per time until weâ€™ve showcased and promote all the beautiful landscapes in our dear state.</p><p><br>&nbsp;</p><p>For 2023 we will be using the new Lacampagne Tropicana hills, cave and forest resort in in Ita nla Ondo town.</p><p><br>&nbsp;</p><p>The hills has a very beautiful landscape and its also been found by our tourism ambassador in Ondo state. Otunba wanle Akinboboye who has earned Global recognition by building the most distinctive destination in Africa, providing visitors with a blend of natural beauty, cultural immersion, and sustainable tourism practices.</p><p><br>&nbsp;</p><p>Ondo mountain safari will be welcoming tourist from all over World, to witness this beautiful program.</p><p><br>&nbsp;</p><p>This program will also be an avenue for art vendors to exhibit their work in the faces of tourist from all over the world.</p><p><br>&nbsp;</p><p>This Event will be divided into to segments, (Day &amp; Night)</p><p><br>&nbsp;</p><p>Day activities includes,</p><p><br>&nbsp;</p><p>Hiking</p><p>Art exhibition</p><p>Performances (standup comedy, Dance , acrobatic)</p><p>Games (basket ball, Aim the basket, football)</p><p><br>&nbsp;</p><p><br>&nbsp;</p><p>Night activities includes ,</p><p><br>&nbsp;</p><p>Performance</p><p>Born fire</p><p>Pool party</p><p>Karaoke</p><p>&nbsp;</p><p>&nbsp;</p><p>Naija safari x sunshine tourism</p><p><br>&nbsp;</p><p>Ondo Mountain Safari&nbsp; 1.0</p><p><br>&nbsp;</p><p>Music.</p><p>Comedy.</p><p>Art exhibition.</p><p>Pool party.</p><p>Karaoke</p><p>Games.</p><p>Hiking.</p><p>Networking.</p><p><br>&nbsp;</p><p>venue: Lacampagne Tropicana hills, cave and forest resort.</p><p><br>&nbsp;</p><p><br>&nbsp;</p><p>Date: 7th October 2023</p><p><br>&nbsp;</p><p>Pickup Points</p><p><br>&nbsp;</p><p>Ibadan : Trans</p><p>Akure : Dome event center.</p><p>Lagos : ikeja mall</p><p>&nbsp;</p><p><i><strong>Akure</strong></i></p><p><br>&nbsp;</p><p><strong>Early bird.</strong></p><p><br>&nbsp;</p><p>Group of 20: 144k</p><p>Group of 10: 72k</p><p>Group of 5 :35k</p><p>Couple: 15k</p><p>Single : 8k</p><p><br>&nbsp;</p><p>&nbsp;</p><p><strong>Late payment</strong></p><p>&nbsp;</p><p>Group of 20: 180k</p><p>Group of 10: 90k</p><p>Group of 5 : 45k</p><p>Couple: 20k</p><p>Single : 12k</p><p><br>&nbsp;</p><p><i><strong>Ibadan</strong></i></p><p><br>&nbsp;</p><p><strong>Early bird.</strong></p><p>&nbsp;</p><p>Group of 20: 280k</p><p>Group of 10: 140k</p><p>Group of 5 : 70k</p><p>Couple: 28k</p><p>Single : 15k</p><p><br>&nbsp;</p><p>Lagos</p><p>&nbsp;</p><p>Group of 20: 340k</p><p>Group of 10: 170k</p><p>Group of 5 :85k</p><p>Couple: 34k</p><p>Single : 18k</p><p><br>&nbsp;</p><p><br>&nbsp;</p><p>&nbsp;</p><p>For Accommodation enquiry contact: 09050852156, 08132065598</p><p><br>&nbsp;</p><p>Sponsorship &amp; partnership Needed&nbsp;<br>&nbsp;</p>', '2023-10-07', '2023-10-07', '2024/03/29/uploads/17117019372323955WhatsApp_Image_2024_03_28_at_4.47.47_PM.jpeg', '1687212678_2566834', '12:08:22', '2023-06-20', '2024/03/29/uploads/17117019372323955WhatsApp_Image_2024_03_28_at_4.47.47_PM.jpeg', 0, '10am ', 'Lacampagne Tropicana hills, cave and mountain resort. ', 'Naija safari ', '<p>sunshine tourism is a destination marketing organization &nbsp;Showcasing and promoting the enchanting richness &nbsp;of Ondo State.&nbsp;</p><p>&nbsp;</p><p><br>NAIJA SAFARI IS A DESTINATION CURATOR FOR ALL KINDS OF ADVENTURE IN NIGERIA&nbsp;</p><p><br>AQUA SAFARI ðŸŒŠ<br>TROPICAL SAFARI<br>AIR SAFARI ðŸ›©ï¸<br>Boat cruise&nbsp;<br>Group Trips</p>', 'Sunshine tourism ', NULL, 'show', '', '', 'Nigeria [NG]', 'Ondo', 'Ondo', 31035, 2675, 160, 1, '2023-09-30', NULL, -6, NULL, '1', 'Ondomountainsafari', NULL, '231r23100234', 1203, 'Ondo mountain safari, Naija safari, visit ondo,ondo state tourism, sunshine tourism, visit ondo state, Ondo destination. ', NULL, 'categorized', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2348132065598', NULL, NULL, NULL, NULL, NULL, '#f26c05', 'Get Ticket', '<p>Thanks for Registering for Sunshine mountain safari 1.0 We are delighted to have you on board.</p>', NULL, NULL),
(287, 'Rhythm of the Jungle: Afrobeat Extravaganza', 'EVT_16873419286511', '<p><br>\"Rhythm of the Jungle: Afrobeat Extravaganza\" is set to ignite the stage in Ekiti. This exhilarating music concert celebrates the effervescent energy of Afrobeat and the alluring sounds of Zinoleesky. The event, crafted specifically for the students of a Federal University, guarantees an unforgettable night of music and entertainment.</p><p>Zinoleesky, an established figure in Afrobeat, will captivate attendees with his unique sound. His presence promises to elevate the concert, infusing it with a contagious spirit that mirrors the vibrancy of Afrobeat.</p><p>The city of Ekiti, renowned for its natural beauty, plays host to this mesmerizing concert. For the university\'s students and the general audience, \"Rhythm of the Jungle: Afrobeat Extravaganza\" promises a memorable night brimming with rhythmic Afrobeat music, amplified by the stirring performances of Zinoleesky.</p>', '2023-07-28', '2023-07-28', 'uploads/16897762287485685IMG_20230719_WA0020.jpg', '1687348916d17t28liaea7c372re5yomi', '10:05:28', '2023-06-21', 'uploads/16897762287485685IMG_20230719_WA0020.jpg', 0, '9pm', 'AB Foundation Civic Centre, Adebayo/ Opopogboro Street, Ado-Ekiti', 'Jamzi Entertainment', '<p>Jamzi Entertainment presents \"Rhythm of the Jungle: Afrobeat Extravaganza\" an electrifying music concert that will bring together the vibrant energy of Afrobeat music and the captivating sounds of Zinoleesky. Set to take place in the scenic city of Ekiti, this concert is specially designed for the students of a Federal University, promising a night of unforgettable musical experiences.</p>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2024-07-28', NULL, 500, NULL, '1', 'RJAE', NULL, '231r23cfre2', 2300, '', 'paid', 'categorized', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, 'a:9:{s:16:\"U0lSSUJPWS9hbGw=\";a:5:{s:2:\"id\";s:16:\"U0lSSUJPWS9hbGw=\";s:4:\"na