(291, 'Global Tech Africa', 'EVT_16887196642907', '<p>The GTA conference is an initiative of the Future Map Foundation designed and implemented by Ascend Studios Foundation; and in partnership with the National Information Technology Development Agency (NITDA).&nbsp;</p><p>&nbsp;</p><p>The conferenceâ€™s structure includes plenary sessions, breakout sessions, pitch competitions, exhibitions, sideline networking, and cocktail sessions.&nbsp;</p><p>&nbsp;</p><p>Africa is poised to play a critical role in the global tech ecosystem, providing innovation, talent, and new market opportunities in areas such as mobile technology, e-commerce, fintech, and the digital economy.&nbsp;</p><p>&nbsp;</p><p>The GTA conference provides a platform for stakeholders, including investors, regulators, consumers, academia, and the general public, to engage in discussions and explore opportunities for collaboration to shape the future of Africa\'s tech landscape.&nbsp;</p><p>&nbsp;</p><p>GTA will focus on 13 key sectors - Cybersecurity, FINTECH, Robotics &amp; AI, Agro Tech, Gaming, Entertainment, ED Tech, Geographic Information System, Government, Technology, E-Commerce, E-Health, BlO</p>', '2023-07-25', '2023-07-25', 'uploads/1688719664603842event_mockup.jpg', '16762792563mt5riglkc75e14t6nsvt4o7ca2eeid', '08:47:44', '2023-07-07', 'uploads/1688719664603842event_mockup.jpg', 0, '10am', 'Nigeria', 'Future Map Foundation', '<p>The GTA conference is an initiative of the Future Map Foundation designed and implemented by Ascend Studios Foundation; and in partnership with the National Information Technology Development Agency (NITDA).&nbsp;</p>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, 2, '2023-07-25', NULL, 498, NULL, '1', 'GTA', NULL, '231rcfre2', 18, NULL, 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#dd7477', 'Register', '<p>eventreg/EVT_16917602092845</p>', NULL, NULL),
(292, 'BCP x EKSU Customer Centricity: Putting Customers at the Heart of Your Brand', 'EVT_16893473758962', '<h3>Customer Centricity: Putting Customers at the Heart of Your Brand</h3><p>There is something about starting from where you are, and I am not talking about the fictitious â€œlooking for greener pastures so I can startâ€ category of people.</p><p>I am fully convinced Africa is the best place to build for the world. If a business can survive in Africa, it can survive anywhere. More often than not, we have people come out to say, they are building a solution for Africa without having the slightest idea what it means to build for Africa, save the world.</p><p>Hear me out:</p><ul><li>Africa is a dynamic playing field with a distinct rule book.</li><li>We have one of the highest mobile penetrations in the world, yet youâ€™d reach us more offline that online.</li><li>The plethora of marketing skills you see in books, videos, etc are redefined when you consider the African market.</li><li>In most cases, the way to reach us is the good old â€œgirlâ€™s scout wayâ€â€”knocking from door to door to sell your cookies.</li><li>There is a distinct way we understand branding, itâ€™s not the norm youâ€™d find out there, but when the cards are played right, it still fits the mold.</li></ul><p>So, how do you build a global brand locally from within Africa?</p><p>How do you become a changemaker from within Africa?</p><p>When I read the book, <a href=\"https://www.scribd.com/document/376801421/How-to-Build-a-Multi-billion-Dollar-Business-in-Africa-From-Scratch-By-Dr-Strive-Masiyiwa#\">How To Build A Multi-Billion Dollar Business in Africa From Scratch by Dr. Strive Masiyiwa</a> a few years ago, I never imagined I would be pulling together resources to teach people how to build in Africa from scratch one day.</p><p>&nbsp;</p><p>And so, the focus of 2023 is to ensure all the resources available to us, we can refine and use within the set field of Africa. When we do this, weâ€™d be able to build solutions that will hit the nail on the head regarding the solution we are creating for the specific needs of Africans across the world.</p><p>I would use this opportunity to clarify that I am not against building in conformity to the Western market. It is logical to build with a model of repeated success rather than play a gamble with a model that might not work.</p><p>For the longest time, Africans have had their victory only on the lips of its people, gradually, we have few amongst us set the pace to ensure history tells our story as accurately as it happened with our victories echoed through generations.</p><p>This pace is what BCP rides on for 2023 as we push the frontier of our minds to think beyond ourselves and into the future of how we can build global brands locally.</p><p>In one day, Africans will gather under one roof to share, refine, adopt and adapt resources gotten from far and near to chart a course for our future beyond the status quo that has been so defined for many an African.</p><p>Cheers!</p>', '2023-09-01', '2023-09-01', 'uploads/16893473746187207anxiety.png', '1537374982obusn6a8u39t94101n5ol', '03:09:35', '2023-07-14', 'uploads/16893473746187207anxiety.png', 0, '10am ', 'EKSU', 'GDSCxJCINEKSU', '<p>.</p>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'BCPEKSU', NULL, '231rcfre2', 31, '', 'free', NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:3:{s:24:\"UGhpbGlwIEFqYXlpL2FsbA==\";a:5:{s:2:\"id\";s:24:\"UGhpbGlwIEFqYXlpL2FsbA==\";s:4:\"name\";s:12:\"Philip Ajayi\";s:11:\"designation\";s:9:\"JCINEKSU \";s:5:\"about\";s:956:\"Philip is a highly motivated and versatile law student at Ekiti State University, known for consistently maintaining strong academic performance and a relentless pursuit of excellence. With a diverse skill set in content strategy, intellectual property, and data privacy, I have embraced numerous leadership opportunities, such as serving as the President of JCIN EKSU, spearheading the Incubation team for Hult Prize, and serving as the Head of Publication, NIPC Research and Publication Board.\n\n\nAs an accomplished writer and researcher, my portfolio includes published articles on a wide range of subjects, along with my involvement as an intern at the Data Privacy Hub Africa committed to ongoing personal development, I actively pursue certifications, devour books, and engage with thought-provoking podcasts to continually expand my knowledge. Eager to apply my extensive capabilities and unwavering dedication to excel in both the legal and creative\";s:5:\"image\";s:37:\"uploads/168936889976598base_image.png\";}s:24:\"IERhbmllbCBVbW9yZW4vYWxs\";a:5:{s:2:\"id\";s:24:\"IERhbmllbCBVbW9yZW4vYWxs\";s:4:\"name\";s:14:\" Daniel Umoren\";s:11:\"designation\";s:4:\"GDSC\";s:5:\"about\";s:17:\"nothing but tech \";s:5:\"image\";s:37:\"uploads/168936929043610base_image.png\";}s:32:\"T2xhdHVuYm9zdW4gTW9ib2xhamkvYWxs\";a:5:{s:2:\"id\";s:32:\"T2xhdHVuYm9zdW4gTW9ib2xhamkvYWxs\";s:4:\"name\";s:20:\"Olatunbosun Mobolaji\";s:11:\"designation\";s:8:\"JCINEKSU\";s:5:\"about\";s:26:\"na God sabi what i dey do \";s:5:\"image\";s:37:\"uploads/168936974661042base_image.png\";}}', NULL, NULL, 'Event', NULL, NULL, NULL, 'a:2:{s:44:\"RG8gSSBoYXZlIHRvIHBheSB0byBhdHRlbmQgPy9hbGw=\";a:3:{s:2:\"id\";s:44:\"RG8gSSBoYXZlIHRvIHBheSB0byBhdHRlbmQgPy9hbGw=\";s:8:\"question\";s:28:\"Do I have to pay to attend ?\";s:6:\"answer\";s:2:\"no\";}s:40:\"V2lsbCB5b3UgYmUgc2hhcmluZyBtb25leSAvYWxs\";a:3:{s:2:\"id\";s:40:\"V2lsbCB5b3UgYmUgc2hhcmluZyBtb25leSAvYWxs\";s:8:\"question\";s:26:\"Will you be sharing money \";s:6:\"answer\";s:16:\"God go help you \";}}', NULL, NULL, NULL, 'a:3:{s:12:\"VGVlL2FsbA==\";a:3:{s:2:\"id\";s:12:\"VGVlL2FsbA==\";s:4:\"name\";s:3:\"Tee\";s:9:\"testimony\";s:317:\"BCP 22 was the start of something great for me cos it opened me up a bit and helped me summon the courage to attend another event that would change the trajectory of my life. UDC in Lagos, I met very special people who I will forever be grateful to, for always mentioning my name behind closed doors.Â ThankÂ you,Â T.\";}s:36:\"VmVla2VlIEJpbGx6IEFnYm9naGlkaS9hbGw=\";a:3:{s:2:\"id\";s:36:\"VmVla2VlIEJpbGx6IEFnYm9naGlkaS9hbGw=\";s:4:\"name\";s:22:\"Veekee Billz Agboghidi\";s:9:\"testimony\";s:210:\"Thank you so much for your efforts and all you had to do to put this together. Although I came in late, the final minutes gave me a glimpse of why this sort of meetings are a joy to have.\n\nThank you once again.\";}s:12:\"VGF5by9hbGw=\";a:3:{s:2:\"id\";s:12:\"VGF5by9hbGw=\";s:4:\"name\";s:4:\"Tayo\";s:9:\"testimony\";s:131:\"it  was a really cool time. Cooler than I looked forward to. Thanks for helping all of us to connect again, and to meet new people.\";}}', '#ff0505', 'Register', '<p>&nbsp;</p>', NULL, NULL),
