(304, 'AgriBusiness Growth and Wealth Creation', 'EVT_16923555054722', '<p>Exciting News! Join us on August 25th for a game-changing seminar on Agricultural Business Growth and Wealth Creation, hosted by FarmCAS! ðŸŒ±ðŸ“š Get ready to unlock insights into optimizing your agribusiness, learning strategies for sustainable growth, and discovering pathways to create lasting wealth in the agricultural sector. ðŸš€ Don\'t miss this opportunity to connect with fellow agri-enthusiasts and gain invaluable knowledge that could reshape your farming journey. Limited slots available, so mark your calendars and stay tuned for registration details! ðŸ—“ï¸ðŸŒŸ Let\'s cultivate success together! ðŸŒ¾ðŸ’° #AgriWealthSeminar #FarmerSamson #AgriculturalGrowth #WealthCreation #FarmingSuccess #AgribusinessMastery #SaveTheDate</p>', '2023-08-25', '2023-08-25', '2024/03/29/uploads/171170065736651761e529fb44389af8e299d71a87cb586d6.jpeg', '1537374982obusn6a8u39t94101n5ol', '10:45:05', '2023-08-18', '2024/03/29/uploads/171170065736651761e529fb44389af8e299d71a87cb586d6.jpeg', 0, '4pm', NULL, 'FarmCAS', '<p>FarmCAS is a technology-enabled agricultural company solving the human resources challenge in Nigeria agriculture by providing consulting and training services for vegetable&nbsp;crop&nbsp;production and managing farm employees to improve agribusiness output</p>', NULL, NULL, 'show', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-09-28', NULL, 1904, NULL, '1', 'AgricbusinessGrowth', NULL, 'BGRT64GF', 1381, NULL, 'free', NULL, NULL, NULL, 'Google Meet', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:2:{s:2:\"dc\";s:0:\"\";s:4:\"link\";s:36:\"https://meet.google.com/asz-mdjw-ooz\";}', 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#60bd46', 'Register', '<p>check your mail for the meeting link&nbsp;</p>', NULL, NULL),
