(306, 'ArtMesh: Open Mic + MeetUp for Creatives', 'EVT_16932382951885', '<p><i><strong>ARTMESH is held on the First Friday of the month at the American Corner, Ikeja (42, Local Airport Road, Ikeja, Lagos).</strong></i></p><p><br>&nbsp;</p><p>We want to build a fun and open environment for writers, storytellers, spoken word artists, poets, and everyone else involved in the creative space.</p><p><br>&nbsp;</p><p>Whether you are a performer, a lover of art/literature, or a friend to one, we\'d love you to join us!</p><p><br>&nbsp;</p><p>If you are interested in performing, kindly contact the host upon arrival or send a message across via <strong>WhatsApp (+2348117230203)</strong></p><p><br>&nbsp;</p><p>We look forward to hosting new and experieced writers and performers.</p><p><br>&nbsp;</p><p><br>&nbsp;</p><p><br>&nbsp;</p><p><br>&nbsp;</p><p><strong>AGENDA:</strong></p><ol><li>Introduction</li><li>First games</li><li>Open Mic</li><li>See a Short film, quick discuss</li><li>Creative Discussion</li><li>Open Mic II</li><li>Introduce the late arrivals</li><li>Photo-bombay</li><li>Meet\'N\'Greet [at the rooftop]</li></ol><p><br><br>&nbsp;</p><p><strong>VENUE</strong></p><p><i>American Corner, Ikeja</i> has been home for ARTMESH and continues to house numerous creatives monthtly.</p><p><br>&nbsp;</p><p><strong>Time: 2.00pm - 5.00pm [MeetUp Commences after the program]</strong></p><p>Contact our program team <strong>+2348117230203</strong></p>', '2023-10-06', '2023-10-06', '2024/03/29/uploads/17117011046905336190c58b8f8fdf17523d8fb2ad94be023fa3cb8b0da8b1436f93098d326be0978_rimg_w1200_h600_gmir.webp', '1608781742ar872utth2l2ta8iec335r', '03:58:15', '2023-08-28', '2024/03/29/uploads/17117011046905336190c58b8f8fdf17523d8fb2ad94be023fa3cb8b0da8b1436f93098d326be0978_rimg_w1200_h600_gmir.webp', 0, '2:00pm - 5:00pm', 'American Corner Ikeja 42, Local Airport Road, Concord Bus/stop, Ikeja, Lagos', 'ArtHut', '<p>ArtHut is a creative community dedicated towards #TellingOurOwnStories</p>', 'arthutng', 'arthutng', 'show', '', '', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'artmeshsept23', NULL, '231r231002345433rrrr23', 618, 'Arthut, ArtMesh, Art Events, Art Lagos, Poetry Events in Lagos, Poetry Event, Open Mic', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
