(319, 'Innovation summit', 'EVT_16991768412157', '<p>A</p>', '2023-11-21', '2023-11-22', 'uploads/16991768415664711Screenshot_20231027_133810_Gmail.jpg', '1699176255_6435722', '09:34:01', '2023-11-05', 'uploads/16991768415664711Screenshot_20231027_133810_Gmail.jpg', 0, '09:00', 'Adetilo Hall', 'Ministry of Innovation Science & Digital Economy', '<p>This is the ministry of Innovation Science &amp; Digital Economy&nbsp;</p>', NULL, '@InnovateEkiti', 'hide', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'EKIS20231', NULL, 'BGRT64GF', 5, 'Innovation, Summit, Education, Empowering ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Google Meet', NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(320, 'Ekiti Innovation Summit', 'EVT_16992684911379', '<p>The Ekiti Innovation Summit (EKIS 2023) is Ekiti State Governmentâ€™s effort towards defining, strengthening and improving the stateâ€™s creative and tech ecosystem.</p><p>The young innovators, techies, and content creators are now a priority globally, Ekiti State isnâ€™t lagging behind.</p><p>ANTICIPATE EKITI INNOVATION SUMMIT!</p><p>This would be a good time to follow us on all our social media handles for more updates:</p><p>IG: instagram.com/innovateekiti</p><p>X: Twitter.com/innovateekiti</p><p>Facebook: https://www.facebook.com/profile.php?id=61550285279979&amp;mibextid=ViGcVu</p><p>#InnovateEkiti&nbsp;<br>#DigitalEconomy&nbsp;<br>#EKIS2023</p>', '2023-11-21', '2023-11-22', 'uploads/16992684914122215adsArtboard_1_copy_4x_100.jpg', '1699293069526484enrita2ol63etvanci7', '11:01:31', '2023-11-06', 'uploads/16992684914122215adsArtboard_1_copy_4x_100.jpg', 0, '09:00', 'Adetiloye Hall, Fountain Hotel, Off Old Iyin Road Ado Ekiti', 'Ekiti Ministry of Innovation, Science and Digital Economy', '<p>Innovate</p>', NULL, NULL, 'hide', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2023-11-01', NULL, 217, NULL, '1', 'EKIS2023', NULL, '231rcfre2', 3004, 'innovation,digital economy,tech', 'free', NULL, NULL, NULL, NULL, NULL, '8444070535_1699269649', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#206858', 'Register', '<p>Welcome to the Ekiti State Innovation Summit!&nbsp;<br>Congratulations on successfully registering for a journey into the heart of innovation and technology.&nbsp;<br>Your QR ticket is the gateway to an event teeming with insights and inspiration, where the brightest minds meet to explore and exchange groundbreaking ideas.&nbsp;<br>Get ready to immerse yourself in discussions that will redefine the technological landscape and set new benchmarks for innovation. We are delighted to have you join us as we navigate through the possibilities of tomorrow.&nbsp;<br>Thank you for being an integral part of this transformative experience.&nbsp;<br>The Ekiti State Innovation Summit Team eagerly awaits your arrival at the forefront of progress.&nbsp;<br>#EkitiInnovationSummit #TechTrends #InnovateToday</p>', NULL, NULL),
