(323, 'THE ACE SUMMIT 1.0', 'EVT_16997888479160', '<p>Are you a student and it is your dream to Ace it all in your chosen path?</p><p>Are you scared of the outcome of your actions as a result of uncertainty in our decision and actions towards our careers?</p><p>*Anticipate* and ensure to be part of the *ACE SUMMIT* to imbibe in us skills that would lead us through the path of our various careers and ensure we stand out.</p><p>Anticipate the *ACE SUMMIT*!!!<br>Is this cool for my status?</p>', '2023-11-23', '2023-11-24', '2024/03/29/uploads/171170010698313WhatsApp_Image_2023_11_02_at_8.12.14_PM.jpeg', '1699788463_4661899', '11:34:07', '2023-11-12', '2024/03/29/uploads/171170010698313WhatsApp_Image_2023_11_02_at_8.12.14_PM.jpeg', 0, '19:29', NULL, 'The Ace Team ', '<p>The Ace Team comprise Oloye Joel, Sadiq Kehinde, Ajose John, Afolabi Oluwasegun</p>', NULL, NULL, 'show', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ACE-SUMMIT', NULL, '231rcfr32', 379, '', 'paid', NULL, NULL, NULL, 'Telegram', NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#0000ff', 'Get Ticket', '<p>Thank you for registering for the Ace Summit!</p>', NULL, NULL),
(324, 'IGNITION 4.0', 'EVT_16999023625316', '<p>IGNITION is a unique hangout for young minds that spans states and cities with the goal of connecting purpose, love, and relationships as essential components of a fulfilling life.</p>', '2023-12-27', '2023-12-28', '2024/03/29/uploads/17117001694082428WhatsApp_Image_2024_03_28_at_4.47.47_PM.jpeg', '1609528740i5nm3eaclle988tr2m39eau31', '07:06:02', '2023-11-13', '2024/03/29/uploads/17117001694082428WhatsApp_Image_2024_03_28_at_4.47.47_PM.jpeg', 0, '16:00', 'Ibadan Metropolis', 'Comelymhe Impact Network (CIN)', '<p>CIN is a multi-network organization that focuses primarily on general life development,love and relationships with sexual purity, marriage, and family life, as well as enterprise. CIN enlightens youths on the need to develop a purposeful life, teaches about love and relationships (the God way), and helps bring back those who have missed the right way through the teachings of the kingdom\'s principles.<br>CIN creates true love and life values.</p>', NULL, NULL, 'show', NULL, NULL, 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, 1, '2023-12-29', NULL, 409, NULL, '1', 'IGNITION4', NULL, '231rcfre2', 1368, '#ignition4', 'free', NULL, NULL, NULL, NULL, 'a:3:{s:36:\"TG9jYXRpb24vQ2FtcHVzIG9yIFNjaG9vbA==\";a:5:{s:2:\"id\";s:36:\"TG9jYXRpb24vQ2FtcHVzIG9yIFNjaG9vbA==\";s:8:\"question\";s:25:\"Location/Campus or School\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:60:\"V2hlbiB3aWxsIHlvdSBiZSBhcnJpdmluZyBmb3IgdGhlIHByb2dyYW0gPw==\";a:5:{s:2:\"id\";s:60:\"V2hlbiB3aWxsIHlvdSBiZSBhcnJpdmluZyBmb3IgdGhlIHByb2dyYW0gPw==\";s:8:\"question\";s:43:\"When will you be arriving for the program ?\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:5:\"Day 1\";i:1;s:5:\"Day 2\";}s:8:\"required\";b:1;}s:60:\"V2hhdCBhcmUgeW91ciBleHBlY3RhdGlvbnMgZnJvbSB0aGUgcHJvZ3JhbT8=\";a:5:{s:2:\"id\";s:60:\"V2hhdCBhcmUgeW91ciBleHBlY3RhdGlvbnMgZnJvbSB0aGUgcHJvZ3JhbT8=\";s:8:\"question\";s:44:\"What are your expectati