(332, 'The Christmas Party', 'EVT_17029973081557', '<p><br>ðŸŽ„ðŸŽ‰ Join us for a festive celebration at \"The Christmas Party\" in the serene and enchanting Asha Gardens, Bashiri, Ado Ekiti! Get ready for an afternoon filled with joy and merriment starting at 3 PM.</p><p>Experience the magic of the season with an array of delightful activities. Dive into the spirit of friendly competition with engaging games that promise laughter and fun for all ages. Immerse yourself in the melodies of the season with live music that will lift your spirits and get you dancing.</p><p>Indulge your taste buds in a culinary journey with an assortment of delectable food offerings, ensuring there\'s something to delight every palate. And don\'t miss out on the warmth and charm of a bonfire, creating the perfect ambiance for cozy conversations and memorable moments. To cap off the evening in dazzling style, get ready for a spectacular fireworks display that will light up the night sky!</p><p>And let\'s not forget, your enjoyment will be accompanied by a selection of delightful cocktails, adding an extra touch of sophistication and cheer to the festivities.</p><p>Come one, come all, and join us for an unforgettable celebration of joy, togetherness, and the magic of Christmas at Asha Gardens. Mark your calendars for this extraordinary eventâ€”it\'s going to be a Christmas Party to remember! ðŸŽðŸ¥³ðŸ¹âœ¨</p>', '2023-12-27', '2023-12-27', 'uploads/1702997308937235WhatsApp_Image_2023_12_18_at_13.31.40_bf6421d2.jpg', '1661528908_9634326', '02:48:28', '2023-12-19', 'uploads/1702997308937235WhatsApp_Image_2023_12_18_at_13.31.40_bf6421d2.jpg', 0, '15:00', 'Asha Gardens, Bashiri, Ado Ekiti', 'Asha Gardens', '<p>Asha Gardens is place where tranquility meets community. Nestled in the heart of serene natural surroundings, we take pride in offering an oasis of relaxation for individuals, families, friends, and coworkers alike. Our organization is dedicated to providing a haven away from the hustle and bustle of daily life, offering a lush green escape where you can rejuvenate, unwind, and create cherished memories.</p><p>Our relaxation spot is more than just a destinationâ€”it\'s a versatile venue where you can host a myriad of events, from intimate gatherings to lively celebrations. Whether you\'re seeking a peaceful retreat for personal rejuvenation or a picturesque setting to share moments with loved ones, our space caters to all. Surrounded by nature\'s beauty, it\'s the perfect backdrop for fostering connections and enjoying quality time.</p><p>With a commitment to preserving the tranquility of our environment, we\'ve curated a space that balances modern comfort with the serenity of nature. Our amenities and facilities are designed to cater to your needs, ensuring that your visit is both comfortable and enriching. Whether you seek solace in a quiet corner, wish to explore the grounds with your family, or desire a venue for your next corporate event, our relaxation spot is your haven away from home.</p><p>At Asha Gardens we invite you to experience the beauty of our green retreat, where every visit promises a rejuvenating escape and an opportunity to bask in the embrace of nature\'s serenity. Come, unwind, and create unforgettable moments in our tranquil paradise.</p><p><br>&nbsp;</p>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'THECHRISTMAS', NULL, '231r23cfre2', 8, 'thechristmasparty ,ashagardens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
