(341, 'The Road Born Pikin', 'EVT_17144729638026', '<p>Join us for an unforgettable evening of laughter at \"The Road Born Pikin\" comedy special, featuring the hilarious Taichi! This much-anticipated event is scheduled for June 9th at 6 PM, hosted at the scenic Black Nile Turf, located at 23 Aare Avenue Bodija. Whether you\'re a comedy enthusiast or simply in need of a fun night out, this event is perfect for you.&nbsp;<br><br>Early bird tickets are available for just 5K until May 15th, offering a fantastic deal for those who plan ahead. Regular tickets are priced at 10K, with express tickets at 20K for those seeking priority seating. Additionally, we offer a special package, \"Highway for 5,\" for 50K, ideal for groups looking to experience the show together.&nbsp;<br><br>Reserve your spot today by contacting us at the numbers provided on the flyer. Don\'t miss out on an evening filled with side-splitting comedy and great entertainment with Taichi at \"The Road Born Pikin\"!Join us for an unforgettable evening of laughter at \"The Road Born Pikin\" comedy special, featuring the hilarious Taichi! This much-anticipated event is scheduled for June 9th at 6 PM, hosted at the scenic Black Nile Turf, located at 23 Aare Avenue Bodija. Whether you\'re a comedy enthusiast or simply in need of a fun night out, this event is perfect for you.</p><p>Early bird tickets are available for just 5K until May 15th, offering a fantastic deal for those who plan ahead. Regular tickets are priced at 10K, with express tickets at 20K for those seeking priority seating. Additionally, we offer a special package, \"Highway for 5,\" for 50K, ideal for groups looking to experience the show together.</p><p>Reserve your spot today by contacting us at the numbers provided on the flyer. Don\'t miss out on an evening filled with side-splitting comedy and great entertainment with Taichi at \"The Road Born Pikin\"!</p>', '2024-06-09', '2024-06-09', '2024/04/30/uploads/17144729639206687WhatsApp_Image_