(342, 'The dynamic impact of non-governmental organizations in Africa communities fostering youth development and re-orientation across the continent.', 'EVT_17155403052035', '<p>LDI has seen the need to address minds from the grassroots or the very bottom pyramid of the problems. We have seen many talents and potential being used or channeled wrongly because of one reason or another, and we understand that one of the major reasons why this is growing faster is economic insecurity, which is why our movement is underscored by life development, community involvement, education,and economy security-focused.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '2024-05-30', '2024-05-30', '2024/05/12/uploads/17155403046559869IMG_20240512_WA0039.jpg', '1715539201i6dae2al60u9l92ecnert2k1', '06:58:25', '2024-05-12', '2024/05/12/uploads/17155403046559869IMG_20240512_WA0039.jpg', 0, '10:00', 'Chief Wole Olanipekun High Court Hall.', 'Lifeport Development Initiative', '<p><a href=\"https://www.linkedin.com/company/lifeport-development-initiative/\">https://www.linkedin.com/company/lifeport-development-initiative/</a></p>', NULL, NULL, 'show', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Ikere', 30805, 2660, 160, 1, '2024-05-30', NULL, 59, NULL, '1', 'Lifeport', NULL, '231rcfre2', 743, 'Ngo, Ekiti,  community involvement,  youth, love, entrepreneurs,  peace, growth,  Africa, Nigeria.', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#000000', 'Register', '<p>Welcome to our launching event discussing and learning the dynamic impact of non-governmental organizations in African communities! Together, we\'re fostering youth development and re-orientation across the continent. Get ready to embark on a journey of empowerment, innovation, and positive change. Let\'s build a brighter future for Africa, one community at a time. Welcome aboard!</p>', NULL, NULL),
