(345, 'JCIN Ekiti State University 35th Convention and 36th Investiture Ceremony.', 'EVT_17188187148423', '<p>Our Convention &amp; Investiture is dedicated to bringing Young and Enterprising Leaders (Jaycees &amp; Non-Jaycees) to celebrate the achievements and successful completion of the administration of the Local Organization President and as well usher in the new President-Elect that will take over the administration of the Local Organization and ensure continuous development of our great organization.</p>', '2024-07-20', '2024-07-20', '2024/07/15/uploads/1721069569424636435th_Convention_and_36th_Investiture__Ceremony.png', '1718814991_2688806', '05:38:34', '2024-06-19', '2024/07/15/uploads/1721069569424636435th_Convention_and_36th_Investiture__Ceremony.png', 0, '10:00', 'TBD', 'Junior Chamber International Nigeria, Ekiti State University.', '<p>An Organization of Young &amp; Enterprising Leaders gear to foster change and development in their community and the world at large by being an active citizen.</p>', NULL, NULL, 'show', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2024-07-20', NULL, 1000, NULL, '1', 'JCINEKSU-35TH-CONVENTION_36TH-INVESTITURE', NULL, '231rcf34re2', 385, 'Convention,Investiture,party,acknowledgement,', 'paid', 'categorized', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '07082042661', NULL, NULL, NULL, NULL, NULL, '#000000', 'Get Ticket', '<p>Thank you &nbsp;for registering for the JCIN EKSU Convention and Investiture part! See you soon!</p>', NULL, NULL),
(346, 'Smartphone videography and editing. ', 'EVT_17192506178269', '<p>The training is organized to train students on smartphone videography and editing.</p>', '2024-07-20', '2024-07-20', '2024/06/24/uploads/17192506178902533The_light_media___smartphone_tranning_copy_1.png', '1718956344_2187337', '05:36:57', '2024-06-24', '2024/06/24/uploads/17192506178902533The_light_media___smartphone_tranning_copy_1.png', 0, '10:00', 'Genomac Holdings, off Under G Road, Behind Alari Akata Filling Station, Ogbomoso.', 'The Light Media ', '<p>The light media mission is to be the premier destination for individuals and businesses seeking unparalleled creativity and captivating visual experiences that inspire,engage and leave a lasting impression on audiences globally through our expertise in graphic design, cinematography and film making.</p>', 'thelightmedia', NULL, 'show', NULL, NULL, 'Nigeria [NG]', 'Oyo', 'Ogbomosho', 31072, 2677, 160, 1, '2024-07-18', NULL, 41, NULL, NULL, 'Smartphone-training', NULL, '231rcfre2', 342, '', 'free', NULL, NULL, NULL, NULL, 'a:1:{s:68:\"V2hhdCdzIHlvdXIgZXhwZWN0YXRpb25zIGluIGpvaW5pbmcgdGhlIHByb2dyYW0/IA==\";a:5:{s:2:\"id\";s:68:\"V2hhdCdzIHlvdXIgZXhwZWN0YXRpb25zIGluIGpvaW5pbmcgdGhlIHByb2dyYW0/IA==\";s:8:\"question\";s:49:\"What\'s your expectations in joining the program? \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}}', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Training', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#000000', 'Register', '<p>&nbsp;</p>', NULL, NULL),
