(360, 'Ibadan Kickfest', 'EVT_1719437462994327721720005445102', '<p>Ibadan Kickfest is a dynamic sporting event featuring a range of activities including 5 aside set football, swimming, PlayStation 5 and 4 competitions, food and drink vendors, networking opportunities, merch vendors, table and lawn tennis, and snookers. Join us for a day full of excitement and sportsmanship!</p><p>Dont miss out on the chance to engage with sports enthusiasts and enjoy a variety of entertaining activities. This event is perfect for sports lovers and anyone looking to have a great time. Be there!</p>', '2024-06-30', '2024-06-30', '2024/07/03/uploads/17200054234772860image.jpg', 'automated/31f00fb109c831aeaac093cbdffb672b', '12:17:25', '2024-07-03', '2024/07/03/uploads/17200054234772860image.jpg', 0, '13:00', '12 Akintola Maja Street, Opposite Bayse One Place Akintola, Jericho Ibadan', 'WaveHouseMedia', '<p>Contact us for more information</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Oyo', 'Ibadan', 30801, 2660, 160, 1, '2024-06-30', NULL, NULL, NULL, NULL, '7397', NULL, 'sports', 225, 'sports, football, swimming, gaming, vendors', 'paid', 'categorized', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2340808905529', 'a:4:{s:68:\"V2hhdCBhY3Rpdml0aWVzIGFyZSBhdmFpbGFibGUgYXQgSWJhZGFuIEtpY2tmZXN0Pw==\";a:3:{s:2:\"id\";s:68:\"V2hhdCBhY3Rpdml0aWVzIGFyZSBhdmFpbGFibGUgYXQgSWJhZGFuIEtpY2tmZXN0Pw==\";s:8:\"question\";s:49:\"What activities are available at Ibadan Kickfest?\";s:6:\"answer\";s:160:\"Activities include 5 aside football, swimming, PlayStation 5 and 4 games, food and drink vendors, networking, merch vendors, table and lawn tennis, and snooker.\";}s:60:\"V2hlbiBhbmQgd2hlcmUgaXMgSWJhZGFuIEtpY2tmZXN0IGhhcHBlbmluZz8=\";a:3:{s:2:\"id\";s:60:\"V2hlbiBhbmQgd2hlcmUgaXMgSWJhZGFuIEtpY2tmZXN0IGhhcHBlbmluZz8=\";s:8:\"question\";s:44:\"When and where is Ibadan Kickfest happening?\";s:6:\"answer\";s:168:\"Ibadan Kickfest will take place on Sunday, June 30th at 12 Akintola Maja Street, Opposite Bayse One Place Akintola, Jericho, Ibadan, Nigeria, starting at 1:00 PM (WAT).\";}s:56:\"SG93IGNhbiBJIHB1cmNoYXNlIHRpY2tldHMgZm9yIHRoZSBldmVudD8=\";a:3:{s:2:\"id\";s:56:\"SG93IGNhbiBJIHB1cmNoYXNlIHRpY2tldHMgZm9yIHRoZSBldmVudD8=\";s:8:\"question\";s:41:\"How can I purchase tickets for the event?\";s:6:\"answer\";s:132:\"Tickets can be purchased at https://tix.africa/ibkickfest. Individual tickets cost 2500 NGN and a Group of 5 ticket costs 11000 NGN.\";}s:52:\"V2hvIGNhbiBJIGNvbnRhY3QgZm9yIG1vcmUgaW5mb3JtYXRpb24/\";a:3:{s:2:\"id\";s:52:\"V2hvIGNhbiBJIGNvbnRhY3QgZm9yIG1vcmUgaW5mb3JtYXRpb24/\";s:8:\"question\";s:39:\"Who can I contact for more information?\";s:6:\"answer\";s:76:\"For inquiries, you can contact Pope at 0808905529 or Timbhoe at 08073465002.\";}}', NULL, NULL, NULL, NULL, '#FFA500', 'Get Ticket', '<p>Thank you for registering</p>', NULL, NULL),
(361, 'Ibadan Kickfest', 'EVT_1719761250456283681720005490017', '<p>Join us for the Ibadan Kickfest! This exhilarating event will feature 5-aside football, swimming, PlayStation competitions, food and drink vendors, networking, merch vendors, table tennis, and lawn tennis. Its a perfect day out to enjoy sports, games, and great company. Bring your friends and family for an unforgettable experience!</p><p>Dont miss out on this exciting festival. Be there to enjoy a variety of activities and have loads of fun!</p>', '2023-06-30', '2023-06-30', '2024/07/03/uploads/17200054723218727image.jpg', 'automated/31f00fb109c831aeaac093cbdffb672b', '12:18:10', '2024-07-03', '2024/07/03/uploads/17200054723218727image.jpg', 0, '13:00', '12 Akintola Maja Street, Opposite Bayse One Place Akintola, Jericho Ibadan, Nigeria', 'WaveHouseMedia', '<p>Leading event organizers in Ibadan.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Oyo', 'Ibadan', 30801, 2660, 160, 1, '2023-06-30', NULL, NULL, NULL, NULL, 'ibkickfest7539', NULL, '231rcfre2', 268, 'football,swimming,gaming,networking', 'paid', 'categorized', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2348089805529', 'a:3:{s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";a:3:{s:2:\"id\";s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";s:8:\"question\";s:24:\"What is the event about?\";s:6:\"answer\";s:113:\"Ibadan Kickfest is a sports and entertainment festival featuring football, swimming, gaming, and various vendors.\";}s:36:\"V2hlcmUgaXMgdGhlIGV2ZW50IGxvY2F0ZWQ/\";a:3:{s:2:\"id\";s:36:\"V2hlcmUgaXMgdGhlIGV2ZW50IGxvY2F0ZWQ/\";s:8:\"question\";s:27:\"Where is the event located?\";s:6:\"answer\";s:84:\"12 Akintola Maja Street, Opposite Bayse One Place Akintola, Jericho Ibadan, Nigeria.\";}s:40:\"V2hhdCBhY3Rpdml0aWVzIGFyZSBhdmFpbGFibGU/\";a:3:{s:2:\"id\";s:40:\"V2hhdCBhY3Rpdml0aWVzIGFyZSBhdmFpbGFibGU/\";s:8:\"question\";s:30:\"What activities are available?\";s:6:\"answer\";s:118:\"Activi