(362, 'Blood Drive 2024', 'EVT_172074742928681691720005808960', '<p>The ABUAD Club 25 invites you to join us for Blood Drive 2024, an event dedicated to saving lives through blood donation. Mark your calendars and come be a part of this noble cause from October 24 to 26 at Owolabi Hall (24th, 25th) and Alfa Belgore (26th). Every drop counts in making a significant impact! We look forward to your participation and support.</p><p>Give blood and help keep the world beating. Please note that donors below the age of 18 years should seek parental consent. Thank you for your understanding and contribution towards this life-saving event.</p>', '2024-10-24', '2024-10-26', '2024/07/03/uploads/17200057929735181image.jpg', 'automated/31f00fb109c831aeaac093cbdffb672b', '12:23:28', '2024-07-03', '2024/07/03/uploads/17200057929735181image.jpg', 0, '11:00 - 16:00', 'Owolabi Hall, Alfa Belgore', 'ABUAD Club 25', '<p>Leading the initiative to encourage voluntary blood donation and public health awareness.</p>', '', '', 'hide', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Ado-Ekiti', 30801, 2660, 160, 1, '2024-10-26', NULL, 1000, NULL, NULL, 'ABUAD Club 255210', NULL, 'health', 191, 'blood drive, health, voluntary donation', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:3:{s:28:\"V2hvIGNhbiBkb25hdGUgYmxvb2Q/\";a:3:{s:2:\"id\";s:28:\"V2hvIGNhbiBkb25hdGUgYmxvb2Q/\";s:8:\"question\";s:21:\"Who can donate blood?\";s:6:\"answer\";s:123:\"Anyone above the age of 18 with no health complications can donate blood. For those below 18, parental consent is required.\";}s:56:\"V2hlbiBhbmQgd2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";a:3:{s:2:\"id\";s:56:\"V2hlbiBhbmQgd2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";s:8:\"question\";s:41:\"When and where is the event taking place?\";s:6:\"answer\";s:159:\"The event is scheduled for October 24-26, 2024, at Owolabi Hall on the 24th and 25th and Alfa Belgore on the 26th. The event will run daily from 11 AM to 4 PM.\";}s:44:\"V2hhdCBzaG91bGQgSSBicmluZyB0byB0aGUgdmVudWU/\";a:3:{s:2:\"id\";s:44:\"V2hhdCBzaG91bGQgSSBicmluZyB0byB0aGUgdmVudWU/\";s:8:\"question\";s:33:\"What should I bring to the venue?\";s:6:\"answer\";s:105:\"Please bring a valid ID and ensure you have eaten a healthy meal before donating. Drink plenty of fluids.\";}}', NULL, NULL, NULL, NULL, '#E31B23', 'Register', '<p>Thanks for registering</p>', NULL, NULL),
(363, 'Free Master Class', 'EVT_171945604342381720006936652', '<p>Join us on a journey to master forex trading. This 2-days beginners forex class covers basic concepts, Q&A sessions, and provides mentorship. Discover your path to financial success with practical sessions and free signal group.</p><p>The benefits include trading strategies, practical sessions, mentorship, and free signal group.</p>', '2024-07-05', '2024-07-06', '2024/07/03/uploads/1720006921624311image.jpg', '1690190534656c2eaci2t1l0r85isa6a', '12:42:16', '2024-07-03', '2024/07/03/uploads/1720006921624311image.jpg', 0, '14:00', NULL, 'The Money Tribe', '<p>Join The Money Tribe for an insightful and educational experience in forex trading.</p>', '', '', 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2024-07-05', NULL, 1000, NULL, NULL, 'themoneytribe1607', NULL, '231rcfr32', 10, 'forex, trading, financial success, money tribe', 'free', NULL, NULL, NULL, 'YouTube', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:3:{s:40:\"V2hhdCB0b3BpY3Mgd2lsbCBiZSBjb3ZlcmVkPw==\";a:3:{s:2:\"id\";s:40:\"V2hhdCB0b3BpY3Mgd2lsbCBiZSBjb3ZlcmVkPw==\";s:8:\"question\";s:28:\"What topics will be covered?\";s:6:\"answer\";s:71:\"Basic concepts, trading strategies, mentorship, and practical sessions.\";}s:40:\"SXMgdGhlcmUgYW55IGNvc3QgdG8gYXR0ZW5kPw==\";a:3:{s:2:\"id\";s:40:\"SXMgdGhlcmUgYW55IGNvc3QgdG8gYXR0ZW5kPw==\";s:8:\"question\";s:28:\"Is there any cost to attend?\";s:6:\"answer\";s:30:\"No, this master class is free.\";}s:40:\"V2hlcmUgd2lsbCB0aGUgZXZlbnQgYmUgaGVsZD8=\";a:3:{s:2:\"id\";s:40:\"V2hlcmUgd2lsbCB0aGUgZXZlbnQgYmUgaGVsZD8=\";s:8:\"question\";s:29:\"Where will the event be held?\";s:6:\"answer\";s:42:\"The event will be held online via YouTube.\";}}', NULL, NULL, NULL, NULL, '#000000', 'Register', '<p>Thanks for registering</p>', NULL, NULL),
(364, 'Parliamentary Visit', 'EVT_1234567890123430041720010173084', '<p>The National Union of Lagos State Students (NULASS LASU) is organizing a parliamentary visit to the Lagos State House of Assembly. This event is under the leadership of Rt. Hon. Noah Opeoluwa Emmanuel. It aims to provide students with an insightful experience of legislative proceedings and governance.</p><p>Join us for an enlightening day on the 2nd of July, 2024, as we explore the inner workings of the Lagos State House of Assembly and engage with legislative members.</p>', '2024-07-02', '2024-07-02', '2024/07/03/uploads/17200101571336478image.jpg', 'automated/2037653c65a7e221899d7179d2a5f990', '13:36:13', '2024-07-03', '2024/07/03/uploads/17200101571336478image.jpg', 0, '', 'Lagos State House of Assembly', 'NULASS LASU', '<p>We are the Lagos State University chapter of the National Union of Lagos State Students, dedicated to representing and uplifting the interests of our members.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Lagos', 'Ikeja', 32001, 2674, 160, 1, '2024-07-02', NULL, 1000, NULL, NULL, 'NULASSLASU4437', NULL, 'student_event', 215, 'parliamentary visit, student event, NULASS', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:3:{s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";a:3:{s:2:\"id\";s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";s:8:\"question\";s:24:\"What is the event about?\";s:6:\"answer\";s:98:\"The event is a parliamentary visit to the Lagos State House of Assembly, organized by NULASS LASU.\";}s:24:\"V2hlbiBpcyB0aGUgZXZlbnQ/\";a:3:{s:2:\"id\";s:24:\"V2hlbiBpcyB0aGUgZXZlbnQ/\";s:8:\"question\";s:18:\"When is the event?\";s:6:\"answer\";s:31:\"The event is on 2nd July, 2024.\";}s:44:\"V2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";a:3:{s:2:\"id\";s:44:\"V2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";s:8:\"question\";s:32:\"Where is the event taking place?\";s:6:\"answer\";s:74:\"The event will be 