(366, 'FYB Week', 'EVT_1719478262994316811720010631151', '<p>Join us for a week-long event at Christ Apostolic Church, Victory Chapel, Oye Ekiti. Enjoy various activities each day including prayers, career talk, health/relationship talk, testimony & signout, dinner, hangout, and thanksgiving. Dont miss out on this transformative experience!</p><p>Conquerors Family invites you to be a part of this exciting FYB Week. We look forward to seeing you!</p>', '2024-07-08', '2024-07-14', '2024/07/03/uploads/17200106101255053image.jpg', 'j90819542aBn72i', '13:43:51', '2024-07-03', '2024/07/03/uploads/17200106101255053image.jpg', 0, '00:00', 'Victory Chapel, Oye Ekiti', 'Christ Apostolic Church', '<p>Welcome to Victory Chapel, the home of conquerors.</p>', 'cacvictorychapeloye', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Oye', 30801, 2660, 160, 1, '2024-07-14', NULL, 999, NULL, NULL, 'cacvictorychapeloye1804', NULL, '231rcfre2', 366, 'church, fyb week, prayers, career talk, health talk, testimony, dinner, hangout, thanksgiving', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:2:{s:24:\"V2hhdCBpcyBGWUIgV2Vlaz8=\";a:3:{s:2:\"id\";s:24:\"V2hhdCBpcyBGWUIgV2Vlaz8=\";s:8:\"question\";s:17:\"What is FYB Week?\";s:6:\"answer\";s:237:\"FYB Week is a week-long event organized by Christ Apostolic Church, Victory Chapel, Oye Ekiti, featuring various activities including prayers, career talk, health/relationship talk, testimony & signout, dinner, hangout, and thanksgiving.\";}s:48:\"SXMgdGhlcmUgYSBjb3N0IHRvIGF0dGVuZCBGWUIgV2Vlaz8=\";a:3:{s:2:\"id\";s:48:\"SXMgdGhlcmUgYSBjb3N0IHRvIGF0dGVuZCBGWUIgV2Vlaz8=\";s:8:\"question\";s:35:\"Is there a cost to attend FYB Week?\";s:6:\"answer\";s:31:\"No, FYB Week is free to attend.\";}}', NULL, NULL, NULL, NULL, '#880000', 'Register', '<p>Thanks for registering</p>', NULL, NULL),
(367, 'Dinner Night Party', 'EVT_5482938405832192551720011846448', '<p>Join us for an unforgettable Dinner Night Party hosted by the Nigerian Mining and Geosciences Society, FUOYE Chapter. The event will feature awards, networking opportunities, games, life talks, fine dining and wining, music, and delicious food and drinks. Don’t miss out on a night of celebration and networking!</p><p>This is a perfect opportunity to relax, enjoy, and create lasting memories with friends and colleagues in a beautiful setting. Get ready for a night filled with fun, laughter, and unforgettable moments.</p>', '2024-07-08', '2024-07-08', '2024/07/03/uploads/17200118266950054image.jpg', '1720011922951ifa20colr7ate80ruv19', '14:04:06', '2024-07-03', '2024/07/03/uploads/17200118266950054image.jpg', 0, '21:00', 'Church Auditorium, Opp. Fed. Poly Ede, 2nd Gate, Egberin Ede.', 'Nigerian Mining and Geosciences Society, FUOYE Chapter', '<p>We are dedicated to creating impactful and memorable events</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Osun', 'Ede', 30801, 2660, 160, 1, '2024-07-08', NULL, 1000, NULL, NULL, 'mc_efinrin7478', NULL, '231rcfre2', 292, 'dinner, awards, networking, party', 'paid', 'single', '1000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2349066360210', 'a:2:{s:32:\"V2hhdCBpcyB0aGUgZHJlc3MgY29kZT8=\";a:3:{s:2:\"id\";s:32:\"V2hhdCBpcyB0aGUgZHJlc3MgY29kZT8=\";s:8:\"question\";s:23:\"What is the dress code?\";s:6:\"answer\";s:54:\"Formal wear is recommended for the Dinner Night Party.\";}s:40:\"SXMgdGhlcmUgYW4gYWdlIHJlc3RyaWN0aW9uPw==\";a:3:{s:2:\"id\";s:40:\"SXMgdGhlcmUgYW4gYWdlIHJlc3RyaWN0aW9uPw==\";s:8:\"question\";s:28:\"Is there an age restriction?\";s:6:\"answer\";s:56:\"The event is suitable for individuals aged 18 and above.\";}}', NULL, NULL, NULL, NULL, '#000000', 'Get Ticket', '<p>Thank you for registering</p>', NULL, NULL),
