(369, 'Miss Elegant 2021', 'EVT_1719669359584343121720012766751', '<p>Join us for the Miss Elegant 2021 beauty pageant. An event that celebrates elegance, talent, and beauty. Participate and stand a chance to win exciting prizes and online promotion opportunities.</p><p>The event promises to be an spectacular experience with various rounds and exciting rewards. Dont miss out on the opportunity to showcase your elegance!</p>', '2024-02-20', '2024-02-23', '2024/07/03/uploads/17200127391153451image.jpg', '1720012917r5c0tme615l2429an8kii', '14:19:26', '2024-07-03', '2024/07/03/uploads/17200127391153451image.jpg', 0, '00:00', NULL, 'Elegant Org', '<p>Reputable organization managing beauty pageants globally.</p>', '', '', 'show', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2024-02-23', NULL, 1000, NULL, NULL, 'elegantpageant5299', NULL, 'pageant', 210, 'beauty,pageant,elegance', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:5:{s:44:\"V2hlbiBpcyB0aGUgcmVnaXN0cmF0aW9uIHBlcmlvZD8=\";a:3:{s:2:\"id\";s:44:\"V2hlbiBpcyB0aGUgcmVnaXN0cmF0aW9uIHBlcmlvZD8=\";s:8:\"question\";s:32:\"When is the registration period?\";s:6:\"answer\";s:59:\"The registration period is from February 20 to February 23.\";}s:36:\"V2hlbiBpcyB0aGUgdm90aW5nIHBlcmlvZD8=\";a:3:{s:2:\"id\";s:36:\"V2hlbiBpcyB0aGUgdm90aW5nIHBlcmlvZD8=\";s:8:\"question\";s:26:\"When is the voting period?\";s:6:\"answer\";s:50:\"The voting period is from February 24 to March 15.\";}s:52:\"V2hhdCBpcyB0aGUgZ3JhbmQgcHJpemUgZm9yIHRoZSB3aW5uZXI/\";a:3:{s:2:\"id\";s:52:\"V2hhdCBpcyB0aGUgZ3JhbmQgcHJpemUgZm9yIHRoZSB3aW5uZXI/\";s:8:\"question\";s:39:\"What is the grand prize for the winner?\";s:6:\"answer\";s:103:\"The winner will receive 50¢ cash, a full makeup kit box, online promotion, and an ambassadorship deal.\";}s:44:\"QXJlIHRoZXJlIHByaXplcyBmb3IgcnVubmVyLXVwcz8=\";a:3:{s:2:\"id\";s:44:\"QXJlIHRoZXJlIHByaXplcyBmb3IgcnVubmVyLXVwcz8=\";s:8:\"questio