(371, 'Come Up Hither', 'EVT_1719437462994378611720081248944', '<p>This event is organized by the Deeper Life Corps Fellowship, Kwara State. Come join us for a transformative experience that includes prayers, word, worship, salvation, impartation, and deliverance. Dont miss this opportunity to be uplifted and inspired.</p><p>Get ready for an evening of spiritual awakening and growth. Mark your calendars for the Come Up Hither event and be prepared to receive blessings and teachings that will enhance your spiritual journey.</p>', '2024-07-05', '2024-07-06', '2024/07/04/uploads/17200812213378107image.jpg', '1720088734_5085357', '09:20:48', '2024-07-04', '2024/07/04/uploads/17200812213378107image.jpg', 0, '21:00', 'Deeper Life Bible Church, Stadium District, Oro Road, Ilorin, Kwara State.', 'Deeper Life Corps Fellowship, Kwara State', '<p>Join the Deeper Life Corps Fellowship as we come together for a powerful spiritual program designed to uplift and inspire. We are dedicated to spreading the gospel and providing a space for spiritual growth and community.</p>', 'DLKwaraCorpers', 'DLKwaraCorpers', 'show', NULL, NULL, 'Nigeria [NG]', 'Kwara', 'Ilorin', 30805, 2665, 160, 1, '2024-07-05', NULL, 1000, NULL, NULL, 'DLKFellowship8099', NULL, '231spiritual2', 273, 'spiritual,prayers,worship,impartation,deliverance', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:5:{s:52:\"V2hhdCBpcyB0aGUgZGF0ZSBhbmQgdGltZSBvZiB0aGUgZXZlbnQ/\";a:3:{s:2:\"id\";s:52:\"V2hhdCBpcyB0aGUgZGF0ZSBhbmQgdGltZSBvZiB0aGUgZXZlbnQ/\";s:8:\"question\";s:39:\"What is the date and time of the event?\";s:6:\"answer\";s:41:\"The event is on 5th July 2024 at 9:00 PM.\";}s:44:\"V2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";a:3:{s:2:\"id\";s:44:\"V2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";s:8:\"question\";s:32:\"Where is the event taking place?\";s:6:\"answer\";s:100:\"The event will be held at Deeper Life Bible Church, Stadium Dist