(372, 'Beyond NYSC', 'EVT_1719671042295740391720086678033', '<p>Beyond NYSC is a 3-day event organized by CARBUT, aimed at navigating your career, business, and tech pathways. Esteemed speakers like Tola TA Alabi, David O. Lawal, Zainab Balogun, and many more will share their expertise to guide attendees through various domains. Dont miss these sessions from July 18th to July 20th, 2024.</p><p>Join us live on Google Meet to gain valuable insights and opportunities for growth as you embark on your professional journey post-NYSC.</p>', '2024-07-18', '2024-07-20', '2024/07/04/uploads/17200866548369725image.jpg', '16762792563mt5riglkc75e14t6nsvt4o7ca2eeid', '10:51:18', '2024-07-04', '2024/07/04/uploads/17200866548369725image.jpg', 0, '19:00', NULL, 'CARBUT', '<p>Dedicated to empowering graduates.</p>', '', '@carbutng', 'show', NULL, NULL, NULL, NULL, NULL, 1100, 1100, 1100, 1, '2024-07-18', NULL, 1000, NULL, '1', 'carbutng8030', NULL, 'Education', 262, 'Beyond NYSC, CARBUT, Career, Business, Tech', 'free', NULL, NULL, NULL, 'Google Meet', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:2:{s:28:\"V2hhdCBpcyBCZXlvbmQgTllTQz8=\";a:3:{s:2:\"id\";s:28:\"V2hhdCBpcyBCZXlvbmQgTllTQz8=\";s:8:\"question\";s:20:\"What is Beyond NYSC?\";s:6:\"answer\";s:110:\"Beyond NYSC is a 3-day event organized by CARBUT aimed at navigating your career, business, and tech pathways.\";}s:40:\"SG93IGNhbiBJIGF0dGVuZCBCZXlvbmQgTllTQz8=\";a:3:{s:2:\"id\";s:40:\"SG93IGNhbiBJIGF0dGVuZCBCZXlvbmQgTllTQz8=\";s:8:\"question\";s:29:\"How can I attend Beyond NYSC?\";s:6:\"answer\";s:95:\"You can attend Beyond NYSC live on Google Meet. The event link is provided in the registration.\";}}', NULL, NULL, NULL, NULL, '#17dce6', 'Register', '<p><i>Thank you for registering for the event. Join the community for FREE to get more updates about the event. https://chat.whatsapp.com/FmkR09jN5HVBVFxYFC2oK3</i></p>', NULL, NULL),
(373, 'Academic Star Summit 24', 'EVT_1234567890123460941720157402038', '<p>The Academic Star Summit 24 is themed Unleashing Your Inner Power. Join us for a 4-day event packed with insightful sessions by industry leaders. A chance to network and learn. Hosted at Joseph Ayo Babalola University with support from the Christ Apostolic Church Directorate of Youth Affairs. We look forward to an inspiring and empowering experience.</p><p>Mark your calendars from July 17th to 20th, 2024. Do not miss this opportunity to unleash your potential and grow through meaningful engagements and sessions.</p>', '2024-07-17', '2024-07-20', '2024/07/05/uploads/17201573799147520image.jpg', '1720157538_5643540', '06:30:02', '2024-07-05', '2024/07/05/uploads/17201573799147520image.jpg', 0, '09:00', 'Joseph Ayo Babalola University (JABU), Ikeji Arakeji, Osun State', 'Christ Apostolic Church Directorate of Youth Affairs', '<p>Christ Apostolic Church Directorate of Youth Affairs strives to empower the youth through faith, knowledge, and community events.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Osun', 'Ikeji Arakeji', 5678, 1234, 160, 1, '2024-07-16', NULL, 1000, NULL, NULL, 'academicstar248139', NULL, 'academic', 244, 'academic, summit, empowerment, youth', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:3:{s:60:\"V2hlbiBkb2VzIHRoZSBBY2FkZW1pYyBTdGFyIFN1bW1pdCAyNCBzdGFydD8=\";a:3:{s:2:\"id\";s:60:\"V2hlbiBkb2VzIHRoZSBBY2FkZW1pYyBTdGFyIFN1bW1pdCAyNCBzdGFydD8=\";s:8:\"question\";s:44:\"When does the Academic Star Summit 24 start?\";s:6:\"answer\";s:36:\"The event starts on July 17th, 2024.\";}s:32:\"V2hlcmUgaXMgdGhlIGV2ZW50IGhlbGQ/\";a:3:{s:2:\"id\";s:32:\"V2hlcmUgaXMgdGhlIGV2ZW50IGhlbGQ/\";s:8:\"question\";s:24:\"Where is the event held?\";s:6:\"answer\";s:95:\"The event is held at Joseph Ayo Babalola University (JABU), Ikeji Arakeji, Osun State, Nigeria.\";}s:40:\"V2hvIGlzIG9yZ2FuaXppbmcgdGhlIGV2ZW50Pw==\