(374, 'Games Night 1.0 - Thriller Experience', 'EVT_1719671042294874351720353004685', '<p>Join us for the ultimate Games Night 1.0. Immerse yourself in a thrilling experience with food, unlimited cocktails, asun, games, small chops, and lots of prizes to be won! Dress code: All white with steeze. Dont miss out on the $100 grand prize and free shots. Comedy and side attractions will make the night unforgettable.</p><p>Get ready for a night of fun and excitement, filled with unlimited drinks and endless games. Reserve your spot now!</p>', '2024-07-27', '2024-07-27', '2024/07/07/uploads/17203529821458754image.jpg', '1578052826_8153106', '12:50:04', '2024-07-07', '2024/07/07/uploads/17203529821458754image.jpg', 0, '19:00', 'Undisclosed', 'Original Warriboy Entertainment', '<p>Experience the best in entertainment with us.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', '', '', NULL, NULL, NULL, 1, '2024-07-27', NULL, 1000, NULL, NULL, 'OriginalWarriBoy2061', NULL, 'entertainment', 239, 'games, entertainment, night, party', 'paid', 'single', '15000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2348064872898', 'a:3:{s:32:\"V2hhdCBpcyB0aGUgZHJlc3MgY29kZT8=\";a:3:{s:2:\"id\";s:32:\"V2hhdCBpcyB0aGUgZHJlc3MgY29kZT8=\";s:8:\"question\";s:23:\"What is the dress code?\";s:6:\"answer\";s:22:\"All white with steeze.\";}s:44:\"V2hhdCB0aW1lIGRvZXMgdGhlIGV2ZW50IHN0YXJ0Pw==\";a:3:{s:2:\"id\";s:44:\"V2hhdCB0aW1lIGRvZXMgdGhlIGV2ZW50IHN0YXJ0Pw==\";s:8:\"question\";s:31:\"What time does the event start?\";s:6:\"answer\";s:33:\"The red carpet starts at 7:00 PM.\";}s:48:\"V2hhdCBpcyBpbmNsdWRlZCBpbiB0aGUgdGlja2V0IGZlZT8=\";a:3:{s:2:\"id\";s:48:\"V2hhdCBpcyBpbmNsdWRlZCBpbiB0aGUgdGlja2V0IGZlZT8=\";s:8:\"question\";s:35:\"What is included in the ticket fee?\";s:6:\"answer\";s:120:\"Food, unlimited cocktails, asun, games, small chops, $100 grand prize, free shots, comedy, and lots of prizes to be won.\";}}', NULL, NULL, NULL, NULL, '#d6a