(375, 'Break into Tech OClock Without Code', 'EVT_1719876543212379061720360057747', '<p>Join us for an insightful event where you will learn how to break into the tech industry without needing to know how to code. Whether youre looking to start a new career or enhance your current skill set, this event is for you. Get ready to connect with industry experts and gain valuable knowledge on the tech landscape.</p><p>Dont miss out on this opportunity to kickstart your journey in the tech world!</p>', '2024-07-11', '2024-07-11', '2024/07/07/uploads/17203600415506329image.jpg', 'automated/fbab0cabdbc00445abeb12554db0f39b', '14:47:37', '2024-07-07', '2024/07/07/uploads/17203600415506329image.jpg', 0, '10:00', 'Management Science Auditorium, University of Abuja, Main Campus', '', '', '', '', 'show', NULL, NULL, 'Nigeria [NG]', '', 'Abuja', 1100, 1100, 1100, 1, '2024-07-11', NULL, 1000, NULL, NULL, '6972', NULL, '', 249, 'tech, non-code, career', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:4:{s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";a:3:{s:2:\"id\";s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";s:8:\"question\";s:24:\"What is the event about?\";s:6:\"answer\";s:89:\"The event focuses on breaking into the tech industry without needing to know how to code.\";}s:28:\"V2hlcmUgaXMgdGhlIHZlbnVlPw==\";a:3:{s:2:\"id\";s:28:\"V2hlcmUgaXMgdGhlIHZlbnVlPw==\";s:8:\"question\";s:19:\"Where is the venue?\";s:6:\"answer\";s:63:\"Management Science Auditorium, University of Abuja, Main Campus\";}s:24:\"V2hlbiBpcyB0aGUgZXZlbnQ/\";a:3:{s:2:\"id\";s:24:\"V2hlbiBpcyB0aGUgZXZlbnQ/\";s:8:\"question\";s:18:\"When is the event?\";s:6:\"answer\";s:41:\"On 11th July, 2024, starting at 10:00 AM.\";}s:24:\"SXMgdGhlIGV2ZW50IGZyZWU/\";a:3:{s:2:\"id\";s:24:\"SXMgdGhlIGV2ZW50IGZyZWU/\";s:8:\"question\";s:18:\"Is the event free?\";s:6:\"answer\";s:33:\"Yes, the event is free to attend.\";}}', NULL, NULL, NULL, NULL, '#FFA500', 'Reg