(376, 'Break Into Tech OClock Without Code', 'EVT_1719437523998758451720360240806', '<p>Join us for an insightful event where you can break into the tech industry without any coding knowledge. Learn from industry experts and explore various non-coding roles in tech. Dont miss out on this opportunity to reshape your future!</p><p>Come and network with like-minded individuals and professionals. Gain the knowledge and skills to start your tech career. See you at the Management Science Auditorium, University of Abuja.</p>', '2024-07-11', '2024-07-11', '2024/07/07/uploads/17203602234129527image.jpg', 'automated/39f712dc9120851fd9f1465361da5520', '14:50:40', '2024-07-07', '2024/07/07/uploads/17203602234129527image.jpg', 0, '10:00', 'Management Science Auditorium, University of Abuja, Main Campus', 'Tech Organizers', '<p>Tech Organizers is dedicated to providing insightful events to bridge the gap between individuals and the tech industry.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Abuja', 'Abuja', 30801, 2660, 160, 1, '2024-07-11', NULL, 1000, NULL, NULL, 'tech_event5877', NULL, '231rcfre2', 222, 'tech, breakout, event, no-code', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:4:{s:36:\"V2hvIGNhbiBhdHRlbmQgdGhpcyBldmVudD8=\";a:3:{s:2:\"id\";s:36:\"V2hvIGNhbiBhdHRlbmQgdGhpcyBldmVudD8=\";s:8:\"question\";s:26:\"Who can attend this event?\";s:6:\"answer\";s:78:\"Anyone interested in breaking into the tech industry without coding knowledge.\";}s:60:\"SXMgdGhlcmUgYW55IGNvc3QgZm9yIGF0dGVuZGluZyB0aGlzIGV2ZW50Pw==\";a:3:{s:2:\"id\";s:60:\"SXMgdGhlcmUgYW55IGNvc3QgZm9yIGF0dGVuZGluZyB0aGlzIGV2ZW50Pw==\";s:8:\"question\";s:43:\"Is there any cost for attending this event?\";s:6:\"answer\";s:32:\"No, the event is free to attend.\";}s:44:\"V2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";a:3:{s:2:\"id\";s:44:\"V2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";s:8:\"question\";s:32:\"Where is the event taking place?\";s:6:\"answer\";s:94:\"The event will be held at the Management Science Auditorium, University of Abuja, Main Campus.\";}s:44:\"V2hhdCB0aW1lIGRvZXMgdGhlIGV2ZW50IHN0YXJ0Pw==\";a:3:{s:2:\"id\";s:44:\"V2hhdCB0aW1lIGRvZXMgdGhlIGV2ZW50IHN0YXJ0Pw==\";s:8:\"question\";s:31:\"What time does the event start?\";s:6:\"answer\";s:54:\"The event starts at 10:00 AM prompt on 11th July 2024.\";}}', NULL, NULL, NULL, NULL, '#FFA500', 'Register', '<p>Thanks for registering</p>', NULL, NULL),
(377, 'Vision Business Conference 2029', 'EVT_1719971042294716361720510060295', '<p>The aim of the Vision Business Conference is to understand in what ways technology will improve business and also hinder it. By exploring certain topics, with discussions led by key leaders in both the business world and technology space, we hope to position our leaders today for the future. Join us for an insightful and inspiring event that bridges the gap between business and tech.</p>', '2029-06-25', '2029-06-25', '2024/07/09/uploads/17205100385567346image.jpg', 'automated/0aa3a195f94d43b5493d78f9250ac1a1', '08:27:40', '2024-07-09', '2024/07/09/uploads/17205100385567346image.jpg', 0, '09:00', 'Dorset Crown Hotel NY, 78345', '', '<p>Thanks for attending the Vision Business Conference 2029.</p>', '', '', 'hide', NULL, NULL, 'United States [US]', 'New York', 'New York', 220, 36, 1, 1, '2029-06-25', NULL, 1000, NULL, NULL, '1530', NULL, '231rcfre2', 169, 'business, technology, conference, future', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Conference', NULL, NULL, NULL, 'a:4:{s:36:\"V2hlbiBkb2VzIHRoZSBldmVudCBzdGFydD8=\";a:3:{s:2:\"id\";s:36:\"V2hlbiBkb2VzIHRoZSBldmVudCBzdGFydD8=\";s:8:\"question\";s:26:\"When does the event start?\";s:6:\"answer\";s:72:\"The Vision Business Conference 2029 starts on June 25, 2029, at 9:00 AM.\";}s:36:\"V2hlcmUgaXMgdGhlIGV2ZW50IGxvY2F0ZWQ/\";a:3:{s:2:\"id\";s:36:\"V2hlcmUgaXMgdGhlIGV2ZW50IGxvY2F0ZWQ/\";s:8:\"question\";s:27:\"Where is the event located?\";s:6:\"answer\";s:58:\"The event will take place at Dorset Crown Hotel NY, 78345.\";}s:24:\"SXMgdGhlIGV2ZW50IGZyZWU/\";a:3:{s:2:\"id\";s:24:\"SXMgdGhlIGV2ZW50IGZyZWU/\";s:8:\"question\";s:18:\"Is the event free?\";s:6:\"answer\";s:57:\"Yes, the Vision Business Conference 2029 is a free event.\";}s:56:\"V2hhdCBpcyB0aGUgbWFpbiB0b3BpYyBvZiB0aGUgY29uZmVyZW5jZT8=\";a:3:{s:2:\"id\";s:56:\"V2hhdCBpcyB0aGUgbWFpbiB0b3BpYyBvZiB0aGUgY29uZmVyZW5jZT8=\";s:8:\"question\";s:41:\"What is the main topic of the conference?\";s:6:\"answer\";s:101:\"The main topic is understanding how technology will both improve and hinder businesses in the future.\";}}', NULL, NULL, NULL, NULL, '#1A1A1A', 'Register', '<p>Thanks for registering</p>', NULL, NULL),
(382, 'Naija Whiskey Fest', 'EVT_169645879014441720715219454', '<p>The Naija Whiskey Fest is the ultimate experience for whiskey enthusiasts. Join us for a day of discourse, masterclasses, colloquium, swaps, food, games, comedy, and music as we explore the world of whiskey like never before. Dont miss out on this unique and exciting event that brings together the best in whiskey culture.</p><p>Savor different whiskey flavors, laugh with our comedians, and enjoy great music and company at the beautiful Queens Park Event Center in Victoria Island, Lagos. This is the event of the year for all whiskey lovers, offering a blend of education, fun, and socializing.</p>', '2023-12-28', '2023-12-28', '2024/07/11/uploads/17207151841354746image.jpg', 'automated/154bfd9ee5311a512d35947eba79e854', '17:26:59', '2024-07-11', '2024/07/11/uploads/17207151841354746image.jpg', 0, '10:00', 'Queens Park Event Center, VI Lagos', 'Whiskey Spirits Fest', '<p>We are enthusiasts of whiskey and spirits, dedicated to creating memorable experiences for our audience through our events.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Lagos', 'Lagos', 30801, 2660, 160, 1, '2023-12-28', NULL, 1000, NULL, NULL, 'naijawhiskeyfest7069', NULL, '231rcfre2', 279, 'Whiskey, Tasting, Music, Comedy, Food, Lagos, Event', 'paid', 'single', '2000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2348038359677', 'a:4:{s:44:\"V2hhdCBpcyB0aGUgTmFpamEgV2hpc2tleSBGZXN0Pw==\";a:3:{s:2:\"id\";s:44:\"V2hhdCBpcyB0aGUgTmFpamEgV2hpc2tleSBGZXN0Pw==\";s:8:\"question\";s:31:\"What is the Naija Whiskey Fest?\";s:6:\"answer\";s:125:\"The Naija Whiskey Fest is a unique event celebrating whiskey through discourse, masterclasses, food, entertainment, and more.\";}s:40:\"V2hlbiBhbmQgd2hlcmUgaXMgdGhlIGV2ZW50Pw==\";a:3:{s:2:\"id\";s:40:\"V2hlbiBhbmQgd2hlcmUgaXMgdGhlIGV2ZW50Pw==\";s:8:\"question\";s:28:\"When and where is the event?\";s:6:\"answer\";s:88:\"The event is schedule