(392, 'TSLC TECH FEST', 'EVT_17251290134561', '<p>This tech fest is designed to explore the intersection of data security and privacy rights in an increasingly digital world. The event will bring together industry leaders, tech enthusiasts, policy makers, and students to discuss the latest advancements, challenges, and strategies in safeguarding personal and organizational data. It is also aimed at students interested in the rapidly evolving fields of data security and privacy. This event will provide an engaging platform for students to learn about the importance of protecting data, explore emerging technologies, and understand their roles in shaping the future of data security. Through interactive sessions, workshops, and discussions, attendees will gain valuable insights into how data protection impacts their lives and future careers. This Tech Fest will also provide a platform for sharing innovative solutions and best practices for maintaining data integrity and privacy.</p>', '2024-11-16', '2024-11-16', '2024/08/31/uploads/172512901267520521000945538_02.jpeg', '1725003018_1856165', '06:30:13', '2024-08-31', '2024/08/31/uploads/172512901267520521000945538_02.jpeg', 0, '10:00', 'Ekiti State University, Iworoko', 'Tech Savvy Law Club', '<p>Tech Savvy Law Club (TSLC), Ekiti State University (EKSU), is an association formed under the Tech Savvy Lawyers\' Network (TSLN). As the parent body, TSLN is a professional organization established and dedicated to bridging the knowledge gap in global technology law practice in the Nigerian legal ecosystem.</p>', NULL, NULL, 'show', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2024-11-16', NULL, 378, NULL, '1', 'TSLCTECHFEST2.0', NULL, '231rcfre2', 2585, '#tslctechfest2.0, #bytes&rights', 'paid', 'single', '1500', NULL, NULL, 'a:1:{s:40:\"SG93IHdvdWxkIHlvdSBsaWtlIHRvIGF0dGVuZD8=\";a:6:{s:2:\"id\";s:40:\"SG93IHdvdWxkIHlvdSBsaWtlIHRvIGF0dGVuZD8=\";s:8:\"question\";s:29:\"How would you like to attend?\";s:4:\"type\";s:8:\"multiple\";s:7:\"options\";a:2:{i:0;s:9:\"Physical \";i:1;s:7:\"Virtual\";}s:8:\"required\";b:0;s:7:\"specify\";b:0;}}', NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#000000', '', '<p>Thank you for registering for TSLC TECH FEST 2.0</p><p>&nbsp;</p><p>Get ready for an exciting lineup of workshops, keynote speakers, and valuable networking opportunities.</p><p>&nbsp;</p><p>Stay tuned for updates, including the event schedule and speaker announcements.</p><p>We look forward to seeing you there</p>', NULL, NULL),
(393, 'Party with Pivotal - Green City Rave', 'EVT_1719678983441115341726563788450', '<p>The Green City Rave promises to be the biggest party in the city. Join us for a night full of fun, music, and all shades of green. Dont miss out on the green carpet treatment at 8 PM, and get ready to rave at 10 PM. Be part of this iconic event by Pivotal ENT.</p><p>This event is a celebration of life, music, and culture in the heart of the city. Get ready to experience an unforgettable night with great vibes and epic memories.</p>', '2024-10-19', '2024-10-19', '2024/09/17/uploads/17265637498391321image.jpg', 'j90819542aBn72i', '10:03:08', '2024-09-17', '2024/09/17/uploads/17265637498391321image.jpg', 0, '20:00', 'Recreation Club Ubadan', 'Pivotal Entertainment', '<p>Pivotal Entertainment, your ultimate party partner bringing you the best events in town.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, 1, '2024-10-19', NULL, 999, NULL, NULL, 'Pwp8', NULL, '231r23cfre2', 231, 'GreenCityRave, Party, PivotalENT', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:4:{s:48:\"V2hhdCBpcyB0aGUgc3RhcnQgdGltZSBvZiB0aGUgZXZlbnQ/\";a:3:{s:2:\"id\";s:48:\"V2hhdCBpcyB0aGUgc3RhcnQgdGltZSBvZiB0aGUgZXZlbnQ/\";s:8:\"question\";s:36:\"What is the start time of the event?\";s:6:\"answer\";s:81:\"The event starts at 8 PM with the green carpet and the main rave begins at 10 PM.\";}s:28:\"V2hlcmUgaXMgdGhlIHZlbnVlPw==\";a:3:{s:2:\"id\";s:28:\"V2hlcmUgaXMgdGhlIHZlbnVlPw==\";s:8:\"question\";s:19:\"Where is the venue?\";s:6:\"answer\";s:117:\"The specific address details have not been provided on the flier. Please contact the organizers for more information.\";}s:32:\"SG93IG11Y2ggaXMgdGhlIGV2ZW50Pw==\";a:3:{s:2:\"id\";s:32:\"SG93IG11Y2ggaXMgdGhlIGV2ZW50Pw==\";s:8:\"question\";s:22:\"How much is the event?\";s:6:\"answer\";s:28:\"The event is free to attend.\";}s:64:\"SG93IGNhbiBJIGdldCBtb3JlIGluZm9ybWF0aW9uIGFib3V0IHRoZSBldmVudD8=\";a:3:{s:2:\"id\";s:64:\"SG93IGNhbiBJIGdldCBtb3JlIGluZm9ybWF0aW9uIGFib3V0IHRoZSBldmVudD8=\";s:8:\"question\";s:47:\"How can I get more information about the event?\";s:6:\"answer\";s:98:\"For sponsorship and details, you can contact the provided phone numbers: 08054991839, 08127045411.\";}}', NULL, NULL, NULL, NULL, '#008000', 'Register', '<p>Thanks for registering</p>', NULL, NULL),
(394, 'Sip & Paint for Healthy Food Policy', 'EVT_1719437462994347011726842176703', '<p>Join us for a creative and engaging Sip &amp; Paint event dedicated to promoting healthy food policies. Participants will enjoy an artistic experience while learning about the importance of sugar-sweetened beverage taxation.</p><p>This event aims to raise awareness and advocate for better public health initiatives. Dont miss this opportunity to support a good cause and have fun at the same time!</p>', '2024-09-21', '2024-09-21', '2024/09/20/uploads/17268421408390655image.jpg', '1592600277_9880961', '15:22:56', '2024-09-20', '2024/09/20/uploads/17268421408390655image.jpg', 0, '10:00', 'CAPPA Office, Abuja', 'Healthy Food Policy Nigeria', '<p>Healthy Food Policy Nigeria is committed to advocating for public health improvements through better food and beverage policies.</p>', 'healthyfoodpolicyng', '', 'hide', NULL, NULL, 'Nigeria [NG]', 'Abuja Federal Capital Territor', 'Abuja', 48359, 2648, 160, 1, '2024-09-21', NULL, 942, NULL, NULL, '8276', NULL, '231r23cfre2', 77, 'Sip & Paint, Healthy Food Policy, SSB Tax', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:2:{s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";a:3:{s:2:\"id\";s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";s:8:\"question\";s:24:\"What is the event about?\";s:6:\"answer\";s:147:\"The event is a Sip & Paint session aimed at promoting healthy food policies, particularly advocating for the taxation of sugar-sweetened beverages.\";}s:24:\"V2hlbiBpcyB0aGUgZXZlbnQ/\";a:3:{s:2:\"id\";s:24:\"V2hlbiBpcyB0aGUgZXZlbnQ/\";s:8:\"question\";s:18:\"When is the event?\";s:6:\"answer\";s:72:\"The event will take place on 21st September, 2024, starting at 10:00 AM.\";}}', NULL, NULL, NULL, NULL, '#adc436', 'Register', '<p>Thanks for registering</p>', NULL, NULL),
(395, 'IGNITION 5.0', 'EVT_17272804664709', '<p>The theme of IGNITION 5.0 is \"KINGS AND PRIESTS\" as seen in Revelation 1:6.</p><p>The purpose of this event is to cause an ignition in youths and young adults to the knowledge of their Place and Identity as Kings and priests in this world.</p><p>We shall cover aspects around purpose, relationship, academics, business and there shall be impartations.</p><p>IGNITION 5.0 is a time of massive impartation.</p><p>Don\'t&nbsp;miss&nbsp;it.</p>', '2024-12-27', '2024-12-28', '2024/09/25/uploads/17272804653830648Kings_and_Priests_Ignition_5.0_i.jpg', '1609528740i5nm3eaclle988tr2m39eau31', '04:07:46', '2024-09-25', '2024/09/25/uploads/17272804653830648Kings_and_Priests_Ignition_5.0_i.jpg', 0, '16:00', 'GOFAMINT Camp, Off Arulogun Road, Ojoo, Ibadan', 'Comelymhe Impact Network (CIN)', '<p>Comelymhe Impact Network is a dynamic, multi-faceted organization dedicated to holistic growth, focusing on personal development, love, relationships, purpose discovery, marriage, Academic excellence, and business development.</p><p>It serves as a transformative platform, equipping individuals to thrive in these critical areas.</p><p>Through strategic initiatives, events and resources such as Ignition, Media trainings and Academy, consultation and counseling etc. the network empowers people to lead fulfilled lives, build meaningful relationships, find and pursue their purpose, cultivate strong, purpose-driven marriages, excel academically, and develop successful businesses.</p><p>The goal is to foster growth, impact, and sustainable success in every&nbsp;sphere&nbsp;of&nbsp;life.</p>', NULL, NULL, 'show', NULL, NULL, 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, 1, '2024-12-28', NULL, 938, NULL, NULL, 'IGNITION5', NULL, '231rcfre2', 142, '', 'free', NULL, NULL, NULL, NULL, 'a:10:{s:8:\"R2VuZGVy\";a:6:{s:2:\"id\";s:8:\"R2VuZGVy\";s:8:\"question\";s:6:\"Gender\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:4:\"Male\";i:1;s:6:\"Fem