(396, 'Ekiti Innovation Summit 2.0', 'EVT_7823648921647337661729162931438', '<p>The Ekiti Innovation Summit 2.0 is a groundbreaking event aimed at fostering innovation and technological advancements within the Ekiti region. Join industry leaders, innovators, and visionaries for an exciting series of talks, workshops, and networking opportunities.</p><p>This summit acts as a catalyst for economic growth, bringing together local and international experts to explore opportunities in the digital economy, innovation, and technology sectors.</p>', '2024-11-03', '2024-11-06', '2024/10/17/uploads/17291629056182321image.jpg', '1699293069526484enrita2ol63etvanci7', '12:02:11', '2024-10-17', '2024/10/17/uploads/17291629056182321image.jpg', 0, '09:00', 'Obafemi Awolowo Civic Centre, Fajuyi, Ado Ekiti', 'Ministry of Innovation, Science and Digital Economy', '<p>Leading the charge for innovation and digital economy transformation in Ekiti State.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Emure', 30801, 2660, 160, 1, '2024-11-05', NULL, 9593, NULL, '1', 'EKIS2.0', NULL, '231rcfre2', 655, 'innovation, technology, summit', 'free', NULL, NULL, NULL, NULL, 'a:12:{s:16:\"SG9tZSBBZGRyZXNz\";a:5:{s:2:\"id\";s:16:\"SG9tZSBBZGRyZXNz\";s:8:\"question\";s:12:\"Home Address\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:0;}s:8:\"R2VuZGVy\";a:6:{s:2:\"id\";s:8:\"R2VuZGVy\";s:8:\"question\";s:6:\"Gender\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:4:\"Male\";i:1;s:6:\"Female\";}s:8:\"required\";b:0;s:7:\"specify\";b:0;}s:24:\"Sm9iIFRpdGxlL1Bvc2l0aW9u\";a:5:{s:2:\"id\";s:24:\"Sm9iIFRpdGxlL1Bvc2l0aW9u\";s:8:\"question\";s:18:\"Job Title/Position\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:0;}s:28:\"Q29tcGFueS9Pcmdhbml6YXRpb24=\";a:5:{s:2:\"id\";s:28:\"Q29tcGFueS9Pcmdhbml6YXRpb24=\";s:8:\"question\";s:20:\"Company/Organization\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:0;}s:96:\"SW5kdXN0cnkvU2Vjd