(397, 'Fero House of Fun', 'EVT_8390756291843242381729595687431', '<p>Join us at the Fero House of Fun for an unforgettable night of music, fun, and entertainment! Gather your friends and experience the ultimate in fun and excitement with top DJs, incredible raves, and a night that promises to be the highlight of the month. Dont miss out on this fantastic opportunity to unwind and enjoy with great company.</p><p>Immerse yourself in the vibrant atmosphere and dance the night away in a perfect setting adjacent to the Federal University, Oye-Ekiti. Reserve your table now and be a part of something amazing.<br><br>Ticket Information<br>Early birds (online)- 1k | Ticket at the venue - 2000<br>Clique of 5 - 4500(online). | Ticket at the venue - 9000<br>Fero maisonnette of 4 - 20k (Exclusive) online &nbsp;| At&nbsp;the&nbsp;venue-&nbsp;25k</p>', '2024-11-20', '2024-11-21', '2024/10/22/uploads/17295956633906623image.jpg', '1730324643_2474578', '12:14:47', '2024-10-22', '2024/10/22/uploads/17295956633906623image.jpg', 0, '21:00', 'Adjacent Federal University, Oye-Ekiti (Ikole Campus)', 'Fero World Entertainment', '<p>Bringing you the best in entertainment and fun!</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Ikole', 30806, 2660, 160, 1, '2024-11-21', NULL, 1000, NULL, NULL, 'ferohousefun', NULL, '231r23cfre2', 394, 'fun,party,hangout,Ibadan,De-Duchess', 'paid', 'categorized', '1000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2348162219574', 'a:3:{s:44:\"V2hhdCB0aW1lIGRvZXMgdGhlIGV2ZW50IHN0YXJ0Pw==\";a:3:{s:2:\"id\";s:44:\"V2hhdCB0aW1lIGRvZXMgdGhlIGV2ZW50IHN0YXJ0Pw==\";s:8:\"question\";s:31:\"What time does the event start?\";s:6:\"answer\";s:42:\"The event starts at 9 PM on November 20th.\";}s:36:\"V2hhdCBpcyB0aGUgZW50cmFuY2UgZmVlPw==\";a:3:{s:2:\"id\";s:36:\"V2hhdCBpcyB0aGUgZW50cmFuY2UgZmVlPw==\";s:8:\"question\";s:25:\"What is the entrance fee?\";s:6:\"answer\";s:29:\"The entrance fee is 1000 NGN.\"