(398, 'MMP Summit ', 'EVT_17304624112197', '<p>Dear Christian Professional in the workplace.</p><p>&nbsp;</p><p>This is a special invite for you to join us in this one day retreat.</p><p>We will wait on God, pray and strategize to take our world in obedience to the instruction to \"go into the world and make disciples of all nations\"</p><p>&nbsp;</p><p>If your heart has always yearned for more, then this is it.</p><p>Attendance is FREE but registration is compulsory.&nbsp;</p><p>&nbsp;</p><p>It is a physical session and will be from 7am - 7pm.Come fasting.</p><p>Dinner will be at 6pm. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>We look forward to seeing you..</p><p>Cheers!</p>', '2024-11-02', '2024-11-02', '2024/11/01/uploads/17304624101479114IMG_20241016_WA0022.jpg', '1730461700_6853972', '12:00:11', '2024-11-01', '2024/11/01/uploads/17304624101479114IMG_20241016_WA0022.jpg', 0, '20:00', 'Radisson Blu Hotel Victoria Island Lagos ', 'Market Ministers Pray', '<p>Christian professionals whose aim is to see excellent and prosperity in the workplace.</p>', NULL, NULL, 'hide', NULL, NULL, 'Nigeria [NG]', 'Lagos', 'Lagos', 30985, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'MMPRetreat', NULL, '231rcfre2', NULL, 'MMPSummit', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Training', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#000000', NULL, NULL, NULL, NULL),
