(402, 'Thoughtful & Thankful Concert', 'EVT_1234567890123447011731786280732', '<p>Join us for Thoughtful &amp; Thankful, a celebratory event bringing together renowned speakers, vibrant performances, and a community united in gratitude. The event features musical acts and inspiring stories from celebrated personalities. Dont miss this opportunity to connect and reflect in a joyous atmosphere.</p><p>Hosted at the AB Foundation Civic Center, this event promises an engaging experience with insightful sessions and ample networking opportunities. Mark your calendars for an unforgettable evening filled with thoughtfulness and thanks.</p>', '2024-11-28', '2024-11-28', '2024/11/16/uploads/17317862623649860image.jpg', 'j90819542aBn72i', '20:44:40', '2024-11-16', '2024/11/16/uploads/17317862623649860image.jpg', 0, '16:00', 'AB Foundation Civic Center, Adebayo, Ado Ekiti, Ekiti State', 'Thoughtful & Thankful Team', '<p>Join us for a memorable event.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2024-11-30', NULL, 4382, NULL, '1', 'TnT', NULL, '231rcfre2', 144, 'thoughtful, thankful, event', 'free', NULL, NULL, NULL, NULL, NULL, '2174184445_1731098250', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:2:{s:40:\"V2hhdCBpcyB0aGUgZGF0ZSBvZiB0aGUgZXZlbnQ/\";a:3:{s:2:\"id\";s:40:\"V2hhdCBpcyB0aGUgZGF0ZSBvZiB0aGUgZXZlbnQ/\";s:8:\"question\";s:30:\"What is the date of the event?\";s:6:\"answer\";s:36:\"The event is on November 28th, 2024.\";}s:44:\"V2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";a:3:{s:2:\"id\";s:44:\"V2hlcmUgaXMgdGhlIGV2ZW50IHRha2luZyBwbGFjZT8=\";s:8:\"question\";s:32:\"Where is the event taking place?\";s:6:\"answer\";s:60:\"AB Foundation Civic Center, Adebayo, Ado Ekiti, Ekiti State.\";}}', NULL, NULL, NULL, NULL, '#FF4081', 'Register', '<p>Thanks for registering. You can also join our community to get more updates. Visit link below to join community.<br><br><a href=\"https://chat.whatsapp.com/I7UhjFM3bQQ8nWZ3Vv6yX7\">https://chat.whatsapp.com/I7UhjFM3bQQ8nWZ3Vv6yX7</a></p>', NULL, NULL),
(403, 'Ibadan Hangouts Owambe', 'EVT_1719765438294732141732182736514', '<p>Join us for the OWAMBE Extra, a cultural festival concept celebrating its 6th year anniversary by Ibadan Hangout. Experience the rich cultural heritage and diverse traditions of Owambe in the heart of Ibadan with thrilling performances, vibrant displays, and alluring entertainment. Dont miss out on this culturally exciting event!</p><p>The event includes a lineup of sensational music, dance, and cultural showcases. Secure your tickets early and be a part of this unforgettable celebration.</p>', '2024-12-27', '2024-12-27', '2024/11/21/uploads/1732182702642780image.jpg', '1671808628e9ala802t0r99cxniarle623ed', '10:52:16', '2024-11-21', '2024/11/21/uploads/1732182702642780image.jpg', 0, '11:00', 'Matrix, BCOS, Bashorun, Ibadan', 'IH', '<p>Join us for the OWAMBE Extra, a cultural festival concept celebrating its 6th year anniversary by Ibadan Hangout. Experience the rich cultural heritage and diverse traditions of Owambe in the heart of Ibadan with thrilling performances, vibrant displays, and alluring entertainment. Dont miss out on this culturally exciting event!</p><p>The event includes a lineup of sensational music, dance, and cultural showcases. Secure your tickets early and be a part of this unforgettable celebration.</p>', '', '', 'show', NULL, NULL, 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, 1, '2024-12-31', NULL, 2000, NULL, '1', 'Ibadanhangoutowambe', NULL, '231r23cfre2', 115, 'Owambe, Ibadan, Cultural, Festival', 'paid', 'categorized', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '+2348139065694', 'a:2:{s:52:\"V2hhdCBpcyB0aGUgZHJlc3MgY29kZSBmb3IgdGhlIGV2ZW50Pw==\";a:3:{s:2:\"id\";s:52:\"V2hhdCBpcyB0aGUgZHJlc3MgY29kZSBmb3IgdGhlIGV2ZW50Pw==\";s:8:\"question\";s:37:\"What is the dress code for the event?\";s:6:\"answer\";s:118:\"Attendees are encouraged to dress in traditional or culturally inspired attire to celebrate the theme of the festival.\";}s:44:\"V2hhdCB0aW1lIGRvZXMgdGhlIGV2ZW50IHN0YXJ0Pw==\";a:3:{s:2:\"id\";s:44:\"V2hhdCB0aW1lIGRvZXMgdGhlIGV2ZW50IHN0YXJ0Pw==\";s:8:\"question\";s:31:\"What time does the event start?\";s:6:\"answer\";s:50:\"The event starts at 11:00 AM on December 27, 2024.\";}}', NULL, NULL, NULL, NULL, '#f15a24', 'Get Ticket', '<p>&nbsp;</p>', 1, NULL),
(404, 'National Corporate Governance Conference', 'EVT_17324627911720', '<p>Join us for the annual National Corporate Governance Conference, where industry leaders, experts, and stakeholders will gather to discuss and shape the future of corporate governance in Nigeria.</p>', '2024-11-26', '2024-11-26', '2024/11/24/uploads/173246279030463921000002520.jpg', '1732460092_1166660', '03:39:51', '2024-11-24', '2024/11/24/uploads/173246279030463921000002520.jpg', 0, '10:00', 'NAF Conference Centre', 'Association of Corporate Governance Professionals of Nigeria ', '<p>The Association inspires its members to assess periodically their company’s own governance practices and their Board’s effectiveness in light of those company-specific circumstances; giving due consideration to the points-of-view of the company’s long-term shareholders and of governance authorities.</p>', NULL, NULL, 'hide', NULL, NULL, 'Nigeria [NG]', 'Abuja Federal Capital Territor', 'Abuja', 48359, 2648, 160, 2, '2024-11-27', NULL, 348, NULL, '1', 'acgpn', NULL, '231rcfre2', 5, 'corporate governance ', 'free', NULL, NULL, NULL, NULL, 'a:2:{s:56:\"QXJlIHlvdSByZWdpc3RlcmluZyBmb3IgbXVsdGlwbGUgcGVvcGxlIA==\";a:6:{s:2:\"id\";s:56:\"QXJlIHlvdSByZWdpc3RlcmluZyBmb3IgbXVsdGlwbGUgcGVvcGxlIA==\";s:8:\"question\";s:40:\"Are you registering for multiple people \";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:2:\"No\";i:1;s:3:\"Yes\";}s:8:\"required\";b:0;s:7:\"specify\";b:0;}s:72:\"RGVzY3JpYmUgdGhlIHJlYXNvbiB5b3UncmUgYXR0ZW5kaW5nIHRoZSBjb25mZXJlbmNlIA==\";a:5:{s:2:\"id\";s:72:\"RGVzY3JpYmUgdGhlIHJlYXNvbiB5b3UncmUgYXR0ZW5kaW5nIHRoZSBjb25mZXJlbmNlIA==\";s:8:\"question\";s:52:\"Describe the reason you\'re attending the conference \";s:4:\"type\";s:4:\"text\";s:7:\"options\";b:0;s:8:\"required\";b:1;}}', '6487679252_1732463632', NULL, NULL, NULL, '', NULL, NULL, NULL, '', 'a:2:{s:2:\"dc\";s:0:\"\";s:4:\"link\";s:0:\"\";}', 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#000000', 'Register', '<p>Thank you for completing your registration for the annual national corporate governance conference.</p>', NULL, NULL);
