(405, 'Jogor Hotels Bar and Grills Pool Party ', 'EVT_17334820189349', '<p>Dive into fun at our epic <strong>Jogor Hotel Pool Party!</strong> Join us for a day of sunshine, cool vibes, and great company. Enjoy refreshing drinks, delicious snacks, live music, and games by the pool. Whether you’re here to swim, chill, or dance, it’s going to be a splashing good time!</p><p><strong>When:</strong> December 7th, 2024<br><strong>Where:</strong> Jogor Hotel</p><p>Don’t forget your swimsuit and good vibes—we’ll take care of the rest!&nbsp;</p>', '2024-12-07', '2024-12-08', '2024/12/06/uploads/17334823534062833Untitled_Artwork_2_page_0001.jpg', '1733480993_7554394', '10:46:58', '2024-12-06', '2024/12/06/uploads/17334823534062833Untitled_Artwork_2_page_0001.jpg', 0, '17:00', '1 Harvester Drive, off Liberty Stadium Road, off MKO Abiola Way, Ibadan', 'Jogor Hotel', '<p>Jogor Hotel is a hotel in Ibadan.</p>', NULL, NULL, 'hide', NULL, NULL, 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, 1, '2024-12-07', NULL, 200, NULL, NULL, 'jogorpoolparty', NULL, '231r23cfre2', 13, '@jogorhotel', 'paid', 'single', '2000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '#000000', 'Register', '<p>Thank you for registering; check your email for the confirmation ticket.&nbsp;</p><p>See you soon!</p>', NULL, NULL),
(406, 'UNiTE to End Violence Against Women Webinar ', 'EVT_1728394012375993921733684449950', '<p>This event is part of the 16 Days of Activism, focusing on the theme to UNiTE to End Violence Against Women. Join us as we come together to raise awareness and drive change in efforts to combat gender-based violence.</p><p>Through discussions and sharing experiences, we aim to create a safe environment where everyone can contribute to ending violence against women. Be part of this global movement and make a difference.</p>', '2024-12-13', '2024-12-13', '2024/12/09/uploads/1733762869996156416_days_webinar_.jpg', '1537374982obusn6a8u39t94101n5ol', '20:00:49', '2024-12-08', '2024/12/09/uploads/1733762869996156416_days_webinar_.jpg', 0, '19:00', '123456', 'The Health City & AskTheDoc', '<p>Join The Health City and AskTheDoc in this crucial event to make an impact.</p>', '', '', 'show', NULL, NULL, '1/Afghanistan [AF]', '42/Badakhshan', '5909/Eshkashem', 5909, 42, 1, 1, '2024-12-13', NULL, 74, NULL, NULL, 'HEALTHCITYWEBINAR', NULL, '231rcfr32', 171, 'UNiTE,EndViolence,Women,Activism,Awareness', 'free', NULL, NULL, NULL, 'Google Meet', 'a:1:{s:12:\"R2VuZGVyIA==\";a:6:{s:2:\"id\";s:12:\"R2VuZGVyIA==\";s:8:\"question\";s:7:\"Gender \";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:5:\"Male \";i:1;s:7:\"Female \";}s:8:\"required\";b:0;s:7:\"specify\";b:0;}}', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, 'a:2:{s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";a:3:{s:2:\"id\";s:32:\"V2hhdCBpcyB0aGUgZXZlbnQgYWJvdXQ/\";s:8:\"question\";s:24:\"What is the event about?\";s:6:\"answer\";s:93:\"This event is part of the 16 Days of Activism to unite voices against violence towards women.\";}s:36:\"SG93IGNhbiBJIGpvaW4gdGhlIGV2ZW50Pw==\";a:3:{s:2:\"id\";s:36:\"SG93IGNhbiBJIGpvaW4gdGhlIGV2ZW50Pw==\";s:8:\"question\";s:25:\"How can I join the event?\";s:6:\"answer\";s:114:\"The event will be held online on Google Meet on December 10th, 2024. You can register to receive the joining link.\";}}', NULL, NULL, NULL, NULL, '#b00c13', 'Register', '<p>Thank you for registering. &nbsp;Here is the link to join https://meet.google.com/qoa-hurs-ncm&nbsp;</p>', NULL, NULL);
